INSERT INTO `collections` (`id`, `parent_id`, `collection_type_id`, `name`, `description`, `material_count`, `image_filename`, `thumbnail_id`, `is_private`, `created_by_user_id`, `updated_by_user_id`, `created_at`, `updated_at`)
VALUES
	(1,NULL,1,'Linda Arbuckle Recipe Collection','Linda Arbuckle\'s GlazeChem database.  Provided courtesy of Linda Arbuckle (http://lindaarbuckle.com)',1887,'1.55b87525434ed.jpg',NULL,0,1,1,'2015-07-25 02:33:42','2016-05-31 17:04:55'),
	(2,NULL,1,'The Sankey Glaze Database','Provided courtesy of <a href=\"http://www.johnsankey.ca/\">John Sankey</a>. This database is a tribute to Alisa Clausen of Denmark, who has tested most of the glazes presented here in a consistent way and so generously shared her work with the world.',509,NULL,NULL,0,1,1,'2015-07-25 02:33:42','2016-01-22 20:21:38'),
	(3,NULL,3,'John Britt\'s Complete Guide to High-Fire Glazes','Some recipes contained within John Britt\'s book, The Complete Guide to High-Fire Glazes, Glazing & Firing at Cone 10\r\n\r\nhttp://johnbrittpottery.com/shop/the-complete-guide-to-high-fire-glazes-glazing-firing-at-cone-10/',68,'3.55b871d812081.jpg',NULL,0,1,1,'2015-07-25 02:33:42','2016-08-11 21:32:28'),
	(4,NULL,1,'Tom Coleman','Tom Coleman recipes and variations.  For more of Tom\'s recipes, see http://tomandelainecolemangallery.com/books--videos.html',24,NULL,NULL,0,1,1,'2015-07-25 05:19:30','2016-03-26 14:23:06'),
	(5,NULL,1,'Daniel Rhodes','A list of books by Daniel Rhodes available <a href=\"http://www.amazon.com/Daniel-Rhodes/e/B001HD03A6/ref=dp_byline_cont_book_1\">here on Amazon</a>.  <a href=\"https://en.wikipedia.org/wiki/Daniel_Rhodes\">Daniel Rhodes Wikipedia page</a>',4,NULL,NULL,0,1,1,'2015-07-25 06:36:19','2015-08-17 03:13:55'),
	(6,NULL,3,'Val Cushing','Recipes by, attributed to, and deriving from Val Cushing',134,'6.55b873b03d1c3.jpg',NULL,0,1,1,'2015-07-25 06:46:51','2016-05-29 16:49:03'),
	(7,NULL,3,'Synthetic Ash','A collection of recipes for synthetic ashes.',5,NULL,NULL,0,7,7,'2015-07-25 09:23:17','2015-07-25 09:45:08'),
	(8,NULL,4,'Bookmarks','Your personal bookmarks',4,NULL,NULL,1,7,7,'2015-08-08 23:14:34','2017-09-09 03:02:11'),
	(39,NULL,3,'Nigel Wood\'s Chinese Glazes','A collection of recipes in Nigel Wood\'s book Chinese Glazes.  <a href=\"http://www.amazon.com/Chinese-Glazes-Origins-Chemistry-Recreation/dp/0812221435\">Buy <i>Chinese Glazes</i> on Amazon.</a>',5,'39.55c9b003f2b5d.jpg',NULL,0,7,7,'2015-08-11 23:19:15','2016-04-02 18:55:48'),
	(50,NULL,1,'Clayart','Glazes from the old <a href=\"http://ceramicsweb.org/glazedatabase.html\">CeramicsWeb Clayart archives</a>',2,'50.55d542314b4b6.png',NULL,0,1,1,'2015-08-20 17:55:34','2015-08-21 11:38:56'),
	(51,NULL,1,'Pete Pinnell','',26,NULL,NULL,0,1,1,'2015-08-22 12:02:45','2015-11-09 03:26:22'),
	(67,NULL,3,'Cone 6 Bases & Variations','A few cone 6 bases with variations using opacifiers and colorants.',137,NULL,NULL,0,1,1,'2015-09-09 11:47:13','2016-01-01 07:11:27'),
	(73,NULL,1,'Blue Celadon','',7,NULL,NULL,0,7,7,'2015-09-16 22:38:11','2015-09-23 01:36:44'),
	(77,NULL,3,'Western Pennsylvania Potters Community','Links to Cone 6 Oxidation Glaze tests with pictures and formulas:\r\nhttp://wpapotters.blogspot.com/2012/04/links-to-cone-6-oxidation-glaze-tests.html',66,NULL,NULL,0,1,1,'2015-10-09 04:34:30','2015-10-21 16:24:36'),
	(78,NULL,3,'The Glazeitorium','The Glazeitorium is a free resource for glaze information that includes images, recipes, and a forum for discussion. Based off the glaze pallet of Tara Hagen the Glazeitorium houses glaze that have been tested in electric and soda kilns at cone 10 as well as a new selection of cone 6 electric glazes.\r\n\r\nhttp://glazeitorium.blogspot.com/',103,NULL,NULL,0,1,1,'2015-10-09 19:37:05','2015-10-18 20:02:21'),
	(79,NULL,3,'Leach 4321 Line Blends','A collection of line blends using Leach 4321 as a base.',32,NULL,NULL,0,7,7,'2015-10-15 03:46:47','2015-10-16 03:11:29'),
	(80,NULL,1,'Tea Dust','',5,NULL,NULL,0,7,7,'2015-10-16 19:23:00','2015-10-16 19:23:51'),
	(81,NULL,3,'High-Fire Bases & Variations','High-fire base glazes and variations using various coloring and opacifying oxides.',46,NULL,NULL,0,1,1,'2015-10-17 16:18:19','2015-10-18 20:03:24'),
	(123,NULL,1,'Iron, Manganese, Cobalt Triaxial','A triaxial testing the combination of iron (Red Iron Oxide), manganese (Manganese Dioxide), and cobalt (Cobalt Oxide) colorants.\r\n\r\nThis triaxial was inspired by Nigel Wood\'s research into Chinese blue & white underglaze colorants and Chinese blue glazes. Wood notes that the compositions of the cobalt ores used by ancient Chinese potters varied significantly through time and place. The ratio of the three primary colorants (cobalt, iron, and manganese) largely determine the character of the resulting blue. (Note that other oxides in the underglaze and glaze composition will also modify the color.)\r\n\r\nFor more information, see Nigel Wood\'s Science and Civilisation in China: Volume 5, Chemistry and Chemical Technology, Part 12, Ceramic Technology, Part 6, Pigments, Enamels, and Gilding (pages 680-692). Nigel Wood writes extensively about the composition of Chinese blue & white underglaze pigments, with analyses of cobalt bearing absolites and other ores. Nigel Wood also covers the subject in Chinese Glazes (pages 61-66).\r\n\r\nNigel Wood\'s \"Chinese blue stoneware glaze\" is to be found in \"Chinese Glazes\" and on Glazy at http://glazy.org/recipes/2928\r\n\r\nThe test glaze is \"Simple Clear\" glaze to replace Leach 4321 as a standard test glaze. http://glazy.org/recipes/3465\r\nThis glaze is basically Digitalfire\'s G1947U (http://glazy.org/recipes/3306) without the Zinc.',41,NULL,NULL,0,7,7,'2015-11-20 19:14:17','2015-11-22 16:49:43'),
	(173,NULL,1,'Chinese Glazes Analyses','Analyses from Nigel Wood\'s Chinese Glazes',70,NULL,NULL,0,7,7,'2016-02-19 14:31:22','2017-08-25 04:46:16'),
	(180,NULL,1,'Jun','',23,NULL,NULL,0,7,7,'2016-02-28 17:53:18','2016-12-23 20:05:24'),
	(243,NULL,1,'To Test April 2016','',6,NULL,NULL,0,7,7,'2016-04-02 16:56:59','2016-10-11 15:52:42'),
	(265,NULL,1,'Chinese Glazes Temmoku','',7,NULL,NULL,0,7,7,'2016-04-29 01:39:36','2016-04-29 01:40:56'),
	(286,NULL,3,'Louis Katz','These recipes were imported from Louis Katz\'s Hyperglaze database: http://falcon.tamucc.edu/~lkatz/allglazes.txt\r\n\r\nMore information about Louis Katz can be found at http://www.louiskatz.net/',799,'286.574c0876e16cb.jpg',NULL,0,1,1,'2016-05-29 01:38:04','2016-05-31 17:09:23'),
