VALUES
	(6065,NULL,NULL,'Green Gloss',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from Cone 10 “Dimig Green”\r\nThis beautiful glossy green stays green unless the reduction is too heavy. Sometimes a pink blush will highlight one side of the piece. This glaze crazes. (Probably more flint will fix it). It is a stronger green with 5% copper but also leaches more. Becasue of the high copper content and the barium it is not useful as a liner. Strontium substitution for the barium doesn’t work. It helps fix the crazing but the color changes to a muddy pink.\r\nAt 4% copper carbonate it leached 23.2 mg/l copper\r\nAt 5% it leached 43.1 mg/l copper and 14.2 barium. Thin to medium application\r\n￼',690,0,0,0,0,30,30,8,3,NULL,'',255,255,255,2024,0,0,0.00,'12125:38|12457:14|12371:11|12062:11|12407:10|12400:8|12058:5|12135:3|','12125:38|12457:14|12371:11|12062:11|12407:10|12400:8|12058:5|12135:3|12120:4|',0,1,NULL,'2016-10-08 08:05:12','2016-10-08 17:20:37',NULL),
	(6066,NULL,NULL,'Denim Blue',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nThis is a Val Cushing glaze; the master has done it again. This glaze is probably stable enough to pass a leach test, which means you can use it at these colorant levels on the interiors of vessels for food use.\r\nLeach test results not yet completed. Thin to medium application',750,0,0,0,0,30,30,9,3,NULL,'',255,255,255,2025,0,0,0.00,'12371:40|12457:16|12400:16|12288:10|12433:9|12169:9|','12371:40|12457:16|12400:16|12288:10|12433:9|12169:9|12443:2|12593:2|12114:1|12120:1|',0,1,NULL,'2016-10-08 08:53:40','2016-10-08 17:20:39',NULL),
	(6067,NULL,NULL,'Cold Yellow',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from Cone 10 “Alfred Yellow”\r\nThis cold yellow glaze goes to pale blue where thick and warm brown where thin. Strontium does not work as a substitute for barium in this glaze. The yellow color is completely lost with strontium.\r\nThis is not a liner glaze. It leaches barium at 7.25 mg/l. Thin to medium application.',930,0,0,0,0,30,30,9,3,NULL,'',255,255,255,2026,0,0,0.00,'12407:34|12062:20|12135:16|12400:12|12167:10|12288:8|','12407:34|12062:20|12135:16|12400:12|12167:10|12288:8|12469:10|12593:2|12387:2|',0,1,NULL,'2016-10-08 08:58:02','2016-10-08 17:20:42',NULL),
	(6068,NULL,NULL,'Dark Satin',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from E. Cooper’s “Matt Iron”\r\nA textured satin with variegated color. The attractive teal/green/black color mix will change to a smooth satin black with more dark colorants but may also then be in danger of leaching. A dark glaze should contain no more than 2 to 3 percent cobalt if it is to be used as a liner. This glaze is more colorful on an iron-bearing clay body.\r\nAt 6% cobalt (twice as much as the recipe calls for) it leached 0.1 mg/l of cobalt. Thin to medium application.',680,0,0,0,0,30,30,9,2,NULL,'',255,255,255,2027,0,0,0.00,'12407:48|12457:16|12058:12|12400:11|12288:7|12169:6|','12407:48|12457:16|12058:12|12400:11|12288:7|12169:6|12387:5|12114:3|12593:2|',0,1,NULL,'2016-10-08 09:11:26','2016-10-08 17:20:44',NULL),
	(6069,NULL,NULL,'Satin Celadon',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from E. Cooper’s “Clear Pale Olive”\r\nA lovely satin celadon (more celery colored, not blue). The addition of more silica will make it shinier and move toward correcting the crazing (which is only visible if you stain it). But I don’t like the glaze as well with the silica addition. I added a little frit to give it a slight sheen.\r\nThis glaze settled out more than the others despite the addition of bentonite so I added a small amount of Epsom salts to keep it in suspension\r\nNot as nice on porcelain.',520,0,0,0,0,30,30,9,3,NULL,'',255,255,255,2028,0,0,0.00,'12349:34|12457:20|12400:20|12058:19|12433:5|12167:2|','12349:34|12457:20|12400:20|12058:19|12433:5|12167:2|12593:2|12387:2|',0,1,NULL,'2016-10-08 09:14:17','2016-10-08 17:20:47',NULL),
	(6070,NULL,NULL,'Textured Blue',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nThis is Marcia Selsor’s Waxy White base with a number of colorants added. This variation is derived from a 50/50 color blend with rutile incorporated in the base for texture. There are other nice combinations with rutile but this one remains a favorite. Gloes glossy on interiors and breaks beautifully over textures.\r\nMedium application.',750,0,0,0,0,30,30,9,3,NULL,'',255,255,255,2029,0,0,0.00,'12349:30|12169:20|12433:17|12288:13|12457:10|12400:10|','12349:30|12169:20|12433:17|12288:13|12457:10|12400:10|12469:10|12393:3|12593:2|12120:1|12114:1|',0,1,NULL,'2016-10-08 09:20:55','2016-10-08 17:20:49',NULL),
	(6071,NULL,NULL,'Chun or Jun',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nMarciaSelsor’s “Jun”, unchanged.\r\nThis is a beautiful bright marshmellow-like white textured semi-gloss. I tried adjusting this formula but it didn’t come out as well as the original. (You might want to try to take out the zinc.) The difficulty is that to make this glaze more stable one has to destroy an important quality--its ability to run and hold itself in beautiful fat drips. (Don’t use near the foot.)\r\nI accept that it might not last as long with the dishwasher use (although after 3 years of use I can’t see any changes). Application depends on where you want the glaze to form drips. (It is good lightly tinted too, with small amounts of iron or nickel.)',533,0,0,0,0,30,30,9,3,NULL,'',255,255,255,2030,0,0,0.00,'12407:34|12400:30|12169:17|12457:10|12135:6|12467:3|','12407:34|12400:30|12169:17|12457:10|12135:6|12467:3|12593:2|',0,1,NULL,'2016-10-08 09:24:27','2016-10-08 17:20:52',NULL),
	(6072,NULL,NULL,'Transparent Gloss',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nAn adjustment of Pete Pinnell’s “1214”\r\nThis transparent fits quite well on the clay body I used, which shrinks 13%. This glaze may be used as a liner. A small addition of iron will convert it to a grey/green celadon.\r\nThin application.',470,0,0,0,0,30,30,8,4,NULL,'',255,255,255,2031,0,0,0.00,'12171:29|12458:29|12288:19|12400:19|12331:4|','12171:29|12458:29|12288:19|12400:19|12331:4|12593:2|',0,1,NULL,'2016-10-08 10:11:45','2016-10-08 17:20:54',NULL),
	(6073,NULL,NULL,'Temmoku',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nAn adjustment of Hamer’s “Temmoku”\r\nThis cone 6 Temmoku has 13% iron, a lot more than a Temmoku at Cone 10. At cone 6 reduction Temmokus seem to need more than the usual 8% required at Cone 10 to give the same black/red color break. At 11% iron this formula makes a handsome orange glaze with darker brown coloration in the depths.\r\nThin to medium application',540,0,0,0,0,30,30,8,1,NULL,'',255,255,255,2032,0,0,0.00,'12371:58|12457:18|12058:12|12400:12|','12371:58|12457:18|12058:12|12400:12|12387:13|12593:2|',0,1,NULL,'2016-10-08 10:15:09','2016-10-08 17:20:57',NULL),
	(6074,NULL,NULL,'Speckle',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived for E. cooper’s “Cream Matt Speckle”\r\nA smooth off-white semi-matte with orangy speckles. The matte is not useful as a liner.\r\nApply thin to medium.',480,0,0,0,0,30,30,4,1,NULL,'',255,255,255,2033,0,0,0.00,'12349:34|12457:29|12125:15|12288:14|12169:5|12400:3|','12349:34|12457:29|12125:15|12288:14|12169:5|12400:3|12469:10|12260:3|12593:2|',0,1,NULL,'2016-10-08 10:17:23','2016-10-08 17:21:00',NULL),
	(6075,NULL,NULL,'Shino',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from a cone 10 glaze “Porcelain Shino”\r\nShinos are temperamental. This one needs strong reduction and is more effective on a dark iron body. It is rather bland on white stoneware. It is capable of carbon trapping. It also crazes. This glaze does not work well thickly applied.\r\nApplication should be thin to medium.',590,0,0,0,0,30,30,9,NULL,NULL,'',255,255,255,2034,0,0,0.00,'12349:40|12422:30|12058:17|12406:8|12288:5|','12349:40|12422:30|12058:17|12406:8|12288:5|12593:2|',0,1,NULL,'2016-10-08 10:20:45','2016-10-08 17:21:04',NULL),
	(6076,NULL,NULL,'Satin White',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from E. Cooper’s “Cool Matt Blue”\r\nThis is a cool white satin. If you want it more matte, remove 2% frit. If you want it a little shinier, add 2% frit. Can be used as a liner glaze.\r\nThin to medium application.',480,0,0,0,0,30,30,6,2,NULL,'',255,255,255,2035,0,0,0.00,'12407:38|12457:20|12288:18|12400:11|12169:8|12433:5|','12407:38|12457:20|12288:18|12400:11|12169:8|12433:5|12469:8|12593:2|',0,1,NULL,'2016-10-08 10:43:33','2016-10-08 17:21:06',NULL),
	(6077,NULL,NULL,'Pale Blue Matte',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from Rick Malgrem “Bronze/Green Matte”\r\nA light blue which breaks to a darker grey in deep places. Too matte to be used as a liner. Thin to medium application.',750,0,0,0,0,30,30,1,2,NULL,'',255,255,255,2036,0,0,0.00,'12371:55|12457:24|12288:14|12400:7|','12371:55|12457:24|12288:14|12400:7|12469:10|12393:6|12120:3|12593:2|12114:1|',0,1,NULL,'2016-10-08 16:40:26','2016-10-08 17:21:08',NULL),
	(6078,NULL,NULL,'Ochre/Red',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from Hayden “Cinnamon Red”\r\nThis glaze, as indicated by its name, gives a nice color shift from ochre to iron red. It is low in silica so it is not a candidate for a liner glaze for food use.\r\nThin to medium application.',570,0,0,0,0,30,30,4,2,NULL,'',255,255,255,2037,0,0,0.00,'12371:40|12457:21|12288:15|12135:13|12080:6|12400:4|','12371:40|12457:21|12288:15|12135:13|12080:6|12400:4|12387:8|12432:5|12593:3|',0,1,NULL,'2016-10-08 16:44:06','2016-10-08 17:21:11',NULL),
	(6079,NULL,NULL,'Iron Red',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nDerived from Cone 10 “Oharata Red”\r\nThis iron red satin glaze is low in silica so probably it is not good for use as a liner for food containers. but it has an interesting ability to form smallsparkly crystals spaced out in the glaze. The addition of 10% flint will make it a shiny two toned iron saturate and will make it useful as a liner.\r\nThin to medium application.',570,0,0,0,0,30,30,4,2,NULL,'',255,255,255,2038,0,0,0.00,'12349:49|12400:19|12080:11|12457:8|12433:7|12288:6|','12349:49|12400:19|12080:11|12457:8|12433:7|12288:6|12387:16|12593:2|',0,1,NULL,'2016-10-08 16:46:47','2016-10-08 17:21:13',NULL),
	(6080,NULL,NULL,'Fake Ash',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nAn adjustment of “Andie’s Fake Ash”\r\nThis is a beautifully variegated fake ash glaze. It is a brighter yellow on porcelain with hints of green where thicker and terra cotta colored where thin. it is not stable because it is low in silica but to alter it would change the ash effect. While it might not meet strict requirements of stability, I use it anyway (having substituted strontium for barium). It is lovely on plates and bowls. If you wish to be more careful in your use of it you could put it instead on vases, spoon jars, dry storage jars, and other non wet food items. It is more beautiful with strontium as a substitute (one of the few I tested that is).\r\nWhen made with barium it leached 3.28 mg/l',1080,0,0,0,0,30,30,NULL,NULL,NULL,'',255,255,255,2039,0,0,0.00,'12135:25|12058:24|12389:23|12169:10|12431:9|12080:5|12323:2|12400:2|','12135:25|12058:24|12389:23|12169:10|12431:9|12080:5|12323:2|12400:2|12593:2|',0,1,NULL,'2016-10-08 16:49:00','2016-10-08 17:21:15',NULL),
	(6081,NULL,NULL,'Dark Blue',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\nSource: A mystery\r\nThis is a glossy dark blue. The addition of a small amount of iron keeps the blue from moving toward violet. It may be used as a liner glaze if the cobalt is kept at or under 2 percent. Brighter on porcelain.\r\nNo cobalt leaching was detected with 2% CoCO3 in the formula. Thin to medium application',760,0,0,0,0,30,30,8,2,NULL,'',255,255,255,2040,0,0,0.00,'12407:41|12400:25|12457:19|12288:10|12167:5|','12407:41|12400:25|12457:19|12288:10|12167:5|12114:2|12593:2|12387:2|',0,1,NULL,'2016-10-08 16:56:57','2016-10-08 17:21:18',NULL),
	(6082,NULL,NULL,'Copper Red',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\n￼An adjustment of Pete Pinnell’s “Cranberry”\r\nThis is a dependable bright copper red. It sometimes gives an attractive mottled surface. ‘\r\nIt is not suitable as a liner glaze.\r\nIt leaches 12.2 mg/l copper.  Thin to medium application.',640,0,0,0,0,30,30,9,2,NULL,'',255,255,255,2041,0,0,0.00,'12371:74|12457:11|12168:10|12400:5|','12371:74|12457:11|12168:10|12400:5|12120:2|12442:2|12593:2|',0,1,NULL,'2016-10-08 17:03:50','2016-10-08 17:21:20',NULL),
	(6083,NULL,NULL,'Chocolate',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\n￼Derived from E. Cooper’s “Brown Matte”\r\nAlthough zinc is supposed to disappear in reduction, this glaze doesn’t work without it. Chocolate looks like a slip glaze similar to old Albany slip glazes. I woul try using it under trailing, brush work, etc. The color varies subtly depending on where the flame touches it.\r\nThin the medium application.',585,0,0,0,0,30,30,9,2,NULL,'',255,255,255,2042,0,0,0.00,'12389:68|12467:18|12457:10|12167:4|','12389:68|12467:18|12457:10|12167:4|12593:2|',0,1,NULL,'2016-10-08 17:06:21','2016-10-08 17:21:25',NULL),
	(6084,NULL,NULL,'Blue/Green Gloss',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\n￼Derived from E. Cooper’s “Medium Blue”.\r\nThis glaze has nice color shifts from light blue to medium green where thicker, to dark brown where thin. May be stable. I added a small amount of Epsom salts to keep it in good suspension because the large quantity of frit in this glaze can cause it to settle badly, despite the addition of bentonite.\r\nThin to medium application.',750,0,0,0,0,30,30,8,2,NULL,'',255,255,255,2043,0,0,0.00,'12349:27|12169:27|12167:20|12058:13|12400:13|','12349:27|12169:27|12167:20|12058:13|12400:13|12443:7|12387:2|12593:2|12114:1|',0,1,NULL,'2016-10-08 17:08:46','2016-10-08 17:21:27',NULL),
	(6085,NULL,NULL,'Ash Brown',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\n￼Derived from E. Cooper’s “Broken Yellow Brown”\r\nThe substitution of strontium in this glaze was less than successful. The original glaze has a surface complexity which was lost with the substitution.\r\nThis is not a liner glaze. Thin to medium application Leach test results not yet in.',585,0,0,0,0,30,30,1,2,NULL,'',255,255,255,2044,0,0,0.00,'12389:50|12457:19|12062:11|12058:10|12400:10|','12389:50|12457:19|12062:11|12058:10|12400:10|12593:2|',0,1,NULL,'2016-10-08 17:11:43','2016-10-08 17:21:30',NULL),
	(6086,NULL,NULL,'Amber',NULL,NULL,NULL,'From Diana Pancioli\'s excellent publication, Glaze Forward:\r\nhttp://www.dianapancioli.com/\r\nhttp://www.dianapancioli.com/downloads/GlazeForward.pdf\r\n\r\n￼Derived from cone 10 “Amber Celadon”\r\nI tested a number of variations of this recipe; I hope to simplify it, but the resulting changes produced a much less interesting glaze. You could try adding a percent of iron if you want it a little darker.\r\nThin to medium application.',585,0,0,0,0,30,30,8,3,NULL,'',255,255,255,2045,0,0,0.00,'12389:39|12349:18|12457:15|12400:10|12458:9|12169:4|12288:3|12135:2|','12389:39|12349:18|12457:15|12400:10|12458:9|12169:4|12288:3|12135:2|',0,1,NULL,'2016-10-08 17:14:32','2016-10-08 17:21:32',NULL),
	(6088,NULL,NULL,'Selsor Paul\'s Yellow Matte (original)',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/\r\n\r\nThis glaze later tested by Alisa Clausen using Barium carbonate instead of Barium frit 3247\r\n\r\nMatt yellow very dry when thin',920,0,0,0,0,30,30,1,NULL,NULL,'yellow',255,255,0,NULL,0,0,0.00,'12169:45|12174:20|12469:15|12135:10|12288:5|12457:3|','12169:45|12174:20|12469:15|12135:10|12288:5|12457:3|12387:3|',0,1,NULL,'2016-10-09 05:26:02','2016-10-09 05:53:42',NULL),
	(6089,NULL,NULL,'Hammer Red Black',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/\r\n\r\nThin is plum red, thick is black',570,0,0,0,0,30,30,NULL,NULL,NULL,'',122,16,16,NULL,0,0,0.00,'12371:50|12457:15|12387:15|12058:10|12400:10|','12371:50|12457:15|12387:15|12058:10|12400:10|',0,1,NULL,'2016-10-09 05:30:20','2016-10-09 05:53:40',NULL),
	(6091,NULL,NULL,'Web Red (from Clayart)',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/',640,0,0,0,0,30,30,NULL,NULL,NULL,'',166,30,30,NULL,0,0,0.00,'12349:55|12400:21|12252:13|12457:11|','12349:55|12400:21|12252:13|12457:11|12442:1|',0,1,NULL,'2016-10-09 05:33:42','2016-10-09 05:53:38',NULL),
	(6092,NULL,NULL,'Web Red (Oxblood)',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/',650,0,0,0,0,30,30,NULL,NULL,NULL,'',166,30,30,NULL,0,0,0.00,'12349:55|12400:21|12252:13|12457:11|','12349:55|12400:21|12252:13|12457:11|12442:2|',0,1,NULL,'2016-10-09 05:35:35','2016-10-09 05:53:35',NULL),
	(6093,NULL,NULL,'Selsor Waxy White Liner',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/\r\n\r\nthis base from a handout from Pullman, Wa. 1980\r\n\r\nGood functional base glaze with these variations \r\nPumpkin (Oakleaf) 5% red iron oxide, 3% rutile \r\nGold 3% Rutile \r\nLavender 4% cobalt Carb (use sparingly) \r\nLight Blue .5% cobalt carb and 3% rutile \r\nSpicey Mustard 3% iron oxide plus 3% rutile',480,0,0,0,0,30,30,9,NULL,NULL,'white',255,255,255,NULL,0,0,0.00,'12349:30|12252:20|12433:17|12469:15|12288:13|12400:10|12457:9|','12349:30|12252:20|12433:17|12469:15|12288:13|12400:10|12457:9|',0,1,NULL,'2016-10-09 05:37:10','2016-10-09 05:53:34',NULL),
	(6095,NULL,NULL,'Plum',NULL,NULL,NULL,'This is originally a Reduction cone 6 glaze from Marcia Selsor: http://www.marciaselsorstudio.com/\r\n\r\nThis can settle rock hard (add epson salts 2tbsp. per 10,000 grams)',490,0,0,0,0,30,30,NULL,NULL,NULL,'',255,255,255,NULL,0,0,0.00,'12371:30|12400:20|12457:10|12465:10|','12371:30|12400:20|12457:10|12465:10|',0,1,NULL,'2016-10-09 05:49:08','2016-10-09 05:53:32',NULL),
