	(6392,NULL,NULL,'Ru Moku',NULL,NULL,NULL,'Tennessee Technological University - Appalachian Center for Crafts - Clay Studio\r\n￼\r\nVince Pitelka, 2015\r\n\r\nhttps://sites.tntech.edu/wpitelka/handoutsinformation/\r\n\r\nNotes:\r\n\r\nSemi-gloss, Semi-transparent, Good Color-Breaking, mottled purple to blue to brown and even orange, depending on thickness of application and nature of claybody beneath. Very nice glaze, partially because results vary so widely.',460,0,0,0,0,34,34,9,3,NULL,'',255,255,255,NULL,0,0,0.00,'12371:63|12400:15|12252:15|12457:8|','12371:63|12400:15|12252:15|12457:8|12593:3|12393:3|12387:2|',0,1,NULL,'2015-01-01 16:00:00','2015-01-01 16:00:00',NULL),
