	(6394,NULL,NULL,'Shaner Red',NULL,NULL,NULL,'Tennessee Technological University - Appalachian Center for Crafts - Clay Studio\r\n￼\r\nVince Pitelka, 2015\r\n\r\nhttps://sites.tntech.edu/wpitelka/handoutsinformation/\r\n\r\nNotes:\r\n\r\nOpaque, Semi-matt, Good Color-Breaking, interesting mottled iron red/brown where thin and olive green where thick, medium thin application gives best color-breaking.',570,0,0,0,0,34,34,4,1,NULL,'',191,13,13,NULL,0,0,0.00,'12371:49|12288:23|12457:20|12433:4|12080:4|','12371:49|12288:23|12457:20|12433:4|12080:4|12387:6|12593:2|',0,1,NULL,'2015-01-01 16:00:00','2015-01-01 16:00:00',NULL),
