	(6398,NULL,NULL,'Vince\'s Clear',NULL,NULL,NULL,'Tennessee Technological University - Appalachian Center for Crafts - Clay Studio\r\n￼\r\nVince Pitelka, 2015\r\n\r\nhttps://sites.tntech.edu/wpitelka/handoutsinformation/\r\n\r\nNotes:\r\n\r\nClear, Semi-gloss, good over slip decoration, apply thin or it will go milky.',470,0,0,0,0,34,34,9,4,NULL,'',255,255,255,NULL,0,0,0.00,'12371:22|12058:15|12349:13|12400:13|12125:13|12457:10|12288:6|12433:5|12062:4|','12371:22|12058:15|12349:13|12400:13|12125:13|12457:10|12288:6|12433:5|12062:4|12593:3|',0,1,NULL,'2015-01-01 16:00:00','2015-01-01 16:00:00',NULL),
