	(9412,NULL,NULL,'Pete Pinnell Clear Adjusted with Cobalt (sub MgO for CaO)',NULL,NULL,NULL,'Original clear recipe adjusted for my local materials.\r\n\r\nSubbed Talc for Wollastonite while trying to maintain same silica & alumina levels as well as R2O:RO ratio.',760,0,0,0,0,34,35,6,2,NULL,'',255,255,255,3510,0,0,0.00,'12371:37|12288:20|12433:20|12400:15|12458:8|','12371:37|12288:20|12433:20|12400:15|12458:8|12117:1|',0,7,NULL,'2017-05-20 21:13:41','2017-05-27 02:04:59',NULL),
	(9530,NULL,NULL,'Heino Turquoise ^10 (variation)',NULL,NULL,NULL,'From Clayart:\r\n\r\ndavid mcbeth on tue 27 nov 01\r\n\r\n\r\n>a glaze we called Heino \r\n>blue, a cone 10 glaze, made, \r\n>obviously, by Otto or Vivian Heino. It contains barium, and copper as \r\n>a colorant. \r\n\r\nGordon - The following is from a sheet of glaze recipes Otto gave me... \r\n\r\nBarium Turquoise Matt C10 \r\nNepheline Syenite 58 \r\nBall Clay #4 6 \r\nLithium Carb 3 \r\nBarium Carb 26 \r\nSilica 7 \r\nEPK 2 \r\n\r\nCopper Carb 2.5 \r\nBentonite 1 \r\n\r\nI hope this helps \r\n\r\ndave \r\n\r\nDavid McBeth, MFA\r\n\r\n\r\nA similar recipe from Clayart:\r\n\r\n\r\nblue barium matt\r\n\r\nupdated fri 8 may 98\r\n\r\n  \r\nGary Wang on thu 7 may 98\r\n\r\nSusan, \r\n\r\nHere are a few Barium Matt Glazes I have tried. Please take care when \r\nhandling Barium. \r\n\r\n- Gary Wang \r\n\r\n\r\nBarium Blue Matt from Vivika and Otto Heino Cone 5-10 \r\n\r\nBarium Carbonate 60 \r\nNepheline Syenite 130 \r\nKentucky Ball Clay 14 \r\nFlint 16 \r\nLithium Carbonate 6 \r\nCopper Carbonate 6',745,0,0,0,0,34,NULL,7,1,NULL,'',19,131,153,NULL,0,0,0.00,'12349:58|12062:26|12400:7|12058:6|12323:3|12288:2|','12349:58|12062:26|12400:7|12058:6|12323:3|12288:2|12120:3|12593:1|',0,1,NULL,'2017-05-27 22:02:01','2017-05-27 22:06:41',NULL),
	(10834,NULL,NULL,'Pinnell Blue Celadon, NZK, CNZK, Wo, c11',NULL,NULL,NULL,'This is a further adjustment of Pete Pinnell\'s Blue Celadon glaze as found in John Britt\'s The Complete Guide to High-Fire Glazes.\r\n\r\n* Grolleg Kaolin replaced with New Zealand Halloysite and calcined New Zealand Halloysite.\r\n\r\n* Whiting replaced with Wollastonite.\r\n\r\n* Temperature adjusted up to Orton cone 11 - 11 1/2.\r\n\r\n* For my taste, Yellow Iron Oxide best at .4-.45 rather than .5',510,0,0,0,0,35,35,9,3,NULL,'',79,219,210,3933,0,0,0.00,'12371:31|12458:24|12400:23|12288:10|12288:9|12062:2|','12371:31|12458:24|12400:23|12288:10|12288:9|12062:2|12442:1|',0,7,NULL,'2017-08-23 18:27:53','2017-08-30 03:20:06',NULL),
	(12010,10,12288,'Tile #6','Tile #6 Kaolin clay','Tile #6 Kaolin',NULL,'#6 Tile clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n A secondary (sedimentary) kaolin.  Manufactured by Georgia Kaolin Co.; comes from Georgia.  Plastic, off-white, fine-grained, high shrinkage. Good flashing  slip in salt/soda.\r\n Analyses:\r\n Obstler: (Cushing 1986)\r\n % 0.04 Na2O  0.58 MgO  0.43 CaO  38.2 Al2O3  46.9 SiO2  1.42 TiO2  0.35 Fe2O3  13.9 H2O\r\n Cushing:\r\n % 0.04 Na2O  0.58 MgO  0.43 CaO  38.2 Al2O3  46.9 SiO2  1.42 TiO2  0.35 Fe2O3  13.9 LOI\r\n Tichane (CB):\r\n % 0.6 MgO  0.4 CaO  38.2 Al2O3  46.9 SiO2  1.4 TiO2  0.4 Fe2O3  13.9 LOI\r\n IMC:\r\n % 0.04 Na2O  0.58 MgO  0.43 CaO  38.20 Al2O3  46.90 SiO2  1.42 TiO2  0.35 Fe2O3  13.90 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:18:27',NULL),
	(12011,11,12144,'A.P. Green','A.P. Green, AP Green Fire Clay',NULL,NULL,'A.P. Green supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes. A Missouri fire clay - a secondary deposit of clay and sediment in deep fresh water. Manufactured by A.P. Green; comes from Missouri.\r\n Analyses:\r\n Obstler:\r\n % 0.5-1.5 K2O  0.1-0.6 MgO  0.1-0.6 CaO  29-33 Al2O3 50-54 SiO2  1.5-2.3 TiO2  1.5-2.5 Fe2O3  10.1-12.0 LOI\r\n Cooper & Royle: (Appendix 8)\r\n % 0.20 K2O  0.05 Na2O  0.05 CaO  0.03 MgO  30.0 Al2O3 52.0 SiO2  1.5 TiO2  1.0 Fe2O3  10.0 LOI\r\n Cushing:\r\n % 0.05 Na2O  0.20 K2O  0.03 MgO  0.05 CaO  30.0 Al2O3 52.0 SiO2  1.5 TiO2  1.0 Fe2O3  10.0 LOI\r\n Tichane (CB):\r\n % 0.1 Na2O  1.0 K2O  0.4 MgO  31.9 Al2O3 51.0 SiO2  1.5 TiO2  1.7 Fe2O3  12.4 LOI\r\n IMC:  (lists as Missouri fireclay)\r\n % 0.05 Na2O  0.20 K2O  0.03 MgO  0.05 CaO  30.0 Al2O3 52.0 SiO2  1.5 TiO2  1.0 Fe2O3  10.0 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:10:46',NULL),
	(12012,12,12288,'Ajax Glomax','Ajax Glomax kaolin','Ajax Glomax Kaolin',NULL,'Ajax kaolin (calcined) supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB): (Ajax kaolin - calcined)\r\n % 0.3 Na2O  0.1 K2O  0.2 MgO  0.1 CaO  44.4 Al2O3 53.8 SiO2  1.6 TiO2  0.4 Fe2O3\r\n IMC:\r\n % 0.30 Na2O  0.41 K2O  44.40 Al2O3 53.16 SiO2  0.94 TiO2  0.42 Fe2O3  0.38 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2016-02-10 04:54:34',NULL),
	(12013,13,12288,'Ajax P kaolin','Ajax P kaolin','Ajax P Kaolin',NULL,'Ajax P kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Mined in Idaho; blushes in wood or reduction firing.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.3 MgO  0.3 CaO  38.1 Al2O3\r\n 45.2 SiO2  1.5 TiO2  0.5 Fe2O3  13.5 LOI\r\n IMC:\r\n % 0.04 K2O  0.30 MgO  0.25 CaO  38.14 Al2O3\r\n 45.41 SiO2  1.97 TiO2  0.48 Fe2O3  13.45 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:54:14',NULL),
	(12014,14,NULL,'Alajo kiln ash','Alajo kiln ash',NULL,NULL,'Alajo kiln ash supplies several oxides, especially CaO.\n Analyses:\n Cardew:\n % 0.44 Na2O  1.03 K2O  5.34 MgO  41.38 CaO  1.55 Al2O3\n 8.54 SiO2  3.68 P2O5  1.27 Fe2O3  7.3 H2O  29.07 CO2\n 0.26 SO3  0.25 Cl2\n (Ash from wood-fired kilns, Alajo, Ghana. Washed and dried.\n The wood was a mixture of Neem and yellow-flowering Cassia\n (Analysis, Imperial Institute, London, 1946).)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-14 08:46:04',NULL),
	(12015,15,NULL,'Albany slip','Albany slip','Albany Slip',NULL,'Albany slip supplies SiO2, Al2O3, Fe2O3, TiO2, CaO, K2O, MgO,\n and Na2O.\n An iron-rich clay consisting of shale, slate, limestone,\n sandstone, and dolomite deposits from glacial Lake Albany during\n the Wisconsin Ice Age (10-15 thousand years ago). Contains\n illite, quartz, limonite, chlorite, calcite, dolomite, and\n kaolinite.\n Comes from the Hudson River Valley area around Albany, NY; no\n longer available.  Substitute Archie Bray (Alberta) Slip [Cushing].\n Not plastic; melts at 1170C.\n Analyses:\n Obstler:\n % 0.8-1 Na2O  3.25 K2O  2.68 MgO  5.78 CaO  14.66 Al2O3\n 57.4 SiO2  0.8-1 TiO2  5.2 Fe2O3  9.46 LOI plus\n 0.13 of Ba+Sr+Pb+Li+Mn\n Cooper & Royle: (Appendix 8)\n % 0.40 Na2O  2.75 K2O  6.28 CaO  3.35 MgO  11.54 Al2O3\n 59.48 SiO2  0.90 TiO2  4.13 Fe2O3  0.08 MnO  10.40 LOI\n Chappell:\n % 0.8 Na2O  3.2 K2O  2.5 MgO  5.8 CaO  14.6 Al2O3\n 57.6 SiO2  0.4 TiO2  5.2 Fe2O3  0.08 MnO  9.5 LOI\n Cushing:\n % 0.8 Na2O  3.25 K2O  2.2 MgO  6.0 CaO  14.0 Al2O3\n 58.0 SiO2  0.8 TiO2  5.2 Fe2O3  9.46 LOI\n Tichane (AG):\n % 0.4 Na2O  2.8 K2O  3.4 MgO  6.3 CaO  11.5 Al2O3\n 59.5 SiO2  0.9 TiO2  4.1 Fe2O3  0.1 MnO  10.4 LOI\n Tichane (TCB, CB):\n % 0.4 Na2O  2.8 K2O  3.4 MgO  6.3 CaO  11.5 Al2O3\n 59.5 SiO2  0.9 TiO2  4.1 Fe2O3  10.4 LOI\n IMC:\n % 0.80 Na2O  3.20 K2O  2.71 MgO  5.81 CaO  14.63 Al2O3\n 57.82 SiO2  0.40 TiO2  5.21 Fe2O3  9.41 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:39:22',NULL),
	(12016,16,NULL,'Alberta Slip','Alberta Slip, Archie Bray Slip','Alberta Slip',NULL,'Alberta slip supplies SiO2, Al2O3, Fe2O3, TiO2, CaO, K2O, MgO, and Na2O.  A slip designed by the Archie Bray Foundation to substitute for Albany slip.\r\n Analyses:\r\n IMC:\r\n % 2.00 Na2O  3.35 K2O  3.32 MgO  6.30 CaO  0.19 BaO 14.56 Al2O3\r\n 64.83 SiO2  0.46 TiO2  5.01 Fe2O3',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-15 16:07:12',NULL),
	(12017,17,NULL,'Alkaline Frit','Alkaline Frit',NULL,NULL,'High Alkaline Frit supplies SiO2, Na2O, CaO, K2O, Al2O3, and B2O3.\n Generic high alkaline frit; map to your favorite.\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:40:33',NULL),
	(12018,18,NULL,'Alkaline leadless frit','Alkaline leadless frit',NULL,NULL,'Map to your favorite alkaline frit.\n American substitute: Frit 3110.\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:41:46',NULL),
	(12019,19,NULL,'Alumina','Alumina','Alumina',NULL,'Alumina supplies Al2O3.\n Pure form of alumina, created by heating alumina hydrate to red\n heat in order to drive off the water.\n Alumina occurs naturally as the mineral Corundum; in hardness,\n Corundum is second only to diamond. Alumina also occurs in\n various ores such as Bauxite (Al2O3 2H2O), Gibbsite (Al2O3\n 3H2O), and Diaspore (Al2O3 H2O); these are crushed, calcined,\n and purified to give aluminum oxide.\n Alumina can be used in glazes to provide extra alumina. Note that\n the coarseness/fineness of the alumina can make a big difference\n in how it influences the glaze (finer grades usually lead to less\n matt surfaces). Note that alumina hydrate is more easily suspended\n in glazes and has better adhesive properties.\n Analyses:\n Hopper:\n Al203\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.002)\n % 99.1 Al2O3  0.03 SiO2  0.03 Fe2O3  0.05 CaO  0.57 Na2O\n Cushing:\n Al2O3\n Parmelee:\n Al2O3\n IMC:\n Al2O3\n',5,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:42:04',NULL),
	(12020,20,NULL,'Alumina Hydrate','Alumina Hydrate','Alumina Hydrate',NULL,'Alumina hydrate supplies Al2O3.\n Alumina hydrate is hydrated aluminum oxide.\n Alumina hydrate is sometimes used in glazes to provide extra\n alumina; more often, because of its refractory nature, it is\n used in kiln wash or salt-fire wadding. Alumina hydrate is more\n easily suspended in glazes than calcined alumina, and has better\n adhesive properties.\n Analyses:\n Hopper:\n Al2(OH)6\n Cooper & Royle:\n Alumina hydrate = Al(OH)3\n Alumina hydroxide = Al2(OH)6\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.001)\n % 65.O Al2O3  0.25 SiO2  0.01 Fe2O3  0.35 Na2O  34.4 LOI\n Cuff:\n Al2(OH)6\n Chappell:\n Al(OH)3\n Cushing:\n Al2O3  3 H2O\n Memmott:\n Al2(OH)6\n Parmelee:\n Al2(OH)6\n IMC:\n % 65.39 Al2O3  34.62 LOI\n',5,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:42:40',NULL),
	(12021,21,NULL,'Aluminum sulfate','Aluminum sulfate',NULL,NULL,'Alumina sulfate supplies Al2O3.\n Analyses:\n Parmelee:\n Al2(SO4)3\n',5,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-14 08:50:03',NULL),
	(12022,22,NULL,'Amblygonite','Amblygonite','Amblygonite',NULL,'Amblygonite supplies Li2O, Al2O3, and P2O5.\n A lithium mineral. Theoretical composition 2LiF Al2O3 P2O5 (10%\n Li2O). There may be substitution of Na for Li and of OH for F.\n Can form a glaze by itself at c/6-8 [Hopper]. The fluorine and\n phosphorus components make for interesting glazes that tend to\n be naturally opaque. Requires oxidation to prevent blisters\n [Hamer, IMC].\n Analyses:\n Obstler:\n 2LiF  Al2O3  P2O5  nH2O\n Klein & Hurlbut:\n LiAlFPO4\n Chappell: (adds to 92.3; presumably remainder is LOI)\n % 7.8 Li2O  34.2 Al2O3  2.8 SiO2  47.5 P2O5\n Cushing: (P2O6 is an error)\n 2LiF  Al2O3  P2O6\n Parmelee:\n % 1.63 Na2O  0.30 K2O  8.48 Li2O  0.15 CaO  22.96 Al2O3\n 5.16 SiO2  0.019 Fe2O3  54.42 P2O5  2.67 F  4.80 LOI\n IMC:\n % 10.10 Li2O  24.50 Al2O3  48.00 P2O5  17.40 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:09:57',NULL),
	(12023,23,NULL,'Anhydrous Borax','Anhydrous Borax','Anhydrous Borax',NULL,'Anhydrous borax supplies B2O3 and Na2O.\n Dehydrated form of borax; relatively concentrated source of\n B2O3. Produced by heating borax to 735C. Water soluble, but less\n so than raw borax at room temperature.\n Analyses:\n Hopper:\n Na2O  2 B2O3\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.009)\n % 30.8 Na2O  69.2 B2O3\n Cushing:\n Na2O  2 B2O3\n Parmelee: (Melted borax)\n Na2O  2 B2O3\n IMC:\n % 30.82 Na2O  69.19 B2O3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:43:51',NULL),
	(12024,24,NULL,'Antimony oxide','Antimony oxide','Antimony Oxide',NULL,'Antimony oxide supplies Sb2O3.\n Antimony oxide is used in low temperature glazes with lead,\n iron, or titanium to produce yellow. Also functions as a\n glass-former and as an opacifier.\n Produced by heating the mineral Stibnite (Sb2S3), or as\n a by-product of other refining processes.\n Analyses:\n Hopper:\n Sb3O4\n Cooper & Royle: (Antimony trioxide)\n Sb2O3\n Rhodes:\n Sb2O3\n Chappell:\n Sb2O3\n Parmelee:\n Sb2O3\n IMC:\n Sb2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12025,25,NULL,'Applewood ash','Applewood ash','Applewood Ash',NULL,'Apple wood ash supplies several oxides, especially CaO.\n Analyses:\n Cardew:\n % 1.9 Na2O  11.8 K2O  5.5 MgO  70.9 CaO  2.7 SiO2\n 4.5 P2O5  2.7 SO3\n (B.C.S., 58 (1959), 59P).\n Recalculated on \'washed\' basis:\n % 6.37 MgO  82.16 CaO  3.13 SiO2  5.21 P2O5  3.13 SO3\n Conrad: (adds to 105%)\n % 4.9 Na2O  0.89 K2O  3.25 MgO  54.2 CaO  1.98 Al2O3  2.65 SiO2\n 1.6 P2O5  0.7 Fe2O3  34.7 MnO\n Rogers:\n % 10.45 Na2O  19.24 K2O  7.46 MgO  63.6 CaO\n 1.31 SiO2  4.9 P2O5  1.66 Fe2O3\n 0.93 SO3  0.45 Cl\n Hamer & Hamer:\n % 6 Na2O  15 K2O  6 MgO  65 CaO\n 2 SiO2  5 P2O5  1 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:44:55',NULL),
	(12026,26,NULL,'Arsenic oxide','Arsenic oxide','Arsenic Oxide',NULL,'Arsenic oxide supplies As2O3.\n Poisonous white powder created by roasting Arsenopyrite (FeAsS).\n Used in glasses and enamels but not usually in ceramic glazes.\n Analyses:\n Parmelee:\n As2O3\n IMC:\n As2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12027,27,NULL,'Bamboo ash','Bamboo ash',NULL,NULL,'Bamboo ash supplies several oxides, especially SiO2.\n Analyses:\n Cardew:\n % 4.8 K2O  0.3 CaO  86.4 SiO2  0.4 Fe2O3  8.1 LOI\n (\'Bamboo sugar\', Java)\n (Bourry, 1st English edition, 1901)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:45:29',NULL),
	(12028,28,NULL,'Barley straw ash','Barley straw ash',NULL,NULL,'Barley straw ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Hamer & Hamer:\n % 5 Na2O  22 K2O  3 MgO  8 CaO\n 57 SiO2  5 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:46:07',NULL),
	(12029,29,NULL,'Beech ash','Beech ash',NULL,NULL,'Beech ash supplies several oxides, especially CaO and K2O.\n Analyses:\n Rogers:\n % 8.34 Na2O  24.29 K2O  8.20 MgO  42.00 CaO\n 3.01 SiO2  6.2 P2O5  0.62 Fe2O3  4.52 MnO\n 2.10 SO3  0.72 Cl\n Rogers (appendix):\n % 4.0 Na2O  16.5 K2O  10.9 MgO  55.5 CaO\n 5.45 SiO2  5.45 P2O5  1.0 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:46:33',NULL),
	(12030,30,NULL,'Birch ash','Birch ash',NULL,NULL,'Birch ash supplies several oxides, especially CaO and K2O.\n Analyses:\n Conrad:\n % 9 Na2O  22.6 K2O  14.3 MgO  29.6 CaO  11.5 SiO2  7.9 P2O5\n 1.3 Fe2O3  0.4 MnO\n Rogers (appendix):\n % 7.69 Na2O  12.53 K2O  7.69 MgO  57.5 CaO\n 3.84 SiO2  7.69 P2O5  1.0 Fe2O3\n Hamer & Hamer:\n % 9 Na2O  18 K2O  11 MgO  45 CaO  4 Al2O3\n 8 SiO2  4 P2O5  1 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:46:42',NULL),
	(12031,31,NULL,'Cedar ash','Cedar ash',NULL,NULL,'Cedar ash supplies several oxides, especially CaO and SiO2.\n Analyses:\n Conrad:\n % 3.7 Na2O  4.3 K2O  6 MgO  44.2 CaO  0.52 Al2O3\n 24.28 SiO2  10.6 P2O5  1.01 Fe2O3  0.3 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:48:29',NULL),
	(12032,32,NULL,'Coal ash','Coal ash','Coal Ash',NULL,'Coal ash supplies several oxides, especially SiO2, Al2O3,\n TiO2, and Fe2O3.\n Sulfur content of some coals may cause difficulties.\n Analyses:\n Green: (from Bennett and Hawley, Methods of Silicate Analysis 1965)\n 0.24 KNaO  0.20 MgO  0.55 CaO  1.04 Al2O3  3.33 SiO2\n 0.8 TiO2  0.36 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 19:47:34',NULL),
	(12033,33,NULL,'Common ash','Common ash',NULL,NULL,'Common ash supplies several oxides, especially SiO2 and CaO.\n Analyses:\n Sanders:\n % 2.33 Na2O  3.91 K2O  3.3 MgO  22.42 CaO  8.91 Al2O3\n 30.99 SiO2  1.91 P2O5  3.04 Fe2O3  1.26 MnO  21.44 LOI\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:48:44',NULL),
	(12034,34,NULL,'Desert plant ash','Desert plant ash',NULL,NULL,'Desert plant ash supplies several oxides, especially Na2O and CaO.\n Analyses:\n Tichane (TCB): (adds to 91%)\n % 28.0 Na2O  5.5 K2O  0.5 MgO  21.1 CaO  1.8 P2O5  34.0 CO2\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:49:10',NULL),
	(12035,35,NULL,'Elder ash','Elder ash',NULL,NULL,'Elder ash supplies several oxides, especially CaO.\n Analyses:\n Hamer & Hamer:\n % 2 Na2O  17 K2O  16 MgO  38 CaO\n 14 SiO2  13 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:49:41',NULL),
	(12036,36,NULL,'Fern ash','Fern ash',NULL,NULL,'Fern ash supplies several oxides, especially SiO2 and Al2O3.\n Analyses:\n Rogers (appendix):\n % 0.56 Na2O  4.81 K2O  7.44 MgO  8.59 CaO  19.32 Al2O3\n 55.02 SiO2  0.3 TiO2 0.92 P2O5  1.67 Fe2O3  1.36 MnO\n Hamer & Hamer: (Bracken and fern)\n % 3 Na2O  26 K2O  8 MgO  12 CaO  10 Al2O3\n 33 SiO2  6 P2O5  1 Fe2O3  1 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:50:00',NULL),
	(12037,37,NULL,'Grass ash','Grass ash',NULL,NULL,'Grass ash supplies several oxides, especially SiO2 and CaO.\n Generic grass ash.\n Analyses:\n Green: (weed and grass ash)\n 0.2 KNaO  0.3 MgO  0.5 CaO  0.2 Al2O3  2.0 SiO2\n Green: (unwashed lawn clippings, from Leach A Potter\'s Book)\n 0.41 KNaO  0.29 MgO  0.30 CaO  0.27 Al2O3  1.09 SiO2\n 0.12 P2O5  0.03 Fe2O3\n Green: (washed lawn clippings from Leach A Potter\'s Book)\n 0.15 KNaO  0.32 MgO  0.53 CaO  0.38 Al2O3  1.52 SiO2\n 0.15 P2O5  0.05 Fe2O3\n Rogers: (Lawn grass)\n % 6.20 Na2O  6.19 K2O  5.65 MgO  12.88 CaO  16.60 Al2O3\n 39.64 SiO2  9.00 P2O5  3.44 Fe2O3\n Hamer & Hamer: (Lawn grass)\n % 3 Na2O  5 K2O  5 MgO  10 CaO  11 Al2O3\n 59 SiO2  5 P2O5  2 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:50:55',NULL),
	(12038,38,NULL,'Hardwood ash','Hardwood ash','Hardwood Ash',NULL,'Hardwood ash supplies fluxes.\n Map to a particular wood ash.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:51:21',NULL),
	(12039,39,NULL,'Hearth ash','Hearth ash',NULL,NULL,'Hearth ash supplies several oxides, especially CaO and SiO2.\n Analyses:\n Cardew:\n % 0.55 Na2O  1.49 K2O  5.44 MgO  35.9 CaO  3.69 Al2O3\n 14.08 SiO2  2.14 P2O5  0.94 Fe2O3  34.32 H2O  0.14 MnO\n (Hearth ash (\'Dobai\'), Japan (E. Kato, Interceram, 2 (1962), 110).)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:52:16',NULL),
