	(12041,41,NULL,'Isu-wood ash','Isu-wood ash',NULL,NULL,'Isu-wood ash supplies several oxides, especially CaO and SiO2.\n Issu (Distylium racemosum) is the source of a very popular wood\n ash in Japan. Note the incredible variations in the analyses.\n Analyses:\n Sanders:\n % 0.06 Na2O  2.51 K2O  5.99 MgO  47.71 CaO  4.38 Al2O3\n 34.6 SiO2  3.93 P2O5  0.49 Fe2O3  0.33 MnO\n Cardew:\n % 0.2 Na2O  1 K2O  6.6 MgO  36.68 CaO  4.16 Al2O3\n 16.19 SiO2  3.67 P2O5  0.92 Fe2O3  30.08 H2O\n 0.8 SO3  0.48 MnO\n (Isu Ash from Hagi, Japan (E. Kato, Interceram, 2 (1962), 110).)\n Leach (A Potter\'s Book):\n % 0.84 K2O  1.57 MgO  15.95 CaO  0.63 Al2O3\n 71.96 SiO2  0.42 P2O5  0.28 Fe2O3  8.29 LOI\n (from work done by J.B.E. Patterson)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:53:08',NULL),
	(12042,42,NULL,'Ivy ash','Ivy ash',NULL,NULL,'Ivy ash supplies several oxides, especially CaO, K2O, and Na2O.\n Analyses:\n Hamer & Hamer:\n % 20 Na2O  26 K2O  8 MgO  25 CaO\n 12 SiO2  6 P2O5  3 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:53:30',NULL),
	(12043,43,NULL,'Larch wood ash','Larch wood ash',NULL,NULL,'Larch wood ash supplies several oxides, especially CaO, K2O,\n SiO2, and MnO.\n Analyses:\n Hamer & Hamer:\n % 9 Na2O  21 K2O  8 MgO  27 CaO  1 Al2O3\n 11 SiO2  8 P2O5  4 Fe2O3  11 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:54:00',NULL),
	(12044,44,NULL,'Mahogany ash','Mahogany ash',NULL,NULL,'Mahogany ash supplies several oxides, especially SiO2.\n Analyses:\n Cardew:\n % 10.98 Na2O  9.49 K2O  4.39 MgO  9.49 CaO  3.81 Al2O3\n 51.51 SiO2  2.08 P2O5  4.53 Fe2O3\n (Australian white mahogany)\n (Forestry Commission of New South Wales, 1956)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:10:11',NULL),
