	(12046,46,NULL,'Meadow hay ash','Meadow hay ash',NULL,NULL,'Meadow hay ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Rogers (appendix):\n % 7.0 Na2O  25.67 K2O  5.0 MgO  11.56 CaO\n 29.57 SiO2  6.2 P2O5  1.0 Fe2O3\n Hamer & Hamer: (Meadow grass)\n % 4 Na2O  15 K2O  5 MgO  10 CaO  3 Al2O3\n 58 SiO2  4 P2O5  1 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:25:21',NULL),
