	(12048,48,NULL,'Oak ash','Oak ash',NULL,NULL,'Oak ash supplies several oxides, especially CaO.\n Analyses:\n Conrad:\n % 9.12 Na2O  14 K2O  12 MgO  30 CaO  0.1 Al2O3\n 15.3 SiO2  13.1 P2O5  2.4 Fe2O3  0.1 MnO\n Tichane (TCB):\n % 3.9 Na2O  9.5 K2O  3.9 MgO  72.5 CaO\n 2.0 SiO2  5.8 P2O5\n Rogers: (English oak)\n % 9.12 Na2O  14.00 K2O  12.01 MgO  30.02 CaO 0.13 Al2O3\n 15.30 SiO2  13.8 P2O5  2.40 Fe2O3  0.10 MnO  0.05 CuO\n 2.61 SO3  1.18 Cl\n Rogers (appendix): (China)\n % 1.47 Na2O  5.77 K2O  4.09 MgO  23.54 CaO  15.11 Al2O3\n 39.81 SiO2  2.3 P2O5  3.58 Fe2O3  4.32 MnO\n Rogers (appendix): (Japan)\n % 1.52 Na2O  5.68 K2O  4.14 MgO  23.69 CaO  16.34 Al2O3\n 39.62 SiO2  2.62 P2O5  3.83 Fe2O3  1.01 MnO\n Hamer & Hamer:\n % 6 Na2O  11 K2O  9 MgO  51 CaO  1 Al2O3\n 10 SiO2  10 P2O5  1 Fe2O3  1 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:10:57',NULL),
	(12049,49,NULL,'Straw ash','Straw ash',NULL,NULL,'Straw ash supplies several oxides, especially SiO2.\n Generic straw ash.\n Analyses:\n Green: (straw ash from cereal crops)\n 0.4 KNaO  0.2 MgO  0.4 CaO  2.7 SiO2  0.1 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 19:48:02',NULL),
	(12050,50,NULL,'Tallowwood ash','Tallowwood ash',NULL,NULL,'Tallowwood ash supplies several oxides, especially CaO and MgO.\n Analyses:\n Cardew:\n % 6.84 Na2O  2.41 K2O  25.58 MgO  52.15 CaO  1.09 Al2O3\n 8.96 SiO2  0.4 P2O5  1.93 SO3  0.38 Cl2  0.18 MnO\n (Eucalyptus microscorys III (Tallowwood) Forestry Commission\n of New South Wales, 1956)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:11:00',NULL),
	(12051,51,NULL,'Thatching grass ash','Thatching grass ash',NULL,NULL,'Thatching grass ash supplies several oxides, especially SiO2.\n Analyses:\n Cardew:\n % 0.22 Na2O  2.55 K2O  3.67 MgO  6.14 CaO  5.42 Al2O3\n 76.96 SiO2  1.58 P2O5  0.22 TiO2  1.06 Fe2O3  0.15 SO3  0.67 MnO  1.4 LOI\n (Abuja, Nigeria. Wahsed and calcined at 900C)\n (Overseas Geological Surveys, London, 1966)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:12:17',NULL),
	(12052,52,NULL,'Turpentine ash','Turpentine ash',NULL,NULL,'Turpentine ash supplies several oxides, especially SiO2.\n Analyses:\n Cardew:\n % 4.08 Na2O  1.2 K2O  1.03 MgO  1.88 CaO  1.26 Al2O3\n 89.74 SiO2  0.39 P2O5\n (Australian turpentine)\n (Forestry Commission of New South Wales, 1956)\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:12:18',NULL),
	(12053,53,NULL,'Wheat straw ash','Wheat straw ash',NULL,NULL,'Wheat straw ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Cardew:\n % 2.8 Na2O  11.5 K2O  2.5 MgO  6.1 CaO\n 66.2 SiO2  5.4 P2O5  2.8 SO3  3.8 S\n (Air dried)\n (B.C.S., (1959), 59P)\n Green:\n 0.67 K2O  0.14 MgO  0.19 CaO  0.71 Al2O3  4.95 SiO2  0.10 P2O5\n Tichane (TCB):\n % 2.8 Na2O  11.5 K2O  2.5 MgO  6.1 CaO\n 66.0 SiO2  5.4 P2O5  2.8 LOI\n Rogers:\n % 1.4 Na2O  13.6 K2O  2.5 MgO  5.8 CaO\n 67.5 SiO2  4.8 P2O5  0.6 Fe2O3\n Hamer & Hamer:\n % 2 Na2O  13 K2O  4 MgO  6 CaO\n 70 SiO2  5 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:12:22',NULL),
	(12054,54,NULL,'Willow ash','Willow ash',NULL,NULL,'Willow ash supplies several oxides, especially K2O, CaO, and P2O5.\n Analyses:\n Rogers:\n % 2.50 Na2O  49.80 K2O  8.26 MgO  20.21 CaO  0.05 Al2O3\n 4.44 SiO2  10.00 P2O5  1.25 Fe2O3  0.18 MnO\n 1.22 SO3  0.08 Cl\n Hamer & Hamer:\n % 3 Na2O  51 K2O  9 MgO  21 CaO\n 5 SiO2  10 P2O5  1 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:12:34',NULL),
	(12055,55,NULL,'Wood ash','Wood ash','Wood ash',NULL,'Ash wood ash supplies several oxides, especially CaO and SiO2.\n Analyses:\n Hamer & Hamer:\n % 8 Na2O  17 K2O  12 MgO  27 CaO  1 Al2O3 24 SiO2  7 P2O5  4 Fe2O3\n\r\nGreen:\r\n0.1 KNaO 0.1 MgO 0.8 CaO 0.1 SiO2',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-11 19:46:39',NULL),
	(12056,56,12288,'Avery kaolin','Avery kaolin','Avery Kaolin',NULL,'Avery kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Excellent flashing slip for salt/soda; no longer available.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.9 K2O  37.5 Al2O3\r\n 46.7 SiO2  0.1 TiO2  0.7 Fe2O3  13.8 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:01:19',NULL),
	(12057,57,12407,'Bainbridge Feldspar','Bainbridge Feldspar','Bainbridge Feldspar',NULL,'Bainbridge spar supplies SiO2, Al2O3, Na2O, K2O, and CaO. Soda feldspar, similar to Kona F-4.\r\n Analyses:\r\n Cushing:\r\n 0.51 Na2O  0.30 K2O  0.20 CaO  1.04 Al2O3  5.59 SiO2\r\n IMC:\r\n % 9.23 Na2O  1.39 K2O  0.99 CaO  19.29 Al2O3 68.60 SiO2  0.50 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:33:16',NULL),
	(12058,58,NULL,'Ball Clay (Theoretical)','Ball Clay (Theoretical)','Ball Clay',NULL,'Ball clay supplies SiO2 and Al2O3. [Generic ball clay; theoretical formula Al2O3 2SiO2 2H2O. Map to a particular kind of ball clay, or use a formula from below.] Ball clays are fine, plastic clays of sedimentary origin, formed by the deposition of clay minerals and volcanic ash. Ball clay contains kaolinite, quartz, mica, titanium, iron, and small amounts of feldspars, bentonite, and illite. Ball clay also contains significant amounts of organic matter. Tennessee and Kentucky ball clays are secondary deposits of clay and volcanic ash materials from the middle Eocene (40 million years ago). The term ball clay came from the English practice of rolling the clay into large 50-pound balls for transport. In glazes ball clays provide alumina and silica and various impurities including iron and help to suspend the non-clay particles. Used in clays because of their plasticity high firing temperature and high green strength; on the down side they have a high rate of shrinkage.\r\nAnalyses: (for generic Ball Clay)\r\nGreen: (Ball Clay)\r\n 0.02 Na2O  0.06 K2O  0.02 MgO  0.01 CaO  1.0 Al2O3\r\n 2.64 SiO2  0.03 TiO2  0.02 Fe2O3  1.96 H2O\r\n Green: (Siliceous Ball Clay)\r\n 0.03 Na2O  0.12 K2O  0.04 MgO  0.03 CaO  1.0 Al2O3\r\n 6.70 SiO2  0.09 TiO2  0.04 Fe2O3  1.53 H2O\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.003 - Black ball clay)\r\n % 0.3 Na2O  2.1 K2O  0.3 MgO  0.3 CaO  46.0 SiO2\r\n 0.8 TiO2  32.2 Al2O3  1.0 Fe2O3  17.0 LOI\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.004 - Blue ball clay)\r\n % 3.44 KNaO  0.66 MgO  0.22 CaO  55.0 SiO2\r\n 1.2 TiO2  30.0 Al2O3  1.3 Fe2O3  8.60 LOI\r\n Chappell:\r\n % 0.4 Na2O  0.9 K2O  0.2 MgO  0.2 CaO  31.7 Al2O3\r\n 51.9 SiO2  1.5 TiO2  0.8 Fe2O3  12.3 LOI\r\n Hamer:\r\n 0.1 K2O  Al2O3  4 SiO2  2 H2O (average)\r\n 0.1 K2O  Al2O3  2 SiO2  2 H2O (aluminous)\r\n 0.2 K2O  Al2O3  9 SiO2  2 H2O (siliceous)\r\n IMC:\r\n % 0.40 Na2O  0.91 K2O  0.20 MgO  0.19 CaO  31.74 Al2O3\r\n 52.04 SiO2  1.52 TiO2  0.80 Fe2O3  12.20 LOI',13,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:21:28',NULL),
	(12059,59,12058,'Ball Clay Bell Dark','Ball Clay Bell Dark','Bell Dark Ball Clay',NULL,'A very plastic ball clay used in industrial and hobby clay bodies\r\n of all types. Primary applications are dinnerware and artware.\r\n Physical Properties:\r\n Water of Plasticity*: 37.0% %\r\n Dry Shrinkage*: 6.5\r\n Dry M.O.R., psi:* 825 pH: 4.4 C.E.C.,\r\n meq/100g: 11.0\r\n Specific Surface Area, sq metre/g: 24.4\r\n Soluble sulfur+: Low\r\n P.C.E.: 32\r\n Particle Size, Microns: 20 10 5 2 1 0.5 0.2 (% finer than) 99%\r\n 97% 93% 81% 72% 56% 35%\r\n Fired Properties-Cone 5 10\r\n Total Shrinkage: 13.0% 14.5% Absorption: 10.0% 1.0%\r\n *Extruded, 50% ball clay, 50% flint +Low-trace\r\n to 150, Med-150-400, High-450+ **50% Clay, 50% Nepheline Syenite\r\n 10.50% LOI Kentucky-Tennessee Clay Co.\r\n http://www.k-tclay.com/ceramic_ballclay.asp',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:22:19',NULL),
	(12060,60,12058,'Bandy Black','Bandy Black','Bandy Black',NULL,'Bandy Black supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes.\r\n Ball clay. Good in soda/salt for German grays [Cushing].\r\nAnalyses:\r\n Cushing:\r\n % 0.4 Na2O  1.7 K2O  0.12 MgO  0.09 CaO  24.5 Al2O3 61.0 SiO2  0.07 P2O5  1.3 TiO2  0.99 Fe2O3  0.01 MnO 9.7 LOI  0.11 SO3\r\n IMC:\r\n % 0.36 Na2O  1.69 K2O  0.12 MgO  0.09 CaO  24.50 Al2O3 61.00 SiO2  0.07 P2O5  1.29 TiO2  0.99 Fe2O3  0.01 MnO 9.74 LOI  0.11 SO3',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:42:30',NULL),
	(12061,61,12058,'Bandy Tan','Bandy Tan','Bandy Tan',NULL,'Bandy Tan supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes. Ball clay.\r\n Analyses:\r\n IMC:\r\n % 0.36 Na2O  1.64 K2O  0.58 MgO  0.32 CaO  24.38 Al2O3 61.21 SiO2  0.03 P2O5  1.26 TiO2  1.20 Fe2O3  0.01 MnO 8.67 LOI  0.09 SO3',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:43:23',NULL),
	(12062,62,NULL,'Barium Carbonate','Barium Carbonate','Barium Carbonate',NULL,'Barium carbonate supplies BaO.\n Sometimes used as a primary flux in glazes to produce satin matt\n surfaces with exciting colors; can be used with boron to create\n glossy surfaces. In glazes where it is a secondary component, can\n often be replaced with Strontium carbonate (75% as much strontium\n as there was barium, by weight).\n Prepared by reducing the mineral Barite (BaSO4) to the sulfide,\n then precipitating the carbonate with CO2. Note that barium\n carbonate has a decomposition temperature of 1421C, and thus\n when used in the raw glaze batch, some may persist after the\n firing [Parmelee] (thus the main danger of barium glazes).\n Analyses:\n Hopper:\n BaCO3\n Cooper & Royle:\n BaCO3\n Rhodes:\n BaCO3\n Cuff:\n BaCO3\n Chappell:\n BaCO3\n Cushing:\n BaCO3\n Memmott:\n BaCO3\n Parmelee:\n BaCO3\n IMC:\n BaCO3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:02:33',NULL),
	(12063,63,NULL,'Barium chloride','Barium chloride',NULL,NULL,'Barium chloride supplies BaO.\n A soluble form of barium used to fume pots to produce\n iridescence.\n Analyses: Parmelee:\n BaCl2\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-14 08:49:35',NULL),
	(12064,64,NULL,'Barium chromate','Barium chromate',NULL,NULL,'Barium chromate supplies BaO and Cr2O3.\n Produces lemon yellow, yellow-green, and green in overglaze\n enamels.\n Analyses:\n Hopper:\n BaCrO4\n Parmelee:\n BaCrO4\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:33:05',NULL),
	(12065,65,NULL,'Barium selenite','Barium selenite',NULL,NULL,'Barium selenite supplies BaO and SeO2.\n Analyses:\n Parmelee:\n BaSeO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:34:09',NULL),
	(12066,66,NULL,'Barium sulfate','Barium sulfate','Barium Sulfate',NULL,'Barium sulfate supplies BaO.\n Not generally used as a glaze ingredient; usually used to make\n frits. Occurs as the mineral Barite.\n Analyses:\n Parmelee: (also called Heavy spar)\n BaSO4\n IMC:\n BaSO4\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:35:03',NULL),
	(12067,67,NULL,'Barnard Clay','Barnard Clay, Blackbird Clay','Barnard Slip',NULL,'Barnard clay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\n of several fluxes.\n A high-iron clay from glacial deposits.\n Manufactured by Hammill & Gillespie; comes from western\n Pennsylvania.\n Non-plastic, dark brown; starts to melt at c/4.\n Analyses:\n Obstler:\n % 0.12 Na2O  2.04 K2O  0.75 MgO  0.27 CaO  10.87 Al2O3\n 59.7 SiO2  0.67 TiO2  14.65 Fe2O3  3.4 MnO  7.48 LOI\n (also present: Ba, Pb, Zr, Sr, Ni)\n Cooper & Royle: (Appendix 8)\n % 3.77 K2O  10.60 Al2O3  52.38 SiO2  0.85 TiO2\n 20.27 Fe2O3  3.23 MnO  8.27 LOI\n Chappell:\n % 0.5 Na2O  1.0 K2O  0.6 MgO  0.5 CaO  6.7 Al2O3\n 41.4 SiO2  0.2 TiO2  29.9 Fe2O3  3.25 MnO  8.4 LOI\n Cushing:\n % 0.12 Na2O  2.04 K2O  0.75 MgO  0.27 CaO  10.8 Al2O3\n 59.7 SiO2  0.67 TiO2  14.6 Fe2O3  5.4 MnO  7.48 LOI\n Tichane (AG):\n % 4.0 K2O  10.6 Al2O3  52.4 SiO2  0.9 TiO2\n 20.3 Fe2O3  3.2 MnO  8.3 LOI\n Tichane (TCB, CB):\n % 3.8 K2O  10.6 Al2O3  52.4 SiO2  0.9 TiO2\n 20.3 Fe2O3  3.2 MnO  8.3 LOI\n IMC:\n % 0.57 Na2O  1.14 K2O  0.68 MgO  0.57 CaO  7.60 Al2O3\n 47.01 SiO2  0.23 TiO2  33.90 Fe2O3  8.31 LOI\n IMC: (Blackbird)\n % 0.12 Na2O  2.04 K2O  0.75 MgO  0.27 CaO  10.87 Al2O3\n 59.70 SiO2  0.67 TiO2  14.65 Fe2O3  3.40 MnO  7.46 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 06:55:51',NULL),
	(12068,68,NULL,'Basalt','Basalt','Basalt',NULL,'Basalt supplies SiO2, Al2O3, CaO, MgO, Na2O, K2O, Fe2O3, and TiO2.\n Basalt is a common igneous rock, poorer in silica and higher\n in calcium and magnesium than granite.\n Useful in dark clay bodies and brown/black glazes. Fluxes\n earlier than feldspars; can produce a glaze at 1250C [IMC].\n Analyses:\n Tichane (AG): (average basalt)\n % 3.2 Na2O  1.2 K2O  6.4 MgO  9.3 CaO  14.0 Al2O3\n 52.0 SiO2  0.4 P2O5  1.0 TiO2  12.8 Fe2O3\n Tichane (TCB):\n % 3.2 Na2O  1.2 K2O  6.4 MgO  9.3 CaO  14.1 Al2O3\n 52.0 SiO2  0.4 P2O5  1.0 TiO2  12.8 Fe2O3\n Tichane (CB):\n % 3 Na2O  1 K2O  6 MgO  9 CaO  14 Al2O3\n 52 SiO2  1 TiO2  13 Fe2O3\n IMC:\n % 2.40 Na2O  0.60 K2O  10.30 MgO  7.90 CaO  14.10 Al2O3\n 48.60 SiO2  1.60 TiO2  0.30 P2O5  11.20 Fe2O3  0.10 MnO\n 3.80 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:12:51',NULL),
	(12070,70,12371,'Bell Feldspar','Bell Feldspar','Bell Feldspar',NULL,'Bell feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, MgO,\r\n and Fe2O3.\r\n Analyses:\r\n Chappell:\r\n % 3.1 Na2O  10.1 K2O  0.01 MgO  0.4 CaO  17.9 Al2O3\r\n 68.3 SiO2  0.08 Fe2O3  0.33 LOI\r\n IMC:\r\n % 3.09 Na2O  10.07 K2O  0.40 CaO  17.87 Al2O3\r\n 68.28 SiO2  0.08 Fe2O3  0.21 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:22:21',NULL),
	(12071,71,12593,'Bentolite L','Bentolite L','Bentolite L',NULL,'Bentonite L supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n A pure white bentonite, less plastic than other bentonites though.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.1 K2O  1.0 MgO  1.5 CaO  12.7 Al2O3 65.9 SiO2  0.2 TiO2  0.7 Fe2O3  18.0 LOI\r\n IMC:\r\n % 0.20 Na2O  0.10 K2O  3.66 MgO  1.67 CaO  15.76 Al2O3 72.21 SiO2  0.27 TiO2  0.33 Fe2O3  5.80 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:26:33',NULL),
	(12072,72,12593,'Bentonite','Bentonite','Bentonite',NULL,'Bentonite supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes; bentonite helps to suspend glazes. [Generic bentonite; map to a particular type of bentonite, or use another formula. Typical density 172.0 g/c]\r\n Bentonites contain large amounts of montmorillonite clay minerals, produced by the alteration of volcanic ash in marine environments. Montmorillonites also result from hydrothermal alteration of Mg/Fe-rich igneous rocks. Theoretical formula for montmorillonite is Al2Si4O10 (OH)2 nH2O where n is around 2-4. Mg replaces some of the Al, and Na and Ca ions hang around in the interlayer space, making for a very complex molecular structure. Bentonite consists of extremely small particles, most less than one micron. Bentonites are on the order of ten times finer than ball clays. There are two general classes of bentonites - the CaO-rich bentonites that do not swell much in water, and the CaO-poor, Na2O-rich bentonites that swell considerably.\r\n Bentonite is the most plastic material used in ceramics. Bentonites are used to add plasticity to clay bodies and help to suspend glaze ingredients. Should be mixed with warm water before adding to clay or glaze, or mixed thoroughly with other dry ingredients.\r\n Bentonites are so-called because they were first discovered in 1896 in Fort Benton, WY.\r\n Analyses:\r\n Obstler: (Western K-4; Hammill & Gillespie, 1989)\r\n % 2.99 Na2O  0.26 K2O  2.36 MgO  4.09 CaO  17.15 Al2O3 59.4 SiO2  0.1 TiO2  3.86 Fe2O3\r\n Obstler: (Black Hills; Ceramic Industry, 1993)\r\n % 2.90 KNaO  2.26 MgO  0.46 CaO  20.7 Al2O3  64.32 SiO2 0.11 TiO2  3.49 Fe2O3  0.35 S\r\n Obstler: (Wyoming Bentonite; Grimshaw,\r\n Chemistry and Physics of Clays 1980)\r\n % 0.43 Na2O  1.12 K2O  2.55 MgO  1.80 CaO  20.4 Al2O3 49.4 SiO2  0.4 TiO2  3.70 Fe2O3\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.006)\r\n % 2.76 Na2O  0.60 K2O  2.49 MgO  0.49 CaO  20.14 Al2O3 55.44 SiO2  3.67 Fe2O3  13.50 LOI\r\n Chappell:\r\n Al2O3  4 SiO2  9 H2O\r\n Chappell:\r\n % 2.9 K2O  2.26 MgO  0.46 CaO  20.7 Al2O3 64.3 SiO2  0.11 TiO2  3.4 Fe2O3  5.15 LOI\r\n Cushing: (White Bentonite)\r\n % 2.58 Na2O  5.7 K2O  3.2 MgO  1.92 CaO  15.2 Al2O3 67.2 SiO2  0.16 TiO2  1.87 Fe2O3\r\n Cushing: (Bentonite) (This is a swelling bentonite)\r\n % 2.9 Na2O  2.3 MgO  0.45 CaO  20.7 Al2O3 64.3 SiO2  0.11 TiO2  3.5 Fe2O3  5.15 LOI  0.35 SO3\r\n Cushing: (approximate)\r\n Al2O3  5 SiO2  7 H2O  + impurities\r\n Tichane (CB):\r\n % 2.6 Na2O  0.4 K2O  2.3 MgO  0.5 CaO  21 Al2O3 64 SiO2  0.1 TiO2  3.5 Fe2O3  5.2 LOI\r\n IMC:\r\n % 2.93 K2O  2.27 MgO  0.46 CaO  20.84 Al2O3 64.86 SiO2  0.11 TiO2  3.50 Fe2O3  5.04 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:27:59',NULL),
	(12073,73,NULL,'Bismuth oxide','Bismuth oxide','Bismuth Oxide',NULL,'Bismuth oxide supplies Bi2O3.\n A bismuth compound used in overglaze lusters. Soluble in acids\n but not in plain water [Parmelee].\n Analyses:\n Parmelee:\n Bi2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12074,74,NULL,'Bismuth subnitrate','Bismuth subnitrate','Bismuth Subnitrate',NULL,'Bismuth subnitrate supplies Bi2O3.\n A bismuth compound used in overglaze lusters. Soluble in acids\n but not in plain water [Parmelee]. May contain arsenic, lead, and\n silver as impurities.\n Analyses:\n Hopper:\n BiONO3 H2O\n Chappell:\n BiONO3 H2O\n IMC:\n % 76.40 Bi2O3   23.60 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12077,77,NULL,'Black Iron Oxide','Black Iron Oxide, BIO','Iron Oxide Black',NULL,'Black iron oxide supplies Fe2O3.\r\n Common source of iron.\r\n Analyses:\r\n Hopper:\r\n FeO\r\n Rhodes:\r\n FeO\r\n Chappell:\r\n FeO\r\n Cushing:\r\n FeO\r\n Memmott:\r\n FeO\r\n Parmelee:\r\n FeO\r\n IMC:\r\n % 65.20 Fe2O3  32.80 FeO  2.00 H2O\r\n 98-99% Fe3O4',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-10 18:05:34',NULL),
	(12079,79,NULL,'Bonding Clay','Bonding Clay','Bonding Clay',NULL,'Bonding clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\n of several fluxes.\n Analyses:\n Coope & Royle: (Appendix 8) (Cedar Heights bonding clay 50 mesh)\n % 0.30 Na2O  0.88 K2O  0.22 MgO  0.08 CaO  28.50 Al2O3\n 57.32 SiO2  1.98 TiO2  1.23 Fe2O3  9.39 LOI  0.24 S\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:21:04',NULL),
	(12080,80,NULL,'Bone Ash','Bone Ash, Calcium Phosphate','Bone Ash',NULL,'Bone ash supplies CaO and P2O5.\n Bone ash is a highly variable material produced by calcining\n animal (cattle) bones. Similar materials include the mineral\n Apatite (CaF Ca4(PO4)3) and calcium phosphate (Ca3(PO4)2).\n Bone ash generally acts as an opacifier in glazes. Can cause\n crawling and blistering. In the c/9-10 range and higher, bone\n ash decomposes and releases tricalcium phosphate, a highly\n reactive substance that helps flux the rest of the glaze\n [Obstler].\n Analyses:\n Obstler: (Ceramic Industry, 1993, 47)\n % 67-85.9 Ca3(PO4)2  3-10 CaCO3  2-3.8 Mg3(PO4)2\n 0-5.15 NaCl+KCl  trace CaF\n Hopper: (Syn. with calcium phosphate)(note P2O3)\n 3 CaO  P2O3\n Cooper & Royle: (Syn. Calcium phosphate)\n 3 CaO  P2O5\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.007)\n % 0.65 KNaO  1.10 MgO  53.80 CaO  0.27 Al2O3\n 0.51 SiO2  0.06 Fe2O3  42.50 P2O5\n Rhodes:\n Ca3(PO4)2\n Cuff:\n Ca3(PO4)2\n Chappell:\n 3 CaO  P2O5\n Cushing:\n Ca3(PO4)2\n Parmelee: (Bone ash and Calcium phosphate)\n Ca3(PO4)2\n Parmelee: (Bone ash) (Al includes Fe)\n % 0.64 KNaO  53.30 CaO  0.30 MgO  1.30 Al2O3\n 1.80 SiO2  40.15 P2O5  3.20 F\n Parmelee: (Apatite) (Al includes Fe)\n % 0.80 KNaO  55.70 CaO  0.20 MgO  0.72 Al2O3\n 0.06 SiO2  39.24 P2O5  3.10 F  0.28 H2O\n Sanders:\n % 1.33 MgO  52.44 CaO  2.71 SiO2  40.88 P2O5\n 0.32 Fe2O3  1.88 LOI\n (trace of Al2O3)\n Green: (from Bennett and Hawley, Methods of Silicate\n Analysis 1965)\n 0.16 Na2O  0.10 Mg)  3.33 CaO  0.02 SiO2  1.0 P2O5\n Hamer & Hamer:\n % 1 MgO  54 CaO  3 SiO2  42 P2O5\n IMC: (Hydroxyapatite)\n Ca5(OH) (PO4)3\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:10:33',NULL),
	(12081,81,NULL,'Boraq','Boraq','Boraq',NULL,'Boraq supplies B2O3, CaO, other fluxes, SiO2, and Al2O3.\n Gerstley Borate replacement from Axner / Plainsman Clays.\n Analyses:\n Axner: (Web site, 2001)\n % 3.4 Na2O3  0.6 K2O  17.8 CaO  2.2 MgO  0.3 SrO\n 34.5 B2O3  2.5 Al2O3  12.5 SiO2  0.2 Fe2O3  26.0 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:21:11',NULL),
	(12082,82,NULL,'Borax','Borax',NULL,NULL,'Borax supplies B2O3 and Na2O.\n Borax is a highly soluble mineral, formed by the evaporation of\n ancient lake basins fed by volcanic springs during the Tertiary\n (26 million years ago) in southern California (Mojave Desert).\n Asian borax is called by the mineral name Tincal (so is American,\n depending on who you ask).\n Borax is manufactured by U.S Borax and Chemical Corp. and by\n Kerr Magee Chemical Corp. in California.\n Borax is a powerful melter in glazes, used in low-fire glazes\n and as an auxiliary melter in some stoneware glazes. It\n increases the fluidity of the glaze and helps to heal defects.\n Amounts up to about 10% may be added to viscous glazes,\n including high-fire glazes for this purpose. Too much may result\n in boiling (blisters, and pinholes).\n The water content of borax can fluctuate with changes in\n atmospheric conditions. The water may be driven out by heat; at\n 735C, all the water is removed (resulting in anhydrous, or fused\n borax).\n The 10 water molecules gave rise to the designation 10 Mule\n Borax (really 10 Mol Borax).\n Analyses:\n Obstler: (Ceramic Industry 1993 48)\n Na2O  2 B2O3  10 H2O\n Hopper:\n Na2O  2 B2O3  10 H2O\n Cooper & Royle:\n Na2O  2 B2O3  10 H2O\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.008)\n % 16.25 Na2O  36.52 B2O3  47.23 H2O\n Rhodes:\n Na2O  2 B2O3  10 H2O\n Chappell:\n Na2O  2 B2O3  10 H2O\n Cushing:\n Na2O  2 B2O3  10 H2O\n Memmott:\n Na2O  2 B2O3  10 H2O\n Parmelee:\n Na2O  2 B2O3  10 H2O\n IMC:\n % 16.25 Na2O  36.49 B2O3  47.26 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:36:27',NULL),
	(12083,83,NULL,'Boric Acid','Boric Acid','Boric Acid',NULL,'Boric acid supplies B2O3.\n Boric acid is manufactured by processing the mineral Kernite\n (Na2O 2B2O3 4H2O), or other similar minerals (such as Borax),\n with sulfuric acid. It is a powerful flux, and melts at 392F.\n Soft and flaky, highly soluble in water. Tends to volatize\n during firing [Parmelee].\n Analyses:\n Obstler:\n B2O3  3 H2O\n Hopper:\n H3BO3\n Cooper & Royle:\n B2O3  3 H2O\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.010)\n % 56.30 B2O3  43.70 H2O\n Rhodes:\n B2O3  3 H2O\n Chappell:\n B2O3  3 H2O\n Cushing:\n B2O3  3 H2O\n Memmott: (Boracic acid)\n B2O3  3 H2O\n Parmelee: (Boracic acid)\n B2O3  3 H2O\n IMC:\n B2O3  3 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:37:21',NULL),
	(12084,84,NULL,'Borocalcite','Borocalcite',NULL,NULL,'Borocalcite supplies B2O3 and CaO.\n Very similar to Colemanite, in some sources they are listed as\n identical/synonymous.\n Analyses:\n Cooper & Royle:\n CaO  2 B2O3  6 H2O\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.011)\n % 0.50 KNaO  0.80 MgO  26.30 CaO  0.08 Al2O3  4.90 SiO2\n 0.02 Fe2O3  44.00 B2O3  22.3 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:39:45',NULL),
	(12085,85,12371,'Buckingham feldspar','Buckingham feldspar','Buckingham Feldspar',NULL,'Buckingham feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3. Potash feldspar, no longer available as of early 1970\'s. Substitute Kona A-1 [Speight] or G-200 [IMC].\r\n Analyses:\r\n Cooper & Royle: (appendix 8)\r\n % 2.7 Na2O  11.8 K2O  0.4 CaO  18.4 Al2O3 66.3 SiO2  0.07 Fe2O3  0.3LOI\r\n Rhodes:\r\n 0.74 K2O  0.26 CaO  1.026 Al2O3  6.34 SiO2\r\n Chappell:\r\n % 2.56 Na2O  12.44 K2O  0.2 MgO  0.16 CaO  19.6 Al2O3 65.58 SiO2  0.01 Fe2O3  0.32 LOI\r\n Tichane (TCB):\r\n % 2.7 Na2O  11.8 K2O  0.4 CaO  18.4 Al2O3 66.3 SiO2  0.07 Fe2O3  0.3 LOI\r\n Tichane (CB):\r\n % 2.7 Na2O  11.8 K2O  0.4 CaO  18.4 Al2O3 66.3 SiO2  0.1 Fe2O3  0.3 LOI\r\n IMC:\r\n % 3.00 Na2O  11.60 K2O  0.20 CaO  18.00 Al2O3 66.90 SiO2  0.22 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:24:13',NULL),
	(12086,86,NULL,'Burnt sienna','Burnt sienna','Burnt Sienna',NULL,'Burnt sienna provides SiO2, Al2O3, CaO, and Fe2O3.\n A hydrated form of iron-manganese ochre; like umber but with\n lower manganese content.\n Analyses:\n Green:\n 0.04 CaO  0.06 Al2O3  0.7 SiO2  1.0 Fe2O3  0.61 H2O\n Chappell:\n Fe2O3 H2O  + impurities\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:06:39',NULL),
	(12087,87,NULL,'Burnt umber','Burnt umber','Burnt Umber',NULL,'Burnt umber provides SiO2, Al2O3, CaO, MgO, MnO, and Fe2O3.\n Natural hydrated form of iron with variable manganese content.\n Synthetic forms exist also.\n Analyses:\n Green:\n 0.11 MgO  0.18 CaO  0.32 MnO  0.18 Al2O3  0.89 SiO2\n 1.0 Fe2O3  0.89 H2O\n IMC:\n % 1.50 MgO  3.50 CaO  6.10 Al2O3  18.00 SiO2\n 54.00 Fe2O3  11.50 MnO  5.50 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:06:42',NULL),
	(12088,88,12058,'C & C  ball clay','C & C  ball clay','C & C Ball Clay',NULL,'C & C supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n White-firing stoneware clay, good for porcelain and white stoneware.\r\n Analyses:\r\n Cushing:\r\n % 0.12 Na2O  0.28 K2O  0.3 MgO  0.37 CaO  29.34 Al2O3\r\n 53.96 SiO2  0.015 P2O5  1.64 TiO2  0.98 Fe2O3\r\n 12.82 LOI  0.03 SO3\r\n IMC:\r\n % 0.12 Na2O  0.28 K2O  0.30 MgO  0.37 CaO  29.34 Al2O3\r\n 53.96 SiO2  0.02 P2O5  1.64 TiO2  0.98 Fe2O3 0.02 MnO2\r\n 12.82 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:25:58',NULL),
	(12089,89,NULL,'C W-5 clay','C W-5 clay',NULL,NULL,'C W-5 clay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\n of several fluxes.\n Analyses:\n Chappell:\n % 1.0 Na2O  1.0 K2O  0.2 MgO  0.3 CaO  35.7 Al2O3\n 48.8 SiO2  1.8 TiO2  1.6 Fe2O3  13.2 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:21:16',NULL),
	(12090,90,NULL,'Cadmium carbonate','Cadmium carbonate',NULL,NULL,'Cadmium carbonate supplies CdO.\n Used in conjunction with selenium to produce reds and oranges in\n low-fire glazes.\n Analyses:\n Hopper:\n CdCO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12091,91,NULL,'Cadmium sulfide','Cadmium sulfide','Cadmium Sulfide',NULL,'Cadmium sulfide supplies CdO.\n Occurs naturally in the mineral Greenockite in association with\n zinc ores; purified to produce the commercial product.\n Used in conjunction with selenium to produce reds and oranges in\n low-fire glazes.\n Analyses:\n Hopper:\n CdS\n Chappell:\n CdS\n Parmelee:\n CdS\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12092,92,NULL,'Cadycal','Cadycal','Cadycal',NULL,'Cadycal supplies B2O3, CaO, MgO, and SiO2.\n Calcium borate material.\n Cadycal is produced by Fort Cady Minerals Corp., Newberry\n Springs, CA. It is mined from an ore body 1400 feet under\n the ground through wells (by pumping down dilute sulfuric\n acid and reacting the resulting boric acid solution with lime).\n Analyses:\n Axner: (Web site, 2001)\n % 6.0 Na2O  26.2 CaO  38.0 B2O3  0.5 Al2O3\n 29.2 SiO2  12.0 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:21:50',NULL),
	(12094,94,NULL,'Calcined Kaolin','Calcined Kaolin','Calcined Kaolin',NULL,'Calcined china clay provides SiO2 and Al2O3.\n Because it shrinks less than uncalcined kaolins or clays, it is\n used in slips/engobes to be applied to bisqueware. Can also be\n used to lessen shrinkage in glazes containing a lot of clay.\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:14:15',NULL),
	(12095,95,NULL,'Calcium Borate','Calcium Borate','Calcium Borate',NULL,'Calcium borate supplies CaO and B2O3.\n Anhydrous form of borocalcite.\n Analyses:\n Cuff:\n Ca(BO2)2\n Parmelee:\n 2 CaO  3 B2O3  5 H2O\n Hamer:\n Ca(BO2)2\n IMC:\n CaO  B2O3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:16:00',NULL),
	(12096,96,NULL,'Calcium borate frit','Calcium borate frit',NULL,NULL,'Map to your favorite calcium borate frit.\n American substitute: Gerstley Borate.\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-11 18:16:34',NULL),
	(12097,97,NULL,'Calcium chloride','Calcium chloride',NULL,NULL,'Calcium chloride supplies CaO and helps to flocculate glazes.\n A soluble calcium salt used as a flocculant in slips and glazes.\n 0.1-0.3% causes gelling that makes it easier to apply even coats\n and to apply glaze to nonporous surfaces.\n Analyses:\n Hopper:\n CaCl2 6H2O\n Parmelee:\n CaCl2\n IMC:\n CaCl2  5 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12098,98,NULL,'Calcium phosphate','Calcium phosphate',NULL,NULL,'Calcium phosphate supplies CaO and P2O5.\n A refined substitute for bone ash (3CaO P2O5 is the formula\n often given for bone ash). It is a white crystalline powder;\n not soluble in cold water, changes form in hot water.\n Used as an opacifier in high-fire glazes (above c/8).\n Analyses:\n Conrad\n Ca3(PO4)2\n Hamer:\n Ca3(PO4)2\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:44:58',NULL),
	(12099,99,NULL,'Calcium sulfate','Calcium sulfate',NULL,NULL,'Calcium sulfate provides CaO.\n Calcium sulfate is a very interesting compound. In nature it\n occurs by itself, as the mineral Anhydrite, and with attached\n water molecules, as the mineral Gypsum (CaSO4 2H2O). On heating\n to about 65C, Gypsum loses 75% of its water and becomes Plaster\n of Paris; beyond 95C, all the water is lost and it becomes\n Anhydrite. Above 1000C, it releases its SO3, which may cause\n bubbling in glazes.\n Calcium sulfate is soluble in water and can be used as a\n flocculant in glazes.\n Calcium sulfate is sometimes found as a contaminant in clays\n and causes efflorescence (scumming) during drying. Barium\n carbonate or sulfate are sometimes used in the clay body to\n counteract this.\n Analyses:\n Parmelee:\n CaSO4\n Hamer:\n CaSO4\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:46:00',NULL),
	(12100,100,NULL,'Calcium zirconium silicate','Calcium zirconium silicate','Calcium Zircon Silicate',NULL,'Calcium zirconium silicate supplies CaO, ZrO2, and SiO2.\n A zirconium opacifier containing some calcium.\n Analyses:\n Hopper:\n CaZrSiO4\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:47:24',NULL),
	(12101,101,NULL,'Calvert Clay','Calvert Clay','Calvert Clay',NULL,'Calvert clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\n of several fluxes.\n Red burning clay used in clay bodies.\n Analyses:\n Tichane (CB):\n % 0.4 Na2O  3.2 K2O  0.8 MgO  0.3 CaO  23.8 Al2O3\n 57.7 SiO2  1.2 TiO2  5.7 Fe2O3  9.5 LOI\n IMC:\n % 0.41 Na2O  2.00 K2O  0.80 MgO  0.30 CaO  23.80 Al2O3\n 57.79 SiO2  1.21 TiO2  5.71 Fe2O3  7.98 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:21:54',NULL),
	(12102,102,12144,'Carbondale Red','Carbondale Red Fire Clay',NULL,NULL,'From Digitalfire:\r\n\r\nhttp://digitalfire.com/4sight/material/carbondale_clay_186.html\r\n\r\nA very high iron refractory clay well suited for many ceramic applications requiring bright red color. It fires to a toasty red up to about cone 3 and then turns dark red to brown (partly due to soluble salts on the surface that darken the color). This material has a plasticity similar to a typical pottery clay body. Carbondale red provides formulators with an economical source of iron oxide. Some have suggested this as a substitute for Newman Red, however it is much more vitreous and higher in iron.',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:07:36',NULL),
	(12103,103,NULL,'Carolina Stone','Carolina Stone','Carolina Stone',NULL,'Carolina Stone supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\n An American substitute for Cornwall Stone.\n Analyses:\n Obstler: (Ceramic Industry 1966, 94)\n % 4.14 Na2O  4.42 K2O  0.62 CaO  16.23 Al2O3\n 72.3 SiO2  0.07 Fe2O3  1.23 CaF2  1.06 LOI\n Chappell:\n % 4.4 Na2O  4.42 K2O  0.01 MgO  0.62 CaO  16.23 Al2O3\n 72.30 SiO2  0.07 Fe2O3  1.06 LOI\n IMC:\n % 4.40 Na2O  4.50 K2O  0.60 CaO  16.40 Al2O3\n 73.00 SiO2  0.05 Fe2O3  1.10 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:23:16',NULL),
	(12104,104,NULL,'Cerium oxide','Cerium oxide','Cerium Oxide',NULL,'Cerium oxide supplies CeO.\n A rarely used flux/opacifier; at higher temperatures gives\n yellow with titanium. Small amounts cause fluorescence under\n ultraviolet light.\n Analyses:\n Hopper:\n CeO\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12105,105,NULL,'Cherry ash','Cherry ash',NULL,NULL,'Cherry ash supplies several oxides, especially CaO, SiO2, and K2O.\n Analyses:\n Conrad:\n % 1.8 Na2O  21.6 K2O  8.7 MgO  30.3 CaO\n 24.96 SiO2  7.6 P2O5  2.62 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 20:23:24',NULL),
	(12106,106,12371,'Chesterfield Feldspar','Chesterfield Feldspar',NULL,NULL,'Chesterfield feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\r\n Analyses:\r\n Chappell:\r\n % 3.75 Na2O  8.5 K2O  0.03 CaO  16.3 Al2O3 70.6 SiO2  0.08 Fe2O3  0.4 LOI\r\n IMC:\r\n % 3.75 Na2O  8.50 K2O  0.30 CaO  16.34 Al2O3 70.75 SiO2  0.08 Fe2O3  0.29 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:26:38',NULL),
	(12108,108,NULL,'Chrome Oxide','Chrome Oxide, Chromium Oxide','Chrome Oxide',NULL,'Chromium oxide supplies Cr2O3. Dense opaque John Deere green. Refractory. Fumes above cone 8. High tin (5%+) tin and small amounts of Cr yield Cr - Sn pinks. Zinc + Cr = brown. Lead + Cr = oranges (Otto\'s texture glaze). Used to produce greens chrome-tin pinks and (in low temperature lead glazes) yellows reds, and oranges. With zinc, forms zinc chromate (brown). Very powerful colorant, usually requires less than 2%. Tends to volatize during firing, causing tin-bearing glazes in the kiln to blush pink. Insoluble in water and nearly insoluble in molten silicates; highly refractory. Manufactured from the mineral Chromite (FeCr2O4).\r\n Analyses:\r\n Hopper:\r\n Cr2O3\r\n Cooper & Royle:\r\n Cr2O3\r\n Rhodes:\r\n Cr2O3\r\n Chappell:\r\n Cr2O3\r\n Cushing:\r\n Cr2O3\r\n Memmott:\r\n Cr2O3\r\n Parmelee:\r\n Cr2O3\r\n IMC:\r\n Cr2O3',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-15 16:57:45',NULL),
	(12109,109,NULL,'Chromium sulfate','Chromium sulfate',NULL,NULL,'Chromium sulfate supplies Cr2O3.\n Analyses:\n Parmelee:\n Cr2(SO4)3  15 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:49:06',NULL),
	(12110,110,NULL,'Clay (Theoretical)','Clay (Theoretical)',NULL,NULL,'Clay supplies SiO2 and Al2O3.\r\n [Generic clay; theoretical formula Al2O3 2SiO2 2H2O. Map to a particular kind of clay, or use the theoretical formula.]\r\n Analyses:\r\n Cushing:\r\n Al2O3  2 SiO2  2 H2O',13,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:27:13',NULL),
	(12111,111,12371,'Clinchfield #202','Clinchfield #202','Clinchfield #203',NULL,'Clinchfield #202 feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO,\r\n and Fe2O3.\r\n Potash feldspar, similar to Kingman.\r\n Analyses:\r\n Cooper & Royle: (appendix 8)\r\n % 2.6 Na2O  10.9 K2O  0.2 CaO  17.5 Al2O3\r\n 68.1 SiO2  0.09 Fe2O3  0.3 LOI\r\n Chappell: (Clinchfield)\r\n (see Custer)\r\n Cushing:\r\n 0.25 Na2O  0.72 K2O  0.03 CaO  1.06 Al2O3  7.08 SiO2\r\n Tichane (CB):\r\n % 2.6 Na2O  10.9 K2O  0.2 CaO  17.5 Al2O3\r\n 68.1 SiO2  0.1 Fe2O3  0.3 LOI\r\n IMC:\r\n % 2.53 Na2O  10.96 K2O  0.34 CaO  16.95 Al2O3\r\n 69.23 SiO2  1.00 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:41:36',NULL),
	(12112,112,12371,'Clinchfield #303','Clinchfield #303','Clinchfield #304',NULL,'Clinchfield #303 feldspar supplies SiO2, Al2O3, K2O, Na2O,\r\n and CaO.\r\n Potash feldspar, similar to Kingman.\r\n Analyses:\r\n IMC:\r\n % 5.5 Na2O  7.9 K2O  0.5 CaO  18.2 Al2O3  67.8 SiO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:41:47',NULL),
	(12113,113,NULL,'CMC','CMC','CMC Gum',NULL,'CMC helps to bind the glaze and adhere the glaze to the pot.\n Sodium carboxymethylcellulose - an organic gum that helps to\n harden raw glazes and stains, especially those that have little\n or no clay content. A side effect is that the gum slows down drying\n of the glaze - this might be an advantage when brushing glazes,\n but is a disadvantage when dipping or pouring.\n In some sources (i.e. Hamer) it is called S.C.M.C.\n Veegum CER is a 1:1 mixture of CMC and Veegum T.\n Chappell gives these instructions for use:\n Mix 25 g CMC, 1 quart H2O, and 3-5 drops formaldehyde (to\n prevent decomposition). Let sit several days. Then, shake or\n stir. Use about 1 teaspoon per 100 g glaze.\n Gum tragacanth can be substituted but is more expensive.\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12114,114,NULL,'Cobalt Carbonate','Cobalt Carbonate','Cobalt Carbonate',NULL,'Cobalt carbonate supplies CoO.\n A powerful colorant and flux. Cobalt carbonate is usually very\n fine and easily dispersed through the glaze.\n Insoluble in water.\n Analyses:\n Hopper:\n CoCO3\n Rhodes:\n CoCO3\n Chappell:\n CoCO3\n Cushing:\n CoCO3\n Hamer:\n CoCO3\n CoCO3  Co(OH)2  (Cobalt carbonate basic)\n IMC:\n % 63 CoO 37 CO2\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:21:19',NULL),
	(12115,115,NULL,'Cobalt chloride','Cobalt chloride',NULL,NULL,'Cobalt chloride supplies CoO.\n A soluble form of cobalt, not usually used in glazes.\n Analyses:\n Parmelee:\n CoCl2 6H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:50:12',NULL),
	(12116,116,NULL,'Cobalt nitrate','Cobalt nitrate',NULL,NULL,'Cobalt nitrate supplies CoO.\n A soluble form of cobalt, not usually used in glazes.\n Analyses:\n Parmelee:\n Co(NO3)2  6 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:56:53',NULL),
	(12117,117,NULL,'Cobalt Oxide','Cobalt Oxide, Black Cobalt Oxide','Cobalt Oxide',NULL,'Cobalt oxide supplies CoO. A powerful colorant and flux. Tends to speck glazes and not\r\n disperse as well as the carbonate. Insoluble in water. Manufactured by roasting cobalt ores.\r\n Analyses:\r\n Hopper:\r\n Co2O3\r\n Cooper & Royle:\r\n CoO\r\n Rhodes:\r\n Co3O4\r\n Chappell:\r\n Co3O4\r\n Cushing:\r\n Co3O4\r\n Parmelee:\r\n Co3O4',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-15 16:31:28',NULL),
	(12118,118,NULL,'Cobalt sulfate','Cobalt sulfate',NULL,NULL,'Cobalt sulfate supplies CoO.\n A soluble form of cobalt, not usually used in glazes.\n Analyses:\n Hopper:\n CoSO4 7H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 03:59:57',NULL),
	(12119,119,NULL,'Colemanite','Colemanite','Colemanite',NULL,'Colemanite supplies B2O3 and CaO.\n Colemanite is a natural calcium borate mineral. It is believed\n to be formed when calcium-rich waters act on ulexite (see\n Gerstley Borate) and remove the sodium ions. Rich deposits of\n colemanite were created in the Death Valley region of California\n during the late Miocene epoch. These deposits were mined until\n 1927. In more recent times, American Borate Co. has mined less\n pure deposits from the same area.\n Currently the largest active Colemanite mining operation is in\n Turkey. Turkish colemanite is not refined or processed, thus the\n composition is variable from batch to batch; it contains about\n 75-85% colemanite, with the balance being shale, clay,\n limestone, sandstone, etc.\n Colemanite is a useful glaze ingredient in low-fire glazes and\n low-end stoneware glazes; it combines both fluxing and\n glass-forming properties.\n Analyses:\n Obstler: (Colemanite AM - from old Hammill & Gillespie data)\n % 46.0 B2O3  28.0 CaO  3.0 SiO2  0.6 MgO  0.02 Na2O\n 0.012 Fe2O3  0.1 Al2O3  0.01 K2O  0.01 As2O3  17.0 LOI\n Green:\n 0.04 KNaO  0.09 MgO  0.73 CaO  0.01 Al2O3  0.14 SiO1\n 1.0 B2O3  1.8 H2O\n Cooper & Royle:\n 2 CaO  3 B2O3  5 H2O\n Rhodes: (Syn. Calcium borate - ?)\n 2 CaO  3 B2O3  5 H2O\n Cuff:\n 2 CaO  3 B2O3  5 H2O\n Chappell:\n 2 CaO  3 B2O3  5 H2O\n Cushing:\n 2 CaO  3 B2O3  5 H2O\n Memmott: (Syn. Borocalcite)\n 2 CaO  3 B2O3  5 H2O\n IMC:\n % 27.3 CaO  50.8 B2O3  21.9 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:00:42',NULL),
	(12120,120,NULL,'Copper Carbonate','Copper Carbonate','Copper Carbonate',NULL,'Copper carbonate supplies CuO.\n A colorant and flux.\n Copper carbonate comes in various shades of green, reflecting\n various degrees of hydration. Pure copper carbonate (CuCO3) is\n about 64% CuO, whereas the basic carbonate (CuCO3 Cu(OH)2) is\n nearly 72% CuO. The basic carbonate is (in theory) easier to\n disperse in glazes due to its greater affinity for water.\n Prepared from Malachite (CuCO3 Cu(OH)2) and Azurite (2CuCO3\n Cu(OH)2) or by chemical processes.\n Analyses:\n Hopper:\n CuCO3\n Cooper & Royle:\n CuCO3\n Rhodes:\n CuCO3\n Chappell:\n CuCO3\n Cushing:\n CuCO3\n Memmott:\n CuCO3\n Parmelee:\n CuCO3\n Hamer:\n CuCO3\n CuCO3  Cu(OH)2  (Copper carbonate basic)\n IMC:\n CuCO3\n CuCO3  Cu(OH)2  (Copper carbonate basic)\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:24:21',NULL),
	(12121,121,NULL,'Copper chloride','Copper chloride',NULL,NULL,'Copper chloride supplies CuO.\n A soluble form of copper, not usually used in glazes.\n Analyses:\n Parmelee:\n CuCl2  2 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:01:32',NULL),
	(12122,122,NULL,'Copper Oxide','Copper Oxide, Black Copper Oxide','Copper Oxide Black',NULL,'Copper oxide supplies CuO. A colorant and flux.  Versatile colorant, used to produce greens, turquoise,  copper reds, and raku copper lusters and matts.\r\n\r\n Analyses:\r\n Hopper:\r\n CuO\r\n Cooper & Royle:\r\n CuO\r\n Rhodes:\r\n CuO\r\n Chappell:\r\n CuO\r\n Cushing:\r\n CuO\r\n Memmott:\r\n CuO\r\n Parmelee: (Green copper oxide)\r\n CuO',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-15 16:38:38',NULL),
	(12124,124,NULL,'Copper Sulfate','Copper Sulfate','Copper Sulfate',NULL,'Copper sulfate supplies CuO.\n A soluble form of copper, not usually used in glazes.\n Analyses:\n Hopper:\n CuSO4 5H2O\n Parmelee:\n CuSO4\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:02:15',NULL),
	(12125,125,NULL,'Cornwall Stone','Cornwall Stone','Cornwall Stone',NULL,'Cornwall Stone supplies SiO2, Al2O3, K2O, Na2O, CaO, MgO,\n P2O5, TiO2, and Fe2O3.\n [Map to a particular version of Cornwall Stone, or use one of\n the analyses below. Typical density 197.8]\n Manufactured by The Goonvean & Rostowrack China Clay Co., Ltd.;\n comes from St. Stephen, St. Austell, Cornwall, England.\n Primarily contains soda feldspar, potash feldspar, quartz,\n amorphous silica (opal), kaolinite, and fluorite (varies by\n type).\n Similar Japanese material: Amakusa; similar Chinese material:\n Petuntse (Baidunze) [Hamer]. Other similar stuff: Pegmatite;\n Graven; Gowen; Growan; Manx stone; Meldon stone [IMC].\n Analyses:\n Obstler: (Hammill & Gillespie technical data 1989)\n % 3.7 Na2O  3.7 K2O  2.0 CaO  16.0 Al2O3  73.0 SiO2\n 0.07 TiO2  0.14 Fe2O3  0.5 LOI\n Cooper & Royle:\n K2O  Al2O3  8 SiO2\n Cooper & Royle: (Appendix 8)\n % 2.29 Na2O  6.57 K2O  1.6 CaO  0.05 MgO  16.8 Al2O3 71.1 SiO2\n 0.50 TiO2  0.16 Fe2O3  1.25 LOI\n Rhodes:\n 0.340 Na2O  0.356 K2O  0.304 CaO  1.075 Al2O3  8.10 SiO2\n Cuff:\n 0.34 Na2O  0.36 K2O  0.30 CaO  1.2 Al2O3  8 SiO2\n Chappell:\n % 2.29 Na2O  6.57 K2O  0.05 MgO  1.6 CaO  16.8 Al2O3\n 71.1 SiO2  0.16 Fe2O3  1.25 LOI\n Cushing:\n 0.35 Na2O  0.42 K2O  0.23 CaO  1.40 Al2O3  9.0 SiO2\n Parmelee:\n % 2.29 Na2O  6.57 K2O  0.05 MgO  1.6 CaO  16.82 Al2O3\n 71.1 SiO2  0.16 Fe2O3  0.50 CaF2  1.25 LOI\n Tichane (CB):\n % 2.3 Na2O  6.6 K2O  0.1 MgO  1.6 CaO  16.8 Al2O3\n 71.1 SiO2  0.5 TiO2  0.2 Fe2O3  1.3 LOI\n IMC:\n % 3.30 Na2O  4.31 K2O  0.14 MgO  1.81 CaO  16.31 Al2O3\n 73.80 SiO2  0.15 TiO2  0.20 Fe2O3\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:35:21',NULL),
	(12126,126,NULL,'Cornwall stone - DF','Cornwall stone - DF',NULL,NULL,'D.F. Stone supplies SiO2, Al2O3, K2O, Na2O, CaO,\n and Fe2O3.\n A type of Cornwall stone manufactured in the years 1960-73; the\n mica and fluorite were removed to produce a defluorinated\n product. This variety of Cornwall Stone is no longer manufactured,\n but many potters used it and many glaze recipes were based on it.\n Comes from St. Stephen, St. Austell, Cornwall, England.\n Primarily contains soda feldspar, potash feldspar, quartz, and\n kaolinite.\n Analyses:\n Obstler: (Hammill & Gillespie technical data)\n % 3.90 Na2O  3.80 K2O  0.20 CaO  12.00 Al2O3  79.50 SiO2\n 0.06 Fe2O3  0.08 F  0.45 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:01:22',NULL),
	(12127,127,NULL,'Cornwall stone - Hard White','Cornwall stone - Hard White',NULL,NULL,'Cornwall Stone supplies SiO2, Al2O3, K2O, Na2O,\n CaO, MgO, P2O5, TiO2, and Fe2O3.\n One type of Cornwall stone. Contains less fluorine than the\n Purple variety.\n Manufactured by The Goonvean & Rostowrack China Clay Co., Ltd.;\n comes from St. Stephen, St. Austell, Cornwall, England. Primarily\n contains soda feldspar, potash feldspar, quartz, amorphous\n silica (opal), and kaolinite.\n Analyses:\n Obstler: (G&R, 1989, 1992)\n % 0.15-0.35 Na2O  5.0-6.0 K2O  0.15 MgO  0.20-0.50 CaO\n 18.20 Al2O3  72.00 SiO2  0.10 P2O5\n 0.05 TiO2  0.10-0.16 Fe2O3  0.25 F  3.50 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:02:03',NULL),
	(12128,128,NULL,'Cornwall stone - Purple','Cornwall stone - Purple',NULL,NULL,'Purple Cornwall Stone supplies SiO2, Al2O3, K2O, Na2O,\n CaO, MgO, P2O5, TiO2, and Fe2O3.\n One type of Cornwall stone. Contains more fluorine than the\n Hard White and D.F.\n Manufactured by The Goonvean & Rostowrack China Clay Co., Ltd.;\n comes from St. Stephen, St. Austell, Cornwall, England. Primarily\n contains soda feldspar, potash feldspar, quartz, and muscovite,\n with a small amount of fluorite.\n Analyses:\n Obstler: (G&R, 1989, 1992)\n % 3.60 Na2O  3.70 K2O  0.12 MgO  1.90 CaO  15.80 Al2O3\n 72.80 SiO2  0.38 P2O5  0.07 TiO2  0.18 Fe2O3  0.90 F  1.25 LOI\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.014 - Hard purple)\n % 3.62 Na2O  4.32 K2O  2.10 CaO  15.40 Al2O3  72.60 SiO2\n 0.04 TiO2  0.19 Fe2O3  1.62 LOI\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.015 - Mild purple)\n % 3.71 Na2O  4.56 K2O  1.37 CaO  0.12 MgO  15.7 Al2O3\n 72.8 SiO2  0.03 TiO2  0.19 Fe2O3  1.37 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:03:16',NULL),
	(12129,129,NULL,'Crocus martis','Crocus martis','Crocus Martis',NULL,'Crocus martis supplies Fe2O3.\n A source of iron in glazes.\n Analyses:\n Hopper:\n Fe2O3\n Chappell:\n Fe2O3 + impurities\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:04:34',NULL),
	(12130,130,NULL,'Cryolite','Cryolite','Cryolite',NULL,'Cryolite supplies Na2O and Al2O3.\n A natural source of insoluble sodium. Because of its lack of\n oxygen, can help to produce artifical reduction in electric\n firing. The release of fluorine at higher temperatures may\n produce cratered, bubbled surfaces.\n Analyses:\n Hopper:\n Na3AlF6\n Cooper & Royle:\n Na3AlF6  or 3NaF AlF3\n Rhodes:\n Na3AlF6\n Chappell:\n Na3AlF6\n Cushing:\n Na3AlF6\n Parmelee: (error?)\n 3 NaF  AlF6\n IMC:\n % 29.45 Na2O  16.13 Al2O3  54.42 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:03:22',NULL),
	(12131,131,12371,'Custer Feldspar','Custer Feldspar','Custer Feldspar',NULL,'Updated December 30, 2016.  Analyses for recipes in Glazy using this material have automatically been updated.\r\n\r\nNow using 2016 analysis from Pacer, revised 7/22/2016\r\n\r\nhttp://www.pacerminerals.com/wp-content/uploads/2016/10/FELDSPAR-200-325-Tech-Data.pdf\r\n\r\nTYPICAL PHYSICAL/CHEMICAL PROPERTIES\r\nBulk Density 67 lbs./cu.ft.\r\nLoss on Ignition 0.30%\r\nSpecific Gravity 2.6\r\nOil Absorption 23.9\r\npH 8.0\r\nMoh\'s Hardness 6.0\r\n\r\nTYPICAL CHEMICAL ANALYSIS\r\nSilica (SiO2) 68.5%\r\nAlumina (Al2O3) 17.0% (16.5% min)\r\nIron (Fe2O3) 0.10% (0.15% max.)\r\nSoda (Na2O) 3.0%\r\nPotash (K2O) 10.0% (9.5% min.)\r\nLime (CaO) 0.3%\r\nMagnesium (MgO) trace\r\n\r\n\r\nInformation from original import:\r\n\r\nCuster feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3. Commonly used potash feldspar. Can be used to substitute for Keystone, Buckingham, Yankee, or\r\n Kingman feldspars. Manufactured by Pacer Corporation; comes from Custer, SD. Primarily feldspar, some free quartz and traces of iron and magnesium.\r\n\r\n Analyses:\r\n Obstler: (Pacer Corp. 1989)\r\n % 3.0 Na2O  10.0 K2O  0.3 CaO  17.0 Al2O3 68.5 SiO2  0.15 Fe2O3\r\n Cooper & Royle: (Appendix 8)\r\n % 3.0 Na2O  10.4 K2O  0.3 CaO  17.5 Al2O3 68.5 SiO2  0.08 Fe2O3  0.3 LOI\r\n Rhodes:\r\n 0.31 Na2O  0.69 K2O  1.05 Al2O3  7.05 SiO2\r\n Chappell:\r\n % 3.0 Na2O  10.4 K2O  0.01 MgO  0.30 CaO  17.5 Al2O3 68.5 SiO2  0.08 Fe2O3  0.3 LOI\r\n Cushing:\r\n 0.31 Na2O  0.69 K2O  1.05 Al2O3  7.05 SiO2\r\n Tichane (CB):\r\n % 3.0 Na2O  10.4 K2O  0.3 CaO  17.5 Al2O3 68.5 SiO2  0.1 Fe2O3  0.3 LOI\r\n IMC:\r\n % 2.91 Na2O  10.28 K2O  0.30 CaO  17.35 Al2O3 69.00 SiO2  0.12 Fe2O3  0.04 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2016-12-30 22:18:43',NULL),
	(12132,132,NULL,'Darvan','Darvan','Darvan',NULL,'Darvan is a deflocculant.\n Darvan is a general name for a series of products from R.T.\n Vanderbilt. They are polyacrylic acid polymers that are usually\n used to deflocculate casting slips. For more information on\n specific versions, see IMC\'s book.\n Approximate cost: $3.50/pint (Axner, 2001)\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12133,133,NULL,'Del Monte feldspar','Del Monte feldspar','Delmonte Feldspar',NULL,'Del Monte feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, MgO,\n and Fe2O3.\n Analyses:\n Speight:\n 0.39 Na2O  0.40 K2O  0.21 CaO  1.03 Al2O3  6.42 SiO2\n IMC:\n % 4.70 Na2O  4.30 K2O  0.20 MgO  0.20 CaO  16.50 Al2O3\n 73.40 SiO2  0.02 TiO2  0.15 Fe2O3  0.45 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:05:49',NULL),
	(12134,134,NULL,'Dextrine','Dextrine',NULL,NULL,'Dextrine helps to bind the glaze and adhere the glaze to the pot.\n Chappell gives these instructions for use:\n Mix 2 tablespoons per pint of water; add a few drops\n formaldehyde (to prevent decomposition). Shake vigorously then\n let sit a few hours. Add 2 tablespoons of solution per pint glaze.\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12135,135,NULL,'Dolomite','Dolomite','Dolomite',NULL,'Dolomite supplies CaO and MgO.\n Dolomite is calcium magnesium carbonate, theoretical formula\n CaMg(CO3)2. Pure dolomite, with exactly equal numbers of calcium\n and magnesium atoms, is formed by precipitation out of waters in\n which both are dissolved. Most dolomite, however, is formed when\n magnesium-rich waters seep through calcium carbonate rocks, and\n the magnesium ions replace some of the calcium (up to half).\n This process takes millions of years to complete, so some\n dolomite may have only incomplete replacement, and thus be\n higher in calcium than pure dolomite. Limestones in which\n dolomitization has occurred are known as dolomitic limestones\n or dolostones.\n According to Obstler, dolomite may be substituted for whiting\n in many glazes without significant changes.\n Analyses:\n Obstler: (DOLOCRON 4013 Pulverized Dolomitic Limestone\n from CT - from Pfizer Inc. Minerals Division, 1992)\n % 55.0 CaCO3 43.0 MgCO3 0.2 Al2O3 0.3 Fe2O3 0.7 SiO2 0.1 H2O\n Obstler: (CT dolomitic limestone - Ceramic Industry 1993, 63)\n % 30.57 CaO  19.42 MgO  0.2 Al2O3  0.1 Fe2O3  45.11 LOI\n Hopper:\n CaCO3 MgCO3\n Cooper & Royle:\n CaCO3 MgCO3\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.019)\n % 0.15 KNaO  31.41 CaO  20.77 MgO  0.56 Al2O3\n 1.05 SiO2  0.40 Fe2O3  45.53 LOI\n Rhodes:\n CaCO3 MgCO3\n Cuff:\n CaCO3 MgCO3\n Chappell:\n CaCO3 MgCO3\n Cushing:\n CaCO3 MgCO3\n Memmott:\n CaCO3 MgCO3\n Parmelee:\n CaCO3 MgCO3\n IMC:\n % 21.90 MgO  30.49 CaO  47.61 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:42:37',NULL),
	(12136,136,NULL,'Epidote','Epidote',NULL,NULL,'Epidote supplies SiO2, Al2O3, CaO, and Fe2O3.\n A common igneous rock.\n Analyses:\n Grebanier:\n Ca2(Al,Fe)3  (SiO4)3  (OH)\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:06:02',NULL),
	(12137,137,12288,'EPK','EPK, EP Kaolin, Edgar Plastic','EP Kaolin',NULL,'EPK supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of\r\n several fluxes.\r\n A secondary (sedimentary) kaolin. 97% kaolinite. Fairly plastic,\r\n white firing, good for suspending glazes.\r\n Manufactured by Feldspar Corp.; comes from Florida.\r\n Analyses:\r\n Feldspar Corp.: (2001)\r\n % 0.059 Na2O  0.33 K2O  0.098 MgO  0.18 CaO\r\n 37.36 Al2O3  45.73 SiO2  0.37 TiO2\r\n 0.79 Fe2O3  0.236 P2O5  13.91 LOI\r\n Obstler: (Feldspar Corp., 1989)\r\n % 0.05 Na2O  0.35 K2O  0.13 MgO  0.12 CaO\r\n 38.28 Al2O3 45.14 SiO2  0.075 P2O5  0.27 TiO2\r\n 0.75 Fe2O3  14.48 H2O  0.025 SO3\r\n Cooper & Royle: (Appendix 8)\r\n % 0.04 Na2O  0.22 K2O  0.12 MgO  0.09 CaO\r\n 38.71 Al2O3 45.91 SiO2  0.34 TiO2\r\n 0.42 Fe2O3  14.16 LOI\r\n Chappell:\r\n % 0.04 Na2O  0.22 K2O  0.12 MgO  0.09 CaO  38.71 Al2O3\r\n 45.91 SiO2  0.34 TiO2  0.42 Fe2O3  14.16 LOI\r\n Cushing:\r\n % 0.20 Na2O  0.25 K2O  0.15 MgO  0.10 CaO  37.8 Al2O3\r\n 46.0 SiO2  0.40 TiO2  0.60 Fe2O3  0.05 P2O5 14.0 LOI 0.03 SO3\r\n Tichane (TCB):\r\n % 0.2 K2O  0.1 CaO  0.1 MgO  38.7 Al2O3\r\n 45.9 SiO2  0.34 TiO2  0.42 Fe2O3  14.2 LOI\r\n Tichane (CB):\r\n % 0.1 Na2O  0.4 K2O  0.1 MgO  0.1 CaO  37.3 Al2O3\r\n 45.1 SiO2  0.3 TiO2  0.8 Fe2O3  14.5 LOI\r\n IMC:\r\n % 0.06 Na2O  0.33 K2O  0.10 MgO  0.18 CaO  37.36 Al2O3\r\n 45.73 SiO2  0.37 TiO2  0.79 Fe2O3  0.24 P2O5  13.91 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:02:59',NULL),
	(12138,138,NULL,'Epsom salts','Epsom salts, Magnesium Sulfate','Epsom Salts',NULL,'Epsom salts supply MgO and help to flocculate glazes.\r\n Highly soluble; used in small quantities (0.1%-1%) as a\r\n flocculant in slips and glazes. Many sources recommend making a\r\n concentrated solution, then adding the solution to the mixed\r\n glaze.\r\n Can be a helpful addition to glazes with Gerstley Borate to help\r\n prevent excessive gelling - try 4g per 100g GB [IMC].\r\n Decomposes to lose water at 150C.\r\n Analyses:\r\n Hopper:\r\n MgSO4  7H2O\r\n Chappell:\r\n MgSO4  7H2O\r\n Parmelee:\r\n MgSO4  7H2O\r\n IMC:\r\n % 21.5 MgO  48.0 H2O  30.5 SO3',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2016-03-22 11:05:31',NULL),
	(12139,139,12371,'Eureka Feldspar','Eureka Feldspar','Eureka Feldspar',NULL,'Eureka feldspar supplies SiO2, Al2O3, K2O, Na2O, and Fe2O3.\r\n Potash feldspar.\r\n Analyses:\r\n Cooper & Royle: (appendix 8)\r\n % 3.5 Na2O  9.4 K2O  17.11 Al2O3\r\n 69.8 SiO2  0.01 Fe2O3  0.2 LOI\r\n Chappell: (slight difference from C&R)\r\n % 3.5 Na2O  9.4 K2O  17.11 Al2O3\r\n 69.8 SiO2  0.1 Fe2O3  0.2 LOI\r\n Tichane (CB):\r\n % 3.5 Na2O  9.4 K2O  17.1 Al2O3\r\n 69.8 SiO2  0.2 LOI\r\n IMC:\r\n % 3.49 Na2O  9.37 K2O  0.19 CaO  17.05 Al2O3\r\n 69.70 SiO2  0.11 Fe2O3  0.09 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:25:36',NULL),
	(12140,140,12407,'Eureka Feldspar #703','Eureka Feldspar #703',NULL,NULL,'Eureka spar #703 supplies SiO2, Al2O3, Na2O, K2O, and CaO. Soda feldspar; low calcium.\r\n Analyses:\r\n Cushing:\r\n 0.52 Na2O  0.46 K2O  0.02 CaO  1.07 Al2O3  8.61 SiO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:35:21',NULL),
	(12141,141,12407,'F-20 Feldspar','F-20 Feldspar',NULL,NULL,'F-20 feldspar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3. Soda feldspar. Manufactured by Feldspar Corporation. Used primarily as an alumina source in glasses.\r\n Analyses:\r\n Feldspar Corp.: (2001)\r\n % 6.82 Na2O  4.10 K2O  1.40 CaO  18.80 Al2O3 68.25 SiO2  0.065 Fe2O3  0.08 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:37:23',NULL),
	(12142,142,NULL,'Feldspar','Feldspar','Feldspar',NULL,'Feldspar supplies SiO2, Al2O3, K2O, and Na2O.\n [Map to your favorite feldspar. Usually the ingredient\n feldspar in a recipe means a potash feldspar, but this is not\n always the case.]\n Technically, feldspars are sodium, potassium, and calcium\n aluminosilicates, although the category is often extended to\n include many feldspar-like (and feldspar-containing) materials\n that supply fluxes, alumina, and silica to a glaze  (i.e.\n Spodumene, Cornwall Stone, etc.) Feldspars are igneous minerals, \n a primary component of granites and similar rocks that make up a\n large portion of the earth\'s crust. Feldspars and related materials\n are the primary components of most stoneware glazes.\n Analyses:\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.022 - Mixed feldspar)\n % 3.72 Na2O  10.20 K2O  0.68 CaO  19.00 Al2O3\n 65.80 SiO2  0.10 Fe2O3  0.33 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:54:28',NULL),
	(12143,143,NULL,'Ferro Feldspar #10','Ferro Feldspar #10','Ferro Feldspar No. 10',NULL,'Del Monte feldspar supplies SiO2, Al2O3, K2O, and Na2O.\n Analyses:\n Speight:\n 0.286 Na2O  0.716 K2O  0.984 Al2O3  7.85 SiO2\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:07:31',NULL),
	(12144,144,NULL,'Fire clay (Theoretical)','Fire clay (Theoretical)','Fireclay',NULL,'Fire clay supplies SiO2 and Al2O3. [Generic fire clay. Map to a particular kind of fire clay, or use generic formula below.] Fire clays are coarse clays of sedimentary origin. They result from deposits of clay and silt in deep fresh water, and from the metamorphosis of ancient swamps into layers of clay and coal.\r\n Fire clays contain large amounts of crystalline quartz, kaolinite, and illite (hydrous mica), along with organic matter and other minerals.\r\n Fire clays, as their name suggests, are somewhat refractory and resistant to heat. They are used in stoneware clay bodies, but only infrequently in glazes.\r\n The terms fire clay, sagger clay, and stoneware clay refer to very similar clays, so far as chemistry and physical properties go; the classification of a clay as one or the other more often hinges on its usage.\r\n Analyses: (generic Fire Clay)\r\n Green:\r\n 0.01 Na2O  0.07 K2O  0.06 MgO  0.02 CaO  1.0 Al2O3 4.0 SiO2  0.06 TiO2  0.05 Fe2O3  2.10 H2O\r\n Cooper & Royle:\r\n Al2O3  6 SiO2\r\n Chappell:\r\n % 0.3 Na2O  1.9 K2O  1.1 MgO  0.8 CaO  23.1 Al2O3 58.1 SiO2  1.4 TiO2  2.4 Fe2O3  10.5 LOI\r\n Tichane (TCB):\r\n % 0.1 Na2O  0.2 K2O  0.1 CaO  30.0 Al2O3 52.0 SiO2  1.5 TiO2  1.0 Fe2O3  10.0 LOI',13,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 14:58:24',NULL),
	(12146,146,NULL,'Fluorspar','Fluorspar','Fluorspar',NULL,'Fluorspar supplies CaO.\n Fluorspar has a theoretical composition of CaF2. It is produced\n by the metamorphosis of limestone and dolomite by fluorine-rich\n gases.\n Manufactured in the U.S. by Inverness Mining Co., Cave-In-Rock,\n IL. Comes from Kentucky and Illinois.\n In glazes, usually used in small amounts. Helps to flux the\n glaze and may produce opacity (fluorite crystals). Silicon\n tetrafluoride produced by the decomposition of fluorspar may\n cause blisters and pinholes, and may damage the kiln and the\n potter. Because silicon is removed, may matt the surface.\n Can help in the development of unusual blues from cobalt and\n copper.\n Analyses:\n Obstler: (Ceramic Industry, 1993, 66)\n % 95 CaF2  3 SiO2  1 CaCO3  0.12 Fe2O3\n Cooper & Royle:\n CaF2\n Rhodes:\n CaF2\n Chappell:\n CaF2\n Cushing:\n CaF2\n Parmelee:\n CaF2\n IMC:\n % 48.6 CaO  3.0 SiO2  46.4 F\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 04:56:04',NULL),
	(12147,147,NULL,'Formaldehyde','Formaldehyde',NULL,NULL,'Formaldehyde helps prevent organic matter from decomposing.\n Can be added to gum solutions, glazes containing ball clays, or\n any other glaze that contains organic matter and tends to\n decompose.\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12148,148,12058,'Foundry Hill Creme','Foundry Hill Creme','Foundry Hill Creme',NULL,'Foundry Hill Creme supplies SiO2, Al2O3, Fe2O3, TiO2, P2O5, and small amounts of several fluxes. A quartz-rich ball clay, used in stoneware clay bodies. May substitute for Jordan clay, with the addition of some feldspar. Contains 37% quartz, 31% kaolinite, 14% montmorillonite, 13%  mica, and 3% organic matter. Manufactured by H.C. Spinks Clay Co.; comes from Paris, TN.  Very smooth, unspeckled; high shrinkage.\r\n Analyses:\r\n Obstler (H.C. Spinks Clay Co. - note - no LOI and high P2O5):\r\n % 0.55 Na2O  0.67 K2O  0.51 MgO  0.5 CaO  20.48 Al2O3 66.21 SiO2  8.21 P2O5  0.53 TiO2  1.6 Fe2O3 0.09 SO3  0.3 MnO\r\n Cushing:\r\n % 0.18 Na2O  2.3 K2O  0.31 MgO  0.04 CaO  24.8 Al2O3 58.4 SiO2  1.1 TiO2  4.7 Fe2O3  8.1 LOI\r\n IMC:\r\n % 0.55 Na2O  0.70 K2O  0.50 MgO  0.50 CaO  20.50 Al2O3 66.20 SiO2  0.09 P2O5  0.50 TiO2  1.60 Fe2O3 0.09 SO3  8.20 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:41:35',NULL),
	(12149,149,NULL,'Fremington clay','Fremington clay','Fremington clay',NULL,'Fremington clay supplies SiO2, Al2O3, P2O5, Fe2O3, TiO2,\n and small amounts of several fluxes.\n Analyses:\n IMC:\n % 0.44 Na2O  3.98 K2O  3.97 MgO  4.87 CaO  20.11 Al2O3\n 59.68 SiO2  0.94 TiO2  6.01 Fe2O3\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:10:20',NULL),
