	(12205,205,NULL,'Frit CC298-2','Frit CC298-2',NULL,NULL,'Frit CC298-2 supplies B2O3, CaO, Na2O, K2O, SiO2,\n and Al2O3.\n Frit often discussed as a Gerstley Borate replacement. It\n contains more alumina and silica than GB, so the amounts of\n other materials in the glaze would need to be adjusted.\n From Ferro:\n For every 2 parts Gerstley Borate, substitute 3 parts\n CC298-2 and remove 1 part feldspathic material (feldpar/\n nepheline syenite). In other words, if there are currently\n 20 parts Gerstley Borate in the glaze formula, add 30 parts\n CC298-2 and remove 10 parts feldspar from the formula.\n Slight adjustments to the formula may be necessary due to\n variation in body, firing cycle, or specific glaze\n formulation.\n Analyses:\n Axner: (Web site, 2001)\n % 6.0 Na2O  3.5 K2O  21.0 CaO  3.5 MgO  28.0 B2O3\n 7.0 Al2O3  31.0 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:19:49',NULL),
