	(12241,241,NULL,'Frit Pb-63','Frit Pb-63','Pemco Frit Pb-63',NULL,'Frit Pb-63 supplies SiO2, Al2O3, B2O3, PbO, CaO, Na2O, and ZrO2.\n Lead borosilicate frit.\n Fusion at 1400F.\n Similar frits: Ferro 3417, O\'Hommel 24 (235), Glostex G-24.\n Analyses:\n IMC:\n % 3.6 Na2O  4.5 CaO  30.5 PbO  12.6 B2O3\n 3.4 Al2O3  43.0 SiO2  2.4 ZrO2\n 0.21 Na2O  0.29 CaO  0.50 PbO  0.66 B2O3\n 0.12 Al2O3  2.60 SiO2  0.07 ZrO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:26:23',NULL),
	(12242,242,NULL,'Frit Pb-716','Frit Pb-716','Pemco Frit Pb-716',NULL,'Frit Pb-716 supplies SiO2, PbO, and CaO.\n Lead calcium silicate frit.\n Fusion at 1300F.\n Similar frits: Ferro 3489.\n Analyses:\n IMC: (silica amount probably wrong)\n % 5.6 CaO  67.6 PbO  26.8 SiO2\n 0.25 CaO  0.75 PbO  1.11 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:26:26',NULL),
	(12243,243,NULL,'Frit Pb-723','Frit Pb-723','Pemco Frit Pb-723',NULL,'Frit Pb-723 supplies SiO2, Al2O3, PbO, and Na2O.\n High lead zincless frit; very low melting temperature.\n Fusion at 1100F.\n Similar frits: Ferro 3403, O\'Hommel 71 (243) [or 373?],\n Fusion FL-42, Glostex L-71.\n Analyses:\n IMC:\n % 1.5 Na2O  71.2 PbO  2.4 Al2O3  24.9 SiO2\n 0.07 Na2O  0.93 PbO  0.07 Al2O3  1.21 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:27:24',NULL),
	(12244,244,NULL,'Frit Pb-740','Frit Pb-740','Pemco Frit Pb-740',NULL,'Frit Pb-740 supplies SiO2, Al2O3, PbO, ZnO, and Na2O.\n Lead/zinc silicate frit.\n Fusion at 1600F.\n Analyses:\n Cooper & Royle:\n % 1.2 Na2O  56.8 PbO  20.0 ZnO  2.0 Al2O3  20.0 SiO2\n IMC:\n % 1.2 Na2O  56.8 PbO  20.0 ZnO  2.0 Al2O3  20.0 SiO2\n 0.04 Na2O  0.49 PbO  0.47 ZnO  0.04 Al2O3  0.64 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:27:27',NULL),
	(12245,245,NULL,'Frit Pb-742','Frit Pb-742','Pemco Frit Pb-742',NULL,'Frit Pb-742 supplies SiO2, Al2O3, B2O3, PbO, CaO, Na2O, and ZrO2.\n Zincless lead borosilicate frit suitable for c/06-04 glazes.\n Fusion at 1400F.\n Similar frits: Ferro 3493, 3576, O\'Hommel 373, Fusion FL-28.\n Analyses:\n Cooper & Royle:\n % 3.6 Na2O  4.5 CaO  31.0 PbO  13.0 B2O3\n 3.4 Al2O3  43.5 SiO2  1.0 ZrO2\n IMC:\n % 3.6 Na2O  4.5 CaO  31.0 PbO  13.0 B2O3\n 3.4 Al2O3  43.5 SiO2  1.0 ZrO2\n 0.21 Na2O  0.29 CaO  0.50 PbO  0.67 B2O3\n 0.12 Al2O3  2.61 SiO2  0.03 ZrO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:27:30',NULL),
	(12246,246,NULL,'Frit Pb-83','Frit Pb-83','Pemco Frit Pb-83',NULL,'Frit Pb-83 supplies SiO2, B2O3, PbO, and Na2O.\n Lead borosilicate frit; extremely low melting point; no alumina.\n Fusion at 1xx0F.\n Similar frits: Pemco Pb-83, O\'Hommel 33 (240), Glostex G-23.\n Analyses:\n Cushing:\n 0.28 Na2O  0.72 PbO  0.56 B2O3  0.90 SiO2\n IMC:\n % 6.4 Na2O  59.2 PbO  14.4 B2O3  20.0 SiO2\n 0.28 Na2O  0.72 PbO  0.56 B2O3  0.90 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:27:33',NULL),
	(12247,247,NULL,'Frit Pb-943','Frit Pb-943','Pemco Frit Pb-943',NULL,'Frit Pb-943 supplies SiO2, B2O3, Na2O, CaO, PbO, and K2O.\n Sodium borosilicate frit; small amounts of lead and calcium;\n no alumina.\n Fusion at 1340F.\n Similar frits: Ferro 3465, O\'Hommel 18.\n Analyses:\n IMC:\n % 5.3 K2O  9.0 Na2O  6.3 CaO  6.3 PbO  20.3 B2O3  52.7 SiO2\n 0.17 K2O  0.43 Na2O  0.33 CaO  0.08 PbO  0.85 B2O3  2.56 SiO2\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 09:27:38',NULL),
	(12248,248,NULL,'Fuller\'s earth','Fuller\'s earth','Fuller\'s Earth',NULL,'Fuller\'s earth supplies SiO2, Al2O3, MgO, CaO, KNaO, and Fe2O3.\n Used in small quantities as a suspender.\n Analyses:\n Green:\n 0.19 KNaO  0.39 MgO  0.42 CaO  1.35 Al2O3  7.75 SiO2\n 0.34 Fe2O3  4.72 H2O\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:10:54',NULL),
	(12249,249,12371,'G-200 Feldspar','G-200 Feldspar','G-200 Feldspar',NULL,'G-200 feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\r\n Commonly used potash feldspar. In many cases can be substituted\r\n for or by Custer.\r\n Manufactured by Feldspar Corporation; comes from Monticello,\r\n GA. Primarily feldspar, some free quartz and traces of iron and\r\n magnesium.\r\n Analyses:\r\n Feldspar Corp.: (2001)\r\n % 3.04 Na2O  10.75 K2O  0.81 CaO  18.5 Al2O3\r\n 66.3 SiO2  0.082 Fe2O3  0.16 LOI\r\n Obstler: (Feldspar Corp. 1993)\r\n % 3.01 Na2O  10.66 K2O  0.81 CaO  18.40 Al2O3\r\n 66.81 SiO2  0.08 Fe2O3  0.16 LOI\r\n Cooper & Royle: (appendix 8)\r\n % 3.20 Na2O  10.36 K2O  0.98 CaO  19.28 Al2O3\r\n 65.76 SiO2  0.06 Fe2O3  0.31 LOI\r\n Cushing:\r\n 0.30 Na2O  0.60 K2O  0.10 CaO  1.05 Al2O3  6.16 SiO2\r\n Tichane (CB):\r\n % 2.9 Na2O  10.3 K2O  1.0 CaO  18.3 Al2O3\r\n 67.2 SiO2  0.1 Fe2O3  0.2 LOI\r\n IMC:\r\n % 3.04 Na2O  10.75 K2O  0.05 MgO  0.81 CaO  18.50 Al2O3\r\n 66.30 SiO2  0.08 Fe2O3  0.16 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:10:09',NULL),
	(12250,250,12371,'G-40 feldspar','G-40 feldspar','G-40 feldspar',NULL,'G-40 feldspar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3.\r\n Potash feldspar.\r\n Manufactured by Feldspar Corporation. Used primarily in glasses\r\n requiring high potassium level.\r\n Analyses:\r\n Feldspar Corp.: (2001)\r\n % 3.0 Na2O  10.4 K2O  0.8 CaO  18.0 Al2O3\r\n 67.56 SiO2  0.076 Fe2O3  0.16 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:33:49',NULL),
	(12251,251,NULL,'Galena','Galena',NULL,NULL,'Galena supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:30:27',NULL),
	(12252,252,NULL,'Gerstley Borate','Gerstley Borate','Gerstley Borate',NULL,'Gerstley borate supplies B2O3, CaO, other fluxes, SiO2, and Al2O3. Gerstley borate is a calcium borate ore containing the mineral Ulexite ( 3CaO Na2O 5B2O3 16H2O ), along with accessory minerals such as Bentonite, Colemanite, and Probertite. Gerstley borate was formed in marshes and drying lake basins during the Miocene (10 million years ago).\r\n Gerstley borate is named after James Gerstley, former managing director of Borax Consolidated Ltd. It is manufactured by U.S. Borax and Chemical Corp.; the mine is located near Death Valley, CA.\r\n G.B. is an inexpensive source of B2O3 and CaO in glazes. It is often used in place of colemanite. The primary differences are:\r\n1) colemanite contains a higher concentration of B2O3, \r\n2) G.B. contains Na2O, which may affect the color and surface of some glazes, and \r\n3) the Bentonite component of G.B. - up to 18% - significantly affects the properties of the raw glaze. (Some other sources indicate that this is not bentonite, but rather shale. GB glazes do tend to gel in either case.)\r\n\r\n Other points from IMC: \r\n1) GB is slightly soluble and tends to gel the glaze, necessitating excessive water and resulting in greater shrinkage of the raw glaze, which leads to crawling and other problems, especially when there is also a lot of clay in the glaze. Epsom salts (4g per 100g GB) can help. 2) The chemical and physical properties of the material (composition, mesh size, etc.) change over time. 3) GB can contain gypsum and lead to lime popping.\r\n Analyses:\r\n Axner: (web site, 2001)\r\n % 4.5 Na2O  0.25 K2O  3.5 MgO  22.0 CaO  1.0 Al2O3 29 B2O3  0.2 Fe2O3  10.0 SiO2  29.0 LOI\r\n Obstler: (Hammill & Gillespie)(also includes 6.2 LOD whatever that is)\r\n % 3.6-5.3 Na2O  2.9 MgO  17.1-20.6 CaO  1.3 Al2O3 25-28.9 B2O3  0.35 Fe2O3  10.6 SO2  30.5 LOI\r\n Hopper:\r\n 2 CaO  Na2O  3 B2O3  7 H2O\r\n Cushing:\r\n CaO  B2O3  5 H2O\r\n IMC:\r\n % 9.31 Na2O  16.85 CaO  52.25 B2O3  21.59 LOI\r\n ClayArt from Axner:\r\n This product is composed of a mixture of the minerals Colemanite and Ulexite. This material contains approximately 28.0% Boric Oxide (B2O3), 5.3% Sodium Oxide (Na2O), 20.6 Calcium oxide (CaO) and 25% water of crystallization.',23,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:18:21',NULL),
	(12253,253,12252,'Gillespie Borate','Gillespie Borate','Gillespie Borate',NULL,'A blended borate mineral for use in glaze formulas replacing Gerstley Borate on a pound for pound basis. Virtually identical to Gerstley Borate, this product requires no adjustment to formula and no extra additives are needed. Mineral Match -- GB provides the same minerals to the glaze as Gerstley Borate, thus imparting the same glaze activity, texture and effects. Particle Size Match -- As a -200 mesh material, GB combines well with other glaze raw materials. Plasticity Match -- A high colloid and clay content gives the plasticity necessary for many applications. Reduced Glaze Defects -- Our laboratory studies indicate that GB gives increased glaze surface smoothness and a reduction in crawling and pinhole defects. Lower In Off-Color Impurities -- As a refined blended material, GB contains few impurities and produces brighter glazes and colors.\r\n http://www.hamgil.com/html/gillespieborate.html',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:19:33',NULL),
	(12254,254,NULL,'Glass','Glass, Powdered Glass',NULL,NULL,'Glass supplies SiO2 and various fluxes.\n Miscellaneous glass. Glass can have a wide range of compositions,\n but the basic idea is high flux, high silica, low alumina.\n Analyses:\n Cardew (Pioneer Pottery): (Container glass - from Norton, 157)\n % 15.6 Na2O  4.2 MgO  5.6 CaO  0.3 BaO  1.8 Al2O3  72.1 SiO2\n Parmelee:\n 0.5 Na2O  0.5 CaO  SiO2\n IMC:\n % 13.68 Na2O  0.09 K2O  3.28 MgO  10.12 CaO  1.14 Al2O3\n 71.47 SiO2  0.23 Fe2O3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:19:02',NULL),
	(12255,255,NULL,'Glomax','Glomax','Glomax LL Calcined Kaolin',NULL,'Calcined china clay supplies SiO2 and Al2O3.\n [Generic formula, could be mapped to a particular calcined\n kaolin.]\n Calcined form of kaolin, used in place of regular kaolin to\n reduce the shrinkage of a glaze or slip due to clay content.\n Analyses:\n Cooper & Royle: (Appendix 8)\n % 0.31 Na2O  0.39 K2O  44.40 Al2O3\n 53.08 SiO2  0.95 TiO2  0.40 Fe2O3\n Rhodes:\n Al2O3  2 SiO2\n Cushing: (Glomax Calcined Kaolin)\n % 0.25 Na2O  0.09 K2O  0.23 MgO  0.05 CaO  44.4 Al2O3\n 53.8 SiO2  1.5 TiO2  0.44 Fe2O3\n Cushing:\n Al2O3  2 SiO2\n Memmott:\n Al2O3  2 SiO2\n IMC:\n Al2O3  2 SiO2\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:19:40',NULL),
	(12256,256,NULL,'Godfrey feldspar','Godfrey feldspar','Godfrey Feldspar',NULL,'Godfrey feldspar supplies SiO2, Al2O3, Na2O, and CaO.\n Analyses:\n IMC: (strangely, no K2O)\n % 5.54 Na2O  2.86 CaO  17.07 Al2O3  74.31 SiO2  1.50 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:19:55',NULL),
	(12257,257,NULL,'Gold chloride','Gold chloride','Gold Chloride',NULL,'Gold chloride supplies Au2O3.\n Occasionally used in pink/purple glazes. Limited temperature\n range, very expensive.\n Analyses:\n Hopper:\n AuCl3\n Chappell:\n AuCl3\n Parmelee:\n AuCl3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12258,258,NULL,'Goldart','Goldart','Goldart',NULL,'GoldArt supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\n of several fluxes.\n A plastic Ohio fire clay / stoneware clay. Formed by\n metamorphosis of an ancient swamp.\n Manufactured by Cedar Heights Clay; comes from Oak Hill, OH.\n Can substitute for Jordan.\n Analyses:\n Obstler:\n % 0.16 Na2O  1.87 K2O  0.42 MgO  0.22 CaO  27.3 Al2O3\n 56.72 SiO2  1.75 TiO2  1.42 Fe2O3  10.03 LOI  0.12 S\n Coope & Royle: (Appendix 8)(they call it A.F. Goldhart 200 m)\n % 0.30 Na2O  0.88 K2O  0.22 MgO  0.08 CaO  28.5 Al2O3\n 57.32 SiO2  1.98 TiO2  1.23 Fe2O3  9.39 LOI  0.24 S\n Chappell:\n % 0.3 Na2O  0.88 K2O  0.22 MgO  0.08 CaO  28.5 Al2O3\n 57.3 SiO2  1.98 TiO2  1.23 Fe2O3  9.39 LOI\n Cushing:\n % 1.2 KNaO  0.22 MgO  0.08 CaO  28.5 Al2O3\n 57.3 SiO2  1.9 TiO2  1.2 Fe2O3  9.4 LOI\n Tichane (CB):\n % 0.3 Na2O  0.9 K2O  0.2 MgO  0.1 CaO  28.5 Al2O3\n 57.3 SiO2  2.0 TiO2  1.2 Fe2O3  9.4 LOI\n IMC:\n % 0.17 Na2O  1.00 K2O  0.23 MgO  0.09 CaO  28.53 Al2O3\n 57.46 SiO2  1.99 TiO2  1.25 Fe2O3  9.28 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:21:12',NULL),
	(12259,259,NULL,'Granite','Granite','Granite',NULL,'Granite supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\n A common igneous rock, composed of silica, feldspar, and small\n amounts of iron-bearing minerals.\n Analyses:\n Obstler: (Average granite - Bates 1969)\n % 3.48 Na2O  4.11 K2O  1.99 CaO  13.49 Al2O3  70.18 SiO2\n 1.57 Fe2O3  1.78 FeO  0.84 LOI\n Grebanier: (powder - Barre, VT)\n 0.5023 Na2O  0.2835 K2O  0.214 CaO  0.9016 Al2O3\n 6.9904 SiO2  0.749 Fe2O3\n Tichane (AG, TCB): (average granite)\n % 3.0 Na2O  5.0 K2O  0.2 MgO  1.0 CaO  13.0 Al2O3\n 74.O SiO2  0.3 TiO2  3.0 Fe2O3  0.2 P2O5\n Tichane (AG, TCB): (Earth\'s crust)\n % 3.3 Na2O  3.0 K2O  3.7 MgO  4.9 CaO  14.9 Al2O3\n 59.8 SiO2  0.8 TiO2  6.1 Fe2O3  0.3 P2O5\n Tichane (CB): (Earth\'s crust)\n % 3 Na2O  3 K2O  4 MgO  5 CaO  15 Al2O3\n 60 SiO2  0.8 TiO2  6 Fe2O3\n Tichane (CB): (Granite)\n % 3 Na2O  5 K2O  0.2 MgO  1 CaO  13 Al2O3\n 74 SiO2  0.3 TiO2  3 Fe2O3\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:21:22',NULL),
	(12260,260,NULL,'Granular ilmenite','Granular ilmenite','Granular Illmenite',NULL,'Granular ilmenite supplies Fe2O3 and TiO2.\n A natural source of titanium and iron. Granular ilmenite is\n sometimes used in small amounts (<1%) to color/speckle clay\n bodies.\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:59:10',NULL),
