	(12268,268,12288,'Grolleg Kaolin','Grolleg Kaolin','Grolleg Kaolin',NULL,'Grolleg (English china clay) supplies SiO2, Al2O3, Fe2O3, and\r\n small amounts of several fluxes.\r\n A primary (residual) kaolin formed by the action of\r\n hydrothermal vapors on soda feldspar in granites and pegmatites.\r\n 81% kaolinite, 15% mica, 4% feldspar and other minerals.\r\n Manufactured by ECC International; comes from southwest England.\r\n Plastic and white-firing, low shrinkage, excellent hardness.\r\n Analyses:\r\n Obstler: (ECC International, 1987)\r\n % 0.1 Na2O  1.95 K2O  0.3 MgO  0.06 CaO  37.0 Al2O3\r\n 48.0 SiO2  0.02 TiO2  0.75 Fe2O3  12.2 H2O\r\n Green:\r\n 0.01 Na2O  0.06 K2O  0.02 MgO  0.01 CaO  1.0 Al2O3\r\n 2.2 SiO2  0.01 Fe2O3  1.82 H2O\r\n Cooper & Royle:\r\n Al2O3  2 SiO2  2 H2O\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.012 - China Clay No. 1)\r\n % 1.81 KNaO  36.94 Al2O3  47.06 SiO2\r\n 0.23 TiO2  1.09 Fe2O3  12.1 LOI\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.013 - China Clay No. 2)\r\n % 2.18 KNaO  36.90 Al2O3  48.30 SiO2\r\n 0.04 TiO2  0.68 Fe2O3  11.64 LOI\r\n Rhodes: (China clay)\r\n Al2O3  2SiO2  2H2O\r\n Cuff: (China clay)\r\n Al2O3  2SiO2  2H2O\r\n Chappell: (English kaolin)\r\n % 0.04 Na2O  1.8 K2O  0.28 MgO  0.03 CaO  37.29 Al2O3\r\n 47.25 SiO2  0.05 TiO2  0.85 Fe2O3  12.20 LOI\r\n Cushing:\r\n % 1.92 KNaO  0.25 MgO  0.10 CaO  37.7 Al2O3\r\n 47.7 SiO2  0.03 TiO2  0.60 Fe2O3  12.6 LOI\r\n Parmelee: (China clay)\r\n Al2O3  2SiO2  2H2O\r\n Tichane (TCB): (English kaolin)\r\n % 0.1 Na2O  1.9 K2O  0.1 CaO  0.1 MgO  37.3 Al2O3\r\n 47.9 SiO2  0.05 TiO2  0.5 Fe2O3  12.2 LOI\r\n Tichane (CB): (English kaolin)\r\n % 0.1 Na2O  1.4 K2O  0.2 CaO  37.6 Al2O3\r\n 47.2 SiO2  0.1 TiO2  0.5 Fe2O3  12.6 LOI\r\n Tichane (CB): (Grolleg)\r\n % 0.1 Na2O  1.8 K2O  0.3 MgO  0.1 CaO  37.2 Al2O3\r\n 47.7 SiO2  0.3 TiO2  0.6 Fe2O3  12.1 LOI\r\n IMC: (English kaolin)\r\n % 0.05 Na2O  1.80 K2O  0.02 CaO  0.28 MgO  37.38 Al2O3\r\n 47.44 SiO2  0.06 TiO2  0.82 Fe2O3  12.16 LOI\r\n IMC: (Grolleg kaolin)\r\n % 0.10 Na2O  1.90 K2O  0.10 CaO  0.30 MgO  37.00 Al2O3\r\n 48.00 SiO2  0.03 TiO2  0.70 Fe2O3  12.01 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:06:14',NULL),
	(12269,269,NULL,'Gum arabic','Gum arabic','Gum Arabic',NULL,'Gum material used as a binder and suspender in glazes.\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12270,270,NULL,'Gypsum','Gypsum',NULL,NULL,'Gypsum provides CaO.\n Gypsum is a mineral form of calcium sulfate. On heating to\n about 120-200C, gypsum loses 75% of its water and becomes\n Plaster of Paris; beyond 500C, all the water is lost and it\n becomes the mineral Anhydrite.\n Analyses:\n Klein & Hurlbut:\n CaSO4  2 H2O\n Parmelee:\n CaSO4  2 H2O\n Hamer:\n CaSO4  2 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12271,271,12288,'Hamilton kaolin','Hamilton kaolin','Hamilton Kaolin',NULL,'Hamilton kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n Manufactured by the Kentucky-Tennessee Clay Company.\r\n Analyses:\r\n IMC:\r\n % 0.08 Na2O  0.18 K2O  0.10 MgO  0.15 CaO  37.9 Al2O3\r\n 45.6 SiO2  1.4 TiO2  0.7 Fe2O3  13.5 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:06:59',NULL),
	(12272,272,12144,'Hawthorne Bond','Hawthorne Bond','Hawthorne Bond',NULL,'Hawthorne Bond supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n A Missouri fire clay - a secondary deposit of clay and sediment in deep fresh water.\r\n Manufactured by Christy Minerals; comes from Missouri. Good plasticity, light color.\r\n Analyses:\r\n Obstler: (adds to 112.8%, probably LOI was extra)\r\n % 0.03 Na2O  1.48 K2O  0.85 MgO  0.15 CaO  39.11 Al2O3 55.1 SiO2  2.08 TiO2  1.02 Fe2O3  13.0 LOI\r\n Chappell: (Hawthorn)\r\n % 0.16 Na2O  0.94 K2O  0.23 MgO  0.02 CaO  33.8 Al2O3 48.4 SiO2  1.00 TiO2  1.90 Fe2O3  12.9 LOI\r\n Cushing: (Hawthorn Bond)(no LOI listed)\r\n % 0.24 Na2O  1.24 K2O  0.85 MgO  0.15 CaO  39.11 Al2O3 55.1 SiO2  2.08 TiO2  1.02 Fe2O3  0.09 P2O5  0.03 SO3\r\n IMC: (Hawthorne Bond)(no LOI listed)\r\n % 0.24 Na2O  1.24 K2O  0.85 MgO  0.15 CaO  39.11 Al2O3 55.1 SiO2  2.08 TiO2  1.02 Fe2O3  0.90 P2O5',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:11:35',NULL),
	(12273,273,NULL,'Hazel ash','Hazel ash',NULL,NULL,'Hazel ash supplies several oxides, especially K2O and CaO.\n Analyses:\n Hamer & Hamer:\n % 10 Na2O  35 K2O  15 MgO  26 CaO\n 10 SiO2  4 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:27:54',NULL),
	(12274,274,NULL,'Helmer Kaolin','Helmer Kaolin, Helmar Kaolin','Helmer Kaolin',NULL,'Helmar kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and\n small amounts of several fluxes.\n Good flashing slip in salt/soda.\n Analyses:\n Cushing: (adds to 86% - no LOI)\n % 0.08 Na2O  0.53 K2O  0.26 MgO  0.48 CaO  35.4 Al2O3\n 46.7 SiO2  1.13 TiO2  1.3 Fe2O3\n IMC:\n % 0.08 Na2O  0.53 K2O  0.26 MgO  0.48 CaO  35.4 Al2O3\n 45.2 SiO2  1.13 TiO2  1.3 Fe2O3  13.90 LOI\n IMC: (Helmer kaolin - mined in Idaho)\n % 0.08 Na2O  0.53 K2O  0.26 MgO  0.48 CaO  36.0 Al2O3\n 46.0 SiO2  1.13 TiO2  1.3 Fe2O3  13.22 LOI\n ALS Chemex, 994 Glendale Ave., Unit 3 Sparks  ,   NV  89431 USA Cost= $20.00 for lab fee plus $25.00 per sample. I sent them four samples of Helmer selected at random and the results are below:\n SiO2=47.19      Al2O3=32.24          BaO=0.04        CaO=0.16\n Cr2O3=<0.01        Fe2O3=1.19     K2O=0.40          MgO=0.13        MnO=0.03\n Na2O=0.01        P2O5=0.04        SrO=<0.01        TiO2=1.40\n LOI=14.93          total=99.76\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:28:06',NULL),
	(12275,275,NULL,'Ilmenite','Ilmenite','Ilmenite',NULL,'Ilmenite supplies Fe2O3 and TiO2.\n A natural source of titanium and iron, available in either\n powdered or granular form. Powdered ilmenite may be used as a\n colorant in glazes, and to seed crystals in titania glazes.\n Granular ilmenite is sometimes used in small amounts (<1%) to\n color/speckle clay bodies.\n Analyses:\n Hopper:\n FeO TiO2\n Cooper & Royle:\n FeO TiO2\n Chappell:\n Fe2O3 TiO2\n Cushing:\n FeO TiO2\n IMC:\n % 49.41 TiO2  50.59 FeO\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:31:31',NULL),
	(12276,276,NULL,'Imacco 800','Imacco 800','Imco 800',NULL,'Imacco 800 supplies SiO2, Al2O3, and Fe2O3.\n High-iron clay from Industrial Minerals. Mentioned in Jim\n Robinson\'s Shino article in Studio Potter (Dec. 1992).\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:31:47',NULL),
	(12277,277,NULL,'Imco Borate','Imco Borate','IMCO Borate',NULL,'Imco borate supplies B2O3, CaO, other fluxes, SiO2,\n and Al2O3.\n Gerstley Borate replacement.\n Analyses:\n Axner: (Web site, 2001)\n % 3.4 Na2O  1.5 K2O  25.7 CaO  3.4 MgO  32.2 B2O3\n 7.6 Al2O3  25.8 SiO2  0.4 Fe2O3  19.0 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:32:30',NULL),
	(12278,278,NULL,'Iron carbonate','Iron carbonate',NULL,NULL,'Iron carbonate supplies Fe2O3.\n Occurs naturally as the mineral Siderite (Chalybite).\n Analyses:\n Parmelee:\n FeCO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:00:09',NULL),
	(12279,279,NULL,'Iron chloride','Iron chloride',NULL,NULL,'Iron chloride supplies Fe2O3.\n Analyses:\n Parmelee:\n FeCl3  6 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:01:14',NULL),
	(12280,280,NULL,'Iron chromate','Iron chromate','Iron Chromate',NULL,'Iron chromate supplies Fe2O3 and Cr2O3.\n An iron-chromium compound, prepared from chromium iron ore\n (FeCr2O4). Used to color glazes gray, brown, or black (but can\n also be used to produce greens and pinks).\n Analyses:\n Hopper:\n FeCrO4\n Rhodes:\n FeCrO4\n Chappell:\n FeCrO4\n Cushing:\n FeCrO4\n Hamer:\n FeCrO3\n IMC: (formulas contradict one another)\n % 51.28 Fe2O3  48.72 Cr2O3\n Fe2O3  Cr2O3\n FeCrO4\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:01:59',NULL),
	(12281,281,NULL,'Iron oxide','Iron oxide',NULL,NULL,'Iron oxide supplies Fe2O3.\n Generic iron oxide listed in some glazes. Map to a specific type.\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:33:27',NULL),
	(12282,282,NULL,'Iron spangles','Iron spangles',NULL,NULL,'Iron spangles supplies Fe2O3.\n Concentrated, large-grained source of iron, used to produce\n iron specks in clays and glazes. Created by hammering hot iron.\n Analyses:\n Hopper:\n Fe3O4\n Memmott:\n Fe3O4\n Hamer:\n Fe3O4\n IMC:\n % 66.17 Fe2O3  33.83 FeO\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:03:02',NULL),
	(12283,283,NULL,'Iron sulfate','Iron sulfate, Ferrous sulfate','Iron Sulfate',NULL,'Iron sulfate supplies Fe2O3.\n Soluble source of iron.\n Analyses:\n Hopper:\n FeSO4 7H2O\n Parmelee:\n FeSO4 7H2O (Ferrous sulfate)\n Fe2(SO4)3  (Ferric sulfate)\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:04:14',NULL),
	(12284,284,12058,'Jackson Ball Clay','Jackson Ball Clay','Jackson Ball Clay',NULL,'Jackson ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n Fine-grained, plastic ball clay; high in alumina.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.1 Na2O  0.3 K2O  0.3 MgO  0.4 CaO  30.1 Al2O3\r\n 54.4 SiO2  1.6 TiO2  0.9 Fe2O3  11.9 LOI\r\n IMC:\r\n % 0.10 Na2O  0.30 K2O  0.30 MgO  0.40 CaO  29.50 Al2O3\r\n 54.90 SiO2  1.70 TiO2  1.00 Fe2O3  11.80 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:27:07',NULL),
	(12285,285,12144,'Jordan Fire Clay','Jordan Fire Clay','Jordan Fireclay',NULL,'Jordan clay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes.\r\n Stoneware/fire clay from Poplar, MD; no longer available. (The land was sold to real estate developers; you may be able to buy a house there...)\r\n Substitute Goldart [Cushing].\r\n Analyses:\r\n Obstler:\r\n % 0.04 Na2O  2.21 K2O  0.61 MgO  0.05 CaO  19.68 Al2O3 68.07 SiO2  1.11 TiO2  1.90 Fe2O3  6.19 LOI\r\n Chappell:\r\n % 0.23 Na2O  2.0 K2O  0.52 MgO  0.16 CaO  20.23 Al2O3 61.19 SiO2  1.18 TiO2  1.73 Fe2O3  6.89 LOI\r\n Tichane (CB):\r\n % 0.2 Na2O  2.0 K2O  0.5 MgO  0.2 CaO  20.2 Al2O3 67.2 SiO2  1.2 TiO2  1.7 Fe2O3  6.9 LOI\r\n IMC:\r\n % 0.20 Na2O  1.99 K2O  0.50 MgO  0.20 CaO  20.18 Al2O3 67.23 SiO2  1.20 TiO2  1.71 Fe2O3  6.78 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:08:41',NULL),
	(12286,286,12058,'K&T Special Ball Clay','K&T Special Ball Clay','K&T Special',NULL,'K&T Special supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n IMC:\r\n % 0.20 Na2O  0.90 K2O  0.50 MgO  0.30 CaO  27.40 Al2O3\r\n 53.30 SiO2  1.50 TiO2  1.10 Fe2O3  14.80 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:27:27',NULL),
	(12287,287,NULL,'K-200 Feldspar','K-200 Feldspar','K-200 Feldspar',NULL,'K-200 feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\n Commonly used potash feldspar; very high potassium.\n Manufactured by KMG Minerals; comes from Kings Mountain, NC.\n Primarily feldspar, some free quartz and traces of iron and\n magnesium.\n Analyses:\n Obstler: (KMG Minerals 1989)\n % 3.60 Na2O  10.10 K2O  0.14 CaO  18.00 Al2O3\n 67.70 SiO2  0.07 Fe2O3\n Cooper & Royle: (appendix 8)\n % 1.50 Na2O  13.00 K2O  0.20 CaO  18.30 Al2O3\n 66.00 SiO2  0.07 Fe2O3  0.26 LOI\n Cushing:\n 0.12 Na2O  0.88 K2O  1.13 Al2O3  6.94 SiO2\n Tichane (CB):\n % 1.5 Na2O  13.0 K2O  0.2 CaO  18.3 Al2O3\n 66.8 SiO2  0.1 Fe2O3  0.3 LOI\n IMC:\n % 3.36 Na2O  10.13 K2O  0.18 CaO  17.84 Al2O3\n 67.99 SiO2  0.08 Fe2O3  0.31 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:35:34',NULL),
	(12288,288,NULL,'Kaolin (Theoretical)','Kaolin, China Clay (Theoretical)',NULL,NULL,'Kaolin supplies SiO2 and Al2O3.\r\n [Generic kaolin; theoretical formula Al2O3 2SiO2 2H2O. Map to a\r\n particular kind of kaolin, or use theoretical formula.]\r\n Kaolins are clay minerals, formed by the decomposition of\r\n feldspathic rocks. Primary kaolins are found at or near the\r\n location of the parent rock; secondary kaolins have been\r\n transported by water and deposited elsewhere. Kaolins are fairly\r\n pure, and have a relatively large grain size and low plasticity\r\n relative to some other types of clay (especially ball clays).\r\n Kaolin is used in glazes to provide alumina and silica and to\r\n help suspend the non-clay particles.\r\n Analyses:\r\n Cuff: (syn. China Clay)\r\n Al2O3  2 SiO2  2 H2O\r\n Chappell:\r\n Al2O3  2 SiO2  2 H2O\r\n Memmott: (syn. China Clay)\r\n Al2O3  2 SiO2  2 H2O\r\n Parmelee:\r\n Al2O3  2 SiO2  2 H2O\r\n Tichane (TCB): (N. Carolina kaolin)\r\n % 0.2 Na2O  0.9 K2O  37.5 Al2O3\r\n 46.1 SiO2  0.08 Fe2O3  14.1 LOI\r\n IMC:\r\n % 40.21 Al2O3  47.29 SiO2  12.50 LOI',13,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:53:03',NULL),
	(12290,290,12288,'Diamond Kaolin','Diamond Kaolin','Diamond Kaolin',NULL,'Diamond kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and\r\n small amounts of several fluxes.\r\n A secondary kaolin with intermediate particle size distribution.\r\n Manufactured by the Kentucky-Tennessee Clay Company.\r\n Analyses:\r\n Cushing: (adds to 86% - forgot LOI)\r\n % 0.08 Na2O  0.18 K2O  0.1 MgO  0.15 CaO  37.9 Al2O3\r\n 45.6 SiO2  1.4 TiO2  0.7 Fe2O3\r\n IMC:\r\n % 0.08 Na2O  0.18 K2O  0.10 MgO  0.15 CaO  37.90 Al2O3\r\n 45.60 SiO2  1.40 TiO2  0.70 Fe2O3  13.50 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:09:47',NULL),
	(12291,291,12288,'Georgia Kaolin','Georgia Kaolin',NULL,NULL,'Georgia Kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. [Kaolin from Georgia; map to #6 Tile or Pioneer, or use a generic formula (below). Typical density 94.6 g/c]\r\n Analyses:\r\n Cooper & Royle: (Appendix 8)\r\n % 0.02 Na2O  0.04 K2O  0.30 MgO  0.26 CaO\r\n 38.02 Al2O3 45.20 SiO2  1.95 TiO2\r\n 0.49 Fe2O3  13.51 LOI\r\n Chappell:\r\n % 0.2 Na2O  0.2 K2O  0.1 MgO  0.1 CaO  38.9 Al2O3\r\n 49.9 SiO2  1.3 TiO2  0.4 Fe2O3  14.21 LOI\r\n Tichane (TCB):\r\n % 0.3 CaO  0.3 MgO  38.0 Al2O3\r\n 45.2 SiO2  1.95 TiO2  0.49 Fe2O3  13.5 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:10:44',NULL),
	(12292,292,12288,'Kaopaque 20 Kaolin','Kaopaque 20 Kaolin','Kaopaque 20 Kaolin',NULL,'Kaopaque supplies SiO2, Al2O3, TiO2, Fe2O3, and\r\n small amounts of several fluxes.\r\n Very white, non-plastic kaolin from Georgia, used in porcelain\r\n casting slips.\r\n Analyses:\r\n Cushing: (adds to 88%)\r\n % 0.03 Na2O  0.08 K2O  0.03 MgO  0.21 CaO  39.3 Al2O3\r\n 45.2 SiO2  0.66 TiO2  0.32 Fe2O3  2.0 LOI\r\n IMC:\r\n % 0.03 Na2O  0.08 K2O  0.03 MgO  0.21 CaO  39.30 Al2O3\r\n 45.20 SiO2  0.66 TiO2  0.32 Fe2O3  12.00 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:11:30',NULL),
	(12293,293,12058,'Kentucky #1 Ball Clay','Kentucky #1 Ball Clay, Kentucky No. 1',NULL,NULL,'Kentucky #1 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.4 Na2O  0.8 K2O  0.4 MgO  0.1 CaO  29.6 Al2O3\r\n 58.5 SiO2  1.0 TiO2  1.2 Fe2O3  9.8 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:29:12',NULL),
	(12294,294,12058,'Kentucky #12 Ball Clay','Kentucky #12 Ball Clay','Kentucky #12',NULL,'Kentucky #12 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  1.0 K2O  0.3 MgO  0.4 CaO  28.0 Al2O3\r\n 51.3 SiO2  1.7 TiO2  0.9 Fe2O3  16.3 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 14:55:33',NULL),
	(12296,296,12058,'Kentucky #6','Kentucky #6','Kentucky #6',NULL,'Kentucky #6 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.9 K2O  0.1 MgO  27.9 Al2O3\r\n 58.4 SiO2  1.2 TiO2  0.8 Fe2O3  10.0 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:33:23',NULL),
	(12297,297,12058,'Kentucky ball clay','Kentucky ball clay',NULL,NULL,'Kentucky ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Generic Kentucky ball clay; map to your favorite.',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:27:58',NULL),
	(12298,298,12058,'Kentucky OM #4 Ball Clay','Kentucky OM #4 Ball Clay, OM-4, OM4, Old Mine 4',NULL,NULL,'Kentucky OM #4 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. OM #4 is a fine-grained ball clay with good plasticity and strength. It is very common in glaze recipes. It undergoes a sudden color shift around cone 8-9, from straw yellow to solid gray [IMC]. Contains 67% kaolinite, 19% free quartz, 7% feldspar, and 3% organic material. Manufactured by the Kentucky-Tennessee Clay Company; comes from western Kentucky.\r\n Analyses:\r\n Obstler: (Kentucky-Tennessee Clay Co., 1988)\r\n % 0.3 Na2O  1.0 K2O  0.4 MgO  0.3 CaO  27.9 Al2O3 55.2 SiO2  1.2 TiO2  1.1 Fe2O3  12.6 LOI\r\n Cooper & Royle: (Appendix 8)\r\n % 0.3 Na2O  1.0 K2O  0.3 MgO  0.4 CaO  31.2 Al2O3 52.1 SiO2  1.6 TiO2  0.8 Fe2O3  12.4 LOI\r\n Chappell:\r\n % 0.3 Na2O  1.0 K2O  0.3 MgO  0.4 CaO  31.2 Al2O3 52.1 SiO2  1.6 TiO2  0.8 Fe2O3  12.4 LOI\r\n Cushing:\r\n % 0.3 Na2O  1.0 K2O  0.3 MgO  0.4 CaO  30.8 Al2O3 53.0 SiO2  1.6 TiO2  0.8 Fe2O3  11.9 LOI\r\n Tichane (TCB, CB):\r\n % 0.3 Na2O  1.0 K2O  0.4 CaO  0.3 MgO  31.2 Al2O3 52.1 SiO2  1.6 TiO2  0.8 Fe2O3  12.4 LOI\r\n IMC:\r\n % 0.3 Na2O  1.0 K2O  0.4 MgO  0.3 CaO  27.9 Al2O3 55.2 SiO2  1.2 TiO2  1.1 Fe2O3  12.6 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:35:01',NULL),
	(12299,299,12058,'Kentucky Special Ball Clay','Kentucky Special Ball Clay',NULL,NULL,'Kentucky Special supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.1 K2O  0.4 MgO  0.4 CaO  29.0 Al2O3\r\n 48.8 SiO2  1.5 TiO2  0.9 Fe2O3  17.8 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:36:03',NULL),
	(12300,300,12058,'Kentucky Stone','Kentucky Stone',NULL,NULL,'Kentucky Stone supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.  A highly plastic, fine-grained (IMC: coarse-grained), quartz-rich stoneware/ball clay, used in stoneware clay bodies. May substitute for Jordan clay, with the addition of some feldspar and/or flint. Contains 48% kaolinite, 39% quartz, 10% feldspar, and 1% organic matter.  Manufactured by Kentucky-Tennessee Clay Co.; comes from Mayfield, KY.\r\n Analyses:\r\n Obstler (K-T Clay Co.):\r\n % 0.2 Na2O  1.3 K2O  0.3 MgO  0.4 CaO  20.7 Al2O3 67.1 SiO2  1.11 TiO2  1.4 Fe2O3  7.5 LOI\r\n Cushing:\r\n % 0.2 Na2O  1.3 K2O  0.3 MgO  0.4 CaO  20.7 Al2O3 67.1 SiO2  1.1 TiO2  1.4 Fe2O3  7.5 LOI\r\n IMC:\r\n % 0.1 Na2O  1.3 K2O  0.5 MgO  0.3 CaO  20.8 Al2O3 67.2 SiO2  1.4 TiO2  1.3 Fe2O3  7.1 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:37:18',NULL),
	(12301,301,12371,'Keystone feldspar','Keystone feldspar','Keystone feldspar',NULL,'Keystone feldspar supplies SiO2, Al2O3, K2O, and Na2O.\r\n Potash feldspar.\r\n Analyses:\r\n Chappell:\r\n (See Custer)\r\n Cooper & Royle: (appendix 8)\r\n % 2.48 Na2O  12.24 K2O  0.17 CaO  19.94 Al2O3\r\n 64.76 SiO2  0.04 Fe2O3  0.35 LOI\r\n Speight:\r\n (refers to Custer)\r\n Tichane (CB):\r\n % 2.5 Na2O  12.2 K2O  0.2 CaO  19.9 Al2O3\r\n 64.8 SiO2  0.4 LOI\r\n IMC:\r\n % 2.19 Na2O  13.34 K2O  19.86 Al2O3  64.61 SiO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:44:46',NULL),
	(12302,302,NULL,'Kingman Feldspar','Kingman Feldspar','Kingman Feldspar',NULL,'Kingman feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3.\n High potassium potash feldspar.\n Analyses:\n Cooper & Royle: (appendix 8)\n % 2.7 Na2O  12.0 K2O  0.1 CaO  18.4 Al2O3\n 66.5 SiO2  0.08 Fe2O3  0.2 LOI\n Chappell: (slight difference from C&R)\n % 2.8 Na2O  12.0 K2O  0.1 CaO  18.7 Al2O3\n 66.0 SiO2  0.1 Fe2O3  0.2 LOI\n Cushing:\n 0.26 Na2O  0.74 K2O  1.04 Al2O3  6.40 SiO2\n Tichane (CB):\n % 2.7 Na2O  12.0 K2O  0.1 CaO  18.4 Al2O3\n 66.5 SiO2  0.1 Fe2O3  0.2 LOI\n IMC:\n % 2.80 Na2O  12.01 K2O  0.10 CaO  18.72 Al2O3\n 66.18 SiO2  0.11 Fe2O3  0.08 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:39:26',NULL),
	(12303,303,12288,'Kingsley kaolin','Kingsley kaolin','Kingsley kaolin',NULL,'Kingsley kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n A coarse white-firing kaolin.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.3 Na2O  0.1 K2O  0.2 MgO  0.1 CaO  38.5 Al2O3\r\n 45.1 SiO2  1.6 TiO2  0.4 Fe2O3  13.9 LOI\r\n IMC:\r\n % 0.11 Na2O  0.14 K2O  0.04 MgO  0.90 CaO  38.40 Al2O3\r\n 44.80 SiO2  1.64 TiO2  0.39 Fe2O3  13.60 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:12:42',NULL),
	(12304,304,12371,'Kona A-3 Feldspar','Kona A-3 Feldspar','A-3 Feldspar',NULL,'Kona A-3 feldspar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3. Potash feldspar.\r\n Analyses:\r\n Cooper & Royle: (appendix 8)\r\n % 3.7 Na2O  7.8 K2O  0.4 CaO  16.3 Al2O3 71.6 SiO2  0.07 Fe2O3  0.1 LOI\r\n Chappell: (Na,K inverted from C&R)\r\n % 7.8 Na2O  3.7 K2O  0.4 CaO  16.3 Al2O3 71.6 SiO2  0.07 Fe2O3  0.1 LOI\r\n Tichane (TCB):\r\n % 3.7 Na2O  7.8 K2O  0.4 CaO  16.3 Al2O3 71.6 SiO2  0.07 Fe2O3  0.1 LOI\r\n Tichane (CB):\r\n % 3.7 Na2O  7.8 K2O  0.4 CaO  16.3 Al2O3 71.6 SiO2  0.1 Fe2O3  0.1 LOI\r\n IMC:\r\n % 4.00 Na2O  7.51 K2O  0.40 CaO  16.30 Al2O3 71.63 SiO2  0.07 Fe2O3  0.09 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:40:14',NULL),
	(12305,305,12407,'Kona F-4 feldspar','Kona F-4 feldspar, Kona F4',NULL,NULL,'Kona F-4 feldspar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3. Commonly used soda feldspar; used in porcelains because of its low iron content. Manufactured by Unimin Corporation; comes from Spruce Pine, NC. Primarily feldspar, some free quartz and traces of iron and magnesium.\r\n Analyses:\r\n Obstler: (Unimin Corp. 1991)\r\n % 6.80 Na2O  5.00 K2O  1.50 CaO  19.60 Al2O3 68.85 SiO2  0.05 Fe2O3  0.20 LOI\r\n Cooper & Royle: (appendix 8)\r\n % 7.0 Na2O  4.5 K2O  1.8 CaO  19.7 Al2O3 66.8 SiO2  0.04 Fe2O3  0.2 LOI\r\n Rhodes:\r\n 0.48 Na2O  0.32 K2O  0.20 CaO  1.02 Al2O3  5.60 SiO2\r\n Chappell:\r\n % 4.5 Na2O  7.0 K2O  1.8 CaO  19.7 Al2O3 66.8 SiO2  0.04 Fe2O3  0.2 LOI\r\n Cushing:\r\n 0.48 Na2O  0.32 K2O  0.20 CaO  1.02 Al2O3  5.60 SiO2\r\n Tichane (CB):\r\n % 7.0 Na2O  4.5 K2O  1.8 CaO  19.7 Al2O3\r\n 66.8 SiO2  0.2 LOI\r\n IMC:\r\n % 6.90 Na2O  4.8 K2O  0.05 MgO  1.70 CaO  19.60 Al2O3 66.80 SiO2  0.04 Fe2O3  0.20 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2016-03-22 11:01:27',NULL),
	(12306,306,NULL,'Kyanite','Kyanite','Kyanite',NULL,'Kyanite supplies SiO2 and Al2O3.\n Refractory material with high resistance to thermal shock. Used\n as a grog in porcelain, tile clay, and casting slip. Reduces\n shrinkage and increases strength.\n Analyses:\n Tichane (CB): (same analysis given for Mullite)\n % 0.2 Na2O  0.2 K2O  40.0 Al2O3  57.0 SiO2  0.7 TiO2  1.0 Fe2O3\n IMC:\n % 62.92 Al2O3  37.08 SiO2\n Klein & Hurlbut:\n Al2SiO5\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:42:42',NULL),
	(12307,307,12252,'Laguna Borate','Laguna Borate','Laguna Borate',NULL,'Laguna borate supplies B2O3, CaO, other fluxes, SiO2, and Al2O3. Gerstley Borate replacement from Laguna.\r\n Analyses:\r\n Axner: (Web site, 2001)\r\n % 4.0 Na2O3  1.4 K2O  18.9 CaO  2.3 MgO  27.5 B2O3 0.1 TiO2  8.1 Al2O3  18.7 SiO2  0.1 Fe2O3  19.0 LOI',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:19:54',NULL),
	(12308,308,NULL,'Lead antimonate','Lead antimonate','Lead Antimonate',NULL,'Lead antimonate supplies PbO and Sb2O3.\n A creamish yellow pigment used to introduce antimony into lead\n glazes. 5% gives bright yellow.\n Sb2O5 becomes Sb2O3 and dissolves when the lead silicate fuses.\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:05:19',NULL),
	(12309,309,NULL,'Lead Bisilicate Frit','Lead Bisilicate Frit','Lead Bisilicate Frit',NULL,'Lead bisilicate supplies SiO2 and PbO.\n Used to lengthen the firing range and smooth glaze surfaces\n from approximately c/010 to c/6. Starts to fuse at approximately\n 700C, completes fusion by 900C.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:40:56',NULL),
	(12310,310,NULL,'Lead chloride','Lead chloride',NULL,NULL,'Lead chloride supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:06:01',NULL),
	(12311,311,NULL,'Lead chromate','Lead chromate','Lead Chromate',NULL,'Lead chromate supplies PbO and Cr2O3.\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:06:43',NULL),
	(12312,312,NULL,'Lead dioxide','Lead dioxide',NULL,NULL,'Lead dioxide supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:07:41',NULL),
	(12313,313,NULL,'Lead monosilicate','Lead monosilicate','Lead Monosilicate Frit',NULL,'Lead monosilicate supplies SiO2 and PbO.\n Starts to fuse at approximately 700C, completes fusion by 800C.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:11:26',NULL),
	(12314,314,NULL,'Lead orthosilicate','Lead orthosilicate','Lead Orthosilicate and Lead Metasilicate Eutectic',NULL,'Lead orthosilicate supplies SiO2 and PbO.\n Very high lead solubility; not usually available.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12315,315,NULL,'Lead sesquisilicate','Lead sesquisilicate','Lead Sesquisilicate Frit',NULL,'Lead sesquisilicate supplies SiO2 and PbO.\n Slightly softer and contains more lead than lead bisilicate.\n Starts to fuse at approximately 700C, completes fusion by 850C.\n Favors yellows and reds with antimony and iron at temperatures\n below 1000C, but is more volatile than lead bisilicate above\n 1100C.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:42:27',NULL),
	(12316,316,NULL,'Lead sulfate','Lead sulfate',NULL,NULL,'Lead sulfate supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:12:21',NULL),
	(12317,317,NULL,'Lead trioxide','Lead trioxide',NULL,NULL,'Lead trioxide supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:13:00',NULL),
	(12319,319,NULL,'Lepidolite','Lepidolite','Lepidolite',NULL,'Lepidolite supplies SiO2, Al2O3, K2O, Rb2O, Li2O, Na2O, and Fe2O3.\n A lithium mica, similar in function and composition to a\n feldspar. Theoretical formula K2O Li2O 2Al2O3 6SiO2 2H2O (4.1%\n Li2O by weight); generally also contains rubidium, sodium, iron,\n and fluorine.\n Lepidolite, although not in short supply geologically, is not\n currently available to potters.\n Analyses:\n Obstler: (Ceramic Industry 1993, 82)\n % 1.0 Na2O  9.0 K2O+Rb2O  4.0 Li2O  25.0 Al2O3  55.0 SiO2\n 0.08 Fe2O3  5.0 F\n Hopper:\n (LiNaK)2 (FOH)2 Al2O3 3SiO2\n Green:\n 0.94 KNaO  0.04 MgO  0.04 CaO  1.0 Li2O  1.84 Al2O3  6.26 SiO2\n 0.02 FeO  0.01 Fe2O3  1.5 F\n Cooper & Royle:\n (LiK)2 (FOH)2 Al2O3 3SiO2\n Cuff:\n Li2F2  Al2O3  3 SiO2\n Chappell: (way off)\n (LiNaK)2 (FeH)2\n Cushing:\n 0.06 Na2O  0.41 K2O  0.53 Li2O  0.98 Al2O3  3.28 SiO2\n Memmott:\n 2 LiO  K2O  2 Al2O3  6 SiO2   or...\n LiF  KF  Al2O3  3 SiO2\n Parmelee:\n % 0.13 Na2O  10.33 K2O  4.65 Li2O  0.92 CaO  0.31 MgO\n 26.77 Al2O3  52.89 SiO2  0.19 Fe2O3  0.59 F  0.66 LOI\n IMC:\n % 0.76 Na2O  6.93 K2O  3.09 Li2O  19.25 Al2O3\n 42.40 SiO2  0.06 Fe2O3  27.50 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:46:39',NULL),
	(12320,320,NULL,'Lime feldspar','Lime feldspar - theoretical',NULL,NULL,'Theoretical pure lime feldspar (the mineral Anorthite).\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:45:55',NULL),
	(12321,321,NULL,'Limestone','Limestone','Limestone',NULL,'The term limestone might refer to either whiting (calcium\n carbonate) or dolomite. Technically, limestone refers to\n whiting and dolomitic limestone or dolostone to dolomite, \n but the distinction is often blurred by potters and suppliers -\n in many studios, whiting is calcium carbonate and limestone\n is dolomite. Similarly, the term whiting is also sometimes\n misused, although in glaze recipes it generally means CaCO3.\n Marble is metamorphosed limestone with a fine-grained\n structure.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:45:48',NULL),
	(12322,322,NULL,'Litharge','Litharge','Litharge',NULL,'Litharge supplies PbO.\n Yellowish-red.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:13:55',NULL),
	(12323,323,NULL,'Lithium Carbonate','Lithium Carbonate','Lithium Carbonate',NULL,'Lithium carbonate supplies Li2O.\n Relatively pure source of lithium in glazes. Theoretical formula\n Li2CO3 (40.4% Li2O); most supplies are over 99% pure.\n Manufactured in the U.S. by Cyprus Specialty Metals (Foote\n Mineral Company) and by Lithium Corporation of America. Cyprus\'\n lithium carbonate comes from deposits created by solar evaporation\n of brackish pond waters containing high concentrations of lithium\n salts; these deposits are mined in Silver Peak, NV, and also exist\n in other locations in the West. Lithium Corp. creates lithium\n carbonate by processing spodumene (Bessemer City, NC).\n Slightly soluble in water; solubility decreases with rising\n temperature [Parmelee].\n Analyses:\n Obstler: (Technical Grade, Cyprus, 1988)\n % 99.2 Li2CO3  0.11 Na  0.033 K  0.006 Mg  0.05 Ca\n 0.02 Cl  0.11 SO4  0.001 Fe2O3  0.02 H2O\n Hopper: (incorrect)\n LiCO3\n Rhodes:\n Li2CO3\n Cuff:\n Li2CO3\n Chappell:\n Li2CO3\n Cushing:\n Li2CO3\n Memmott:\n Li2CO3\n Parmelee:\n Li2CO3\n IMC:\n % 40.74 Li2O  59.26 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:44:39',NULL),
	(12324,324,NULL,'Lithospar','Lithospar','Lithospar',NULL,'Lithospar supplies SiO2, Al2O3, Li2O, Na2O, and K2O.\n Lithium feldspar. Not really sure what mineral(s).\n Analyses:\n Cushing:\n 0.38 Na2O  0.18 K2O  0.39 Li2O  1.24 Al2O3  6.73 SiO2\n IMC:\n % 4.04 Na2O  2.91 K2O  2.00 Li2O  21.69 Al2O3  69.36 SiO2\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:44:58',NULL),
	(12325,325,NULL,'Lizella Red','Lizella Red','Lizella Clay',NULL,'Lizella Red supplies SiO2, Al2O3, TiO2, Fe2O3, and small\n amounts of several fluxes.\n Plastic earthenware clay, good for throwing. From Burns\n Brick Co in GA. Similar to Ochmulgee, but finer-grained.\n Analyses:\n Cushing:\n % 0.85 Na2O  1.4 K2O  0.78 MgO  0.7 CaO  19.6 Al2O3\n 63.7 SiO2  1 TiO2  3.6 Fe2O3  8.5 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:49:38',NULL),
	(12326,326,12288,'Lunday kaolin','Lunday kaolin','Lunday kaolin',NULL,'Lunday kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.3 Na2O  1.3 K2O  36.3 Al2O3\r\n 47.3 SiO2  0.1 TiO2  1.0 Fe2O3  13.6 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:13:22',NULL),
	(12327,327,12058,'M&D Ball Clay','M&D Ball Clay','M&D Ball Clay',NULL,'M&D ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Montmorillonite-bearing ball clay; very fine-grained and plastic. Considered the strongest ball clay available today.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.3 Na2O  0.5 K2O  0.2 MgO  0.6 CaO  27.8 Al2O3 57.1 SiO2  1.3 TiO2  2.3 Fe2O3  9.8 LOI\r\n IMC:\r\n % 0.5 K2O  0.5 MgO  0.5 CaO  27.33 Al2O3 57.46 SiO2  1.31 TiO2  2.32 Fe2O3  10.09 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:38:05',NULL),
	(12329,329,12593,'Macaloid','Macaloid',NULL,NULL,'Macaloid supplies SiO2, Al2O3, MgO, CaO, Na2O, Li2O, and Fe2O3. A high-magnesium montmorillonite clay, similar in function to bentonite, but with double the plasticity. Consists of 90% hectorite. Should be thoroughly mixed with warm water before adding to clay or glaze. Often used in combination with CMC.\r\nTheoretical formula of hectorite: (Mg,Li)3 Si4O10 (OH)2 (Na)0.3 (H2O)4 \r\nVeegum is a very similar material, produced by Vanderbilt. Different grades are available, the most popular for potters being Veegum T. Veegum CER is a mixture of Veegum T and CMC.\r\n Analyses:\r\n Obstler: (Cushing 1986 / TAM 1969) (adds to 87.9%)\r\n % 3.08 Na2O  22.07 MgO  6.46 CaO  1.21 Li2O  0.77 Al2O3 51.89 SiO2  0.32 Fe2O3  2.07 F\r\n Cushing:\r\n % 3.08 Na2O  22.07 MgO  6.46 CaO  1.21 Li2O  0.77 Al2O3 51.89 SiO2  0.32 Fe2O3  2.07 F  11.7 LOI\r\n Tichane (CB): (Veegum)\r\n % 1.7 Na2O  0.1 K2O  23.8 MgO  4.5 CaO  1 Al2O3 54 SiO2  0.2 Fe2O3  11.8 LOI\r\n IMC:\r\n % 3.1 Na2O  1.2 Li2O  22.1 MgO  6.5 CaO  0.8 Al2O3 51.9 SiO2  0.3 Fe2O3  11.7 LOI  2.1 F',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-25 15:29:12',NULL),
	(12330,330,12371,'Madoc H spar','Madoc H spar','Madoc Feldspar',NULL,'Madoc H spar supplies SiO2, Al2O3, K2O, Na2O, and CaO.\r\n Potash feldspar.\r\n Analyses:\r\n Cushing:\r\n 0.34 Na2O  0.61 K2O  0.05 CaO  1.04 Al2O3  6.40 SiO2\r\n IMC: (Madoc feldspar)\r\n % 3.59 Na2O  8.89 K2O  17.39 Al2O3  68.63 SiO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:45:21',NULL),
	(12331,331,NULL,'Magnesium carbonate','Magnesium carbonate, Magnesite','Magnesite',NULL,'Magnesium carbonate supplies MgO.\n Natural magnesium carbonate - the mineral Magnesite, MgCO3 - is\n formed by precipitation from sea water, or by hydrothermal\n alteration of dolomite. Light magnesium carbonate -\n Hydromagnesite, 3MgCO3 Mg(OH)2 3H2O - is produced by boiling\n magnesium sulfate and sodium carbonate. This latter form is the\n type generally used by potters. (The difference in MgO between\n the two is about 4% - Magnesite is 47.8% MgO, Hydromagnesite is\n 44.1% MgO.)\n Slightly soluble, and tends to flocculate the glaze.\n Analyses:\n Obstler: (Ceramic Industry 1993, 84)\n % 46.2 MgO  0.3 CaO  1.0 Fe2O3  0.5 SiO2  50.3 CO2\n Hopper:\n MgCO3  (Magnesite (calcined): MgO MgCO3)\n Rhodes:\n MgCO3\n Cuff:\n MgCO3 (Magnesite, Magnesium carbonate)\n 3 MgCO3  Mg(OH)2  3 H2O  (Magnesium carbonate light)\n Chappell:\n MgCO3\n Cushing:\n MgCO3\n Memmott: (Magnesite; Magnesium Carbonate)\n MgCO3\n Parmelee:\n MgCO3\n 3 MgO  Mg(OH)2  H2O  (light)(basic)\n IMC:\n % 43.00 MgO  0.50 CaO  0.25 SrO  0.15 Al2O3\n 0.04 Fe2O3  56.50 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:48:15',NULL),
	(12332,332,NULL,'Magnesium chloride','Magnesium chloride',NULL,NULL,'Magnesium chloride supplies MgO.\n Analyses:\n Parmelee:\n MgCl2  6 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:19:36',NULL),
	(12333,333,NULL,'Magnesium zirconium silicate','Magnesium zirconium silicate','Magnesium Zirconium Silicate',NULL,'Magnesium zirconium silicate supplies MgO, ZrO2, and SiO2.\n A zirconium opacifier containing some magnesium.\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:23:55',NULL),
	(12334,334,12371,'Maine feldspar','Maine feldspar','Maine feldspar',NULL,'Maine feldspar supplies SiO2, Al2O3, Na2O, and K2O.\r\n Analyses:\r\n Grebanier:\r\n 0.64 Na2O  0.36 K2O  1.18 Al2O3  8.8 SiO2\r\n IMC:\r\n % 2.83 Na2O  8.16 K2O  0.11 MgO  0.20 CaO  17.39 Al2O3\r\n 71.31 SiO2  0.50 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:39:06',NULL),
	(12335,335,NULL,'Manganese Carbonate','Manganese Carbonate','Manganese Carbonate',NULL,'Manganese carbonate supplies MnO.\n Used to create metallic, black, brown, or purple/plum glazes.\n Decomposes on heating to MnO2 and CO2; must be fired above\n 1080 C to break down the MnO2 to MnO.\n A source of manganese in glazes. Occurs naturally as the mineral\n Rhodochrosite.\n Analyses:\n Hopper:\n MnCO3\n Cooper & Royle:\n MnCO3\n Rhodes:\n MnCO3\n Cushing:\n MnCO3\n Parmelee:\n MnCO3\n IMC:\n % 61.62 MnO  38.39 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:50:54',NULL),
	(12336,336,NULL,'Manganese Dioxide','Manganese Dioxide','Manganese Dioxide',NULL,'Manganese dioxide supplies MnO.\n Most common source of manganese in glazes. Insoluble in water.\n Decomposes to MnO at 1080C. Prepared from the mineral Pyrolusite\n and from other ores.\n Below 1080C, produces blacks and purples, and is refractory.\n Above 1080C, becomes a flux and produces browns (purples if no\n alumina is present).\n Analyses:\n Hopper:\n MnO2\n Cooper & Royle:\n MnO2\n Rhodes:\n MnO2\n Cushing:\n MnO2\n Memmott:\n MnO2\n Parmelee:\n MnO2\n (also lists Manganese oxide (greenish) as MnO, \nManganese oxide (brownish-black) as Mn2O3, \n and Manganese oxide (red) as Mn3O4)\n IMC:\n % 81.49 MnO  18.52 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 04:52:36',NULL),
	(12337,337,NULL,'Meerschaum','Meerschaum',NULL,NULL,'Meerschaum provides SiO2 and MgO.\n According to Klein & Hurlbut, Sepiolite is a phyllosilicate of\n the Serpentine group. It is a hydrous magnesium silicate... a\n claylike, secondary mineral associated with serpentine... used\n in the manufacture of meerschaum pipes.\n Analyses:\n Klein & Hurlbut:\n Mg4(OH)2Si6O15 H2O 4H2O   (translates to 4MgO 6SiO2 6H2O)\n Cooper & Royle:\n 2 MgO  3 SiO2  2 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:52:22',NULL),
	(12338,338,NULL,'Mineral flux no. 4','Mineral flux no. 4',NULL,NULL,'Mineral flux no.4 supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3.\n Analyses:\n Cooper & Royle: (Harrison Mayer Ltd.)\n % 4.16 Na2O  2.2 K2O  1.64 CaO  11.12 Al2O3\n 80.18 SiO2  0.14 Fe2O3  0.23 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:52:31',NULL),
	(12339,339,12407,'Minpro #4 Feldspar','Minpro #4 Feldspar','Minpro #4 Feldspar',NULL,'Minpro #4 spar supplies SiO2, Al2O3, Na2O, K2O, and CaO. Soda feldspar, similar to Kona F-4.\r\n Analyses:\r\n Cushing:\r\n 0.55 Na2O  0.36 K2O  0.09 CaO  1.11 Al2O3  7.06 SiO2\r\n IMC:\r\n 5.59 Na2O  5.55 K2O  0.83 CaO  18.54 Al2O3  69.49 SiO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:41:30',NULL),
	(12340,340,12144,'Missouri Fire Clay','Missouri Fire Clay',NULL,NULL,'Missouri fire clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n [Generic Missouri fire clay. Map to a particular kind of Missouri fire clay - A.P. Green or Hawthorne Bond.]',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:09:55',NULL),
	(12341,341,NULL,'Molochite','Molochite',NULL,NULL,'Molochite supplies SiO2, Al2O3, TiO2, Fe2O3, and small quantities\n of several fluxes.\n Molochite is a calcined china clay product produced by ECC\n International; it is a refractory white grog containing mullite\n and amorphous silica glass (no crystalline silica). Produced\n by calcining china clay at 1500C.\n Analyses:\n Cooper & Royle: (Harrison Mayer Ltd.)\n % 0.10 Na2O  1.75 K2O  0.10 MgO  0.10 CaO\n 42.50 Al2O3  54.50 SiO2  0.08 TiO2  0.75 Fe2O3\n Hamer:\n Al2O3  2 SiO2\n IMC:\n % 0.10 Na2O  2.00 K2O  0.31 MgO  0.06 CaO\n 42.00 Al2O3  54.50 SiO2  0.07 TiO2  1.10 Fe2O3\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:55:37',NULL),
	(12342,342,NULL,'Molybdenum oxide','Molybdenum oxide','Molybdenum Trioxide',NULL,'Molybdenum oxide supplies MoO3.\n An uncommon colorant. Also significantly lowers surface tension\n of silicate melts, thus acting as a wetting agent. Slightly\n soluble in water.\n Analyses:\n Hopper:\n MoO3\n Parmelee:\n MoO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12343,343,12144,'Monmouth Fire Clay','Monmouth Fire Clay','Monmouth Fireclay',NULL,'Monmouth fire clay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes.\r\n Analyses:\r\n Chappell:\r\n % 0.01 Na2O  0.55 K2O  0.3 MgO  0.11 CaO  44.95 Al2O3 50.89 SiO2  0.84 TiO2  2.21 Fe2O3',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:12:24',NULL),
	(12344,344,NULL,'Monmouth stoneware clay','Monmouth stoneware clay','Monmouth Clay',NULL,'Monmouth stoneware clay supplies SiO2, Al2O3, Fe2O3, TiO2, and\n small amounts of several fluxes.\n Analyses:\n Chappell:\n % 0.3 Na2O  0.3 K2O  0.3 MgO  0.3 CaO  28.5 Al2O3\n 56.8 SiO2  12.2 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:58:03',NULL),
	(12345,345,NULL,'Mullite','Mullite','Mullite',NULL,'Mullite supplies SiO2 and Al2O3.\n Theoretical Mullite - a mineral with long interlocking crystals.\n Highly refractory. Named after the Isle of Mull in Scotland where\n it was discovered. Forms in clay bodies during firing and helps\n hold them together.\n Analyses:\n IMC:\n 3 Al2O3  2 SiO2\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:58:08',NULL),
	(12346,346,NULL,'Murrays Borate','Murrays Borate','Murrays Borate',NULL,'Murrays borate supplies B2O3, CaO, Na2O, SiO2, and Al2O3.\n Gerstley Borate replacement from Kickwheel Pottery Supply.\n Analyses:\n Axner: (Web site, 2001)\n % 6.0 Na2O  26.2 CaO  38.0 B2O3  0.5 Al2O3\n 29.2 SiO2  12.0 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:58:13',NULL),
	(12347,347,12144,'Narco fire clay','Narco fire clay','Narco Fireclay',NULL,'Narco fire clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Low plasticity, low shrinkage fire clay; good for sculpture bodies.\r\n Analyses:\r\n Cushing:\r\n % 0.3 Na2O  2.2 K2O  0.6 MgO  0.13 CaO  31.2 Al2O3 52.7 SiO2  1.75 TiO2  1.84 Fe2O3  9.58 LOI\r\n IMC:\r\n % 0.30 Na2O  2.20 K2O  0.60 MgO  0.13 CaO  31.20 Al2O3 52.70 SiO2  1.75 TiO2  1.84 Fe2O3  9.58 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:13:01',NULL),
	(12348,348,12407,'NC-4 Feldspar','NC-4 Feldspar','NC-4 Feldspar',NULL,'NC-4 feldspar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3. Commonly used soda feldspar.  Manufactured by Feldspar Corporation; comes from Spruce Pine, NC. Primarily feldspar, some free quartz and traces of iron and magnesium.\r\n Analyses:\r\n Feldspar Corp.: (2001)\r\n % 6.82 Na2O  4.10 K2O  1.40 CaO  18.85 Al2O3 68.15 SiO2  0.07 Fe2O3  0.09 LOI\r\n Obstler: (Feldspar Corp. 1993)\r\n % 6.80 Na2O  5.00 K2O  1.50 CaO  19.60 Al2O3 68.85 SiO2  0.05 Fe2O3  0.20 LOI\r\n Cushing: (NC #4)\r\n 0.63 Na2O  0.22 K2O  0.15 CaO  1.0 Al2O3  6.18 SiO2\r\n IMC:\r\n % 6.99 Na2O  4.02 K2O  0.05 MgO  1.45 CaO  18.76 Al2O3 68.37 SiO2  0.07 Fe2O3  0.09 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:42:21',NULL),
	(12349,349,NULL,'Nepheline Syenite (Theoretical)','Nepheline Syenite, Neph Sye (Theoretical)','Nepheline Syenite',NULL,'Nepheline syenite supplies SiO2, Al2O3, Na2O, K2O, CaO, MgO, and Fe2O3.\r\n Commonly used feldspathic rock. An excellent basis for glazes in the cone 4-6 range, also used in some cone 10 glazes. Manufactured by Unimin Corporation; comes from Nephton, Blue Mountain, Ontario, Canada. An igneous Precambrian feldspathic rock containing soda feldspar, potash feldspar, nepheline (K2O 3Na2O 4Al2O3 9SiO2), and small amounts of muscovite and iron minerals.\r\n Analyses:\r\n Obstler:\r\n % 10.6 Na2O  4.80 K2O  0.03 MgO  0.35 CaO  23.50 Al2O3 60.20 SiO2  0.08 Fe2O3  0.44 LOI\r\n Hopper:\r\n K2O  3Na2O  4Al2O3  8SiO2\r\n Cooper & Royle:\r\n K2O  3Na2O  4Al2O3  8SiO2\r\n Cooper & Royle: (appendix 8)\r\n % 10.6 Na2O  5.1 K2O  0.3 CaO  23.3 Al2O3\r\n 60.2 SiO2  0.077 Fe2O3  0.4 LOI\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.036)\r\n % 7.60 Na2O  8.30 K2O  1.51 CaO  23.84 Al2O3 57.62 SiO2  0.11 Fe2O3  0.99 LOI\r\n Cooper & Royle: (USA - pg. 66)\r\n % 4.6 Na2O  9.8 K2O  23.6 Al2O3 60.4 SiO2  0.7 other\r\n Cooper & Royle: (North Cape, Norway - pg. 66)\r\n % 8.1 Na2O  9.0 K2O  24.9 Al2O3\r\n 56.3 SiO2  1.7 other\r\n Rhodes:\r\n 0.75 Na2O  0.25 K2O  1.11 Al2O3  4.65 SiO2\r\n Cuff:\r\n 0.75 Na2O  0.25 K2O  Al2O3  2 SiO2\r\n Chappell:\r\n % 4.6 Na2O  9.8 K2O  0.1 MgO  0.7 CaO  23.6 Al2O3 60.4 SiO2  0.08 Fe2O3  0.7 LOI\r\n Cushing:\r\n 0.75 Na2O  0.25 K2O  1.11 Al2O3  4.65 SiO2\r\n Memmott:\r\n 3 Na2O  K2O  4 Al2O3  8 SiO2\r\n Tichane (AG):\r\n % 10.6 Na2O  5.1 K2O  0.3 CaO  23.3 Al2O3 60.3 SiO2  0.1 Fe2O3  0.4 LOI\r\n Tichane (CB):\r\n % 10.3 Na2O  4.7 K2O  0.1 MgO  0.6 CaO  23.2 Al2O3 60.4 SiO2  0.1 Fe2O3  0.7 LOI\r\n IMC:\r\n % 10.60 Na2O  4.80 K2O  0.03 MgO  0.35 CaO  23.50 Al2O3 60.20 SiO2  0.08 Fe2O3',20,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:53:43',NULL),
	(12350,350,NULL,'Newman Red Clay','Newman Red Clay','Newman Red Clay',NULL,'Neuman Red supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\n of several fluxes.\n A red clay.\n Analyses:\n IMC:\n % 1.40 Na2O  0.20 MgO  0.30 CaO  30.41 Al2O3\n 53.41 SiO2  1.61 Fe2O3  11.20 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:00:47',NULL),
	(12351,351,NULL,'Nickel Carbonate','Nickel Carbonate','Nickel Carbonate',NULL,'Nickel carbonate supplies NiO.\n Colorant used to produce blue, gray, green, brown, and yellow.\n Analyses:\n Hopper:\n NiCO3\n Parmelee:\n NiCO3\n IMC:\n % 63 NiO  37 CO2\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 07:59:34',NULL),
	(12352,352,NULL,'Nickel Oxide','Nickel Oxide, Black Nickel Oxide','Nickel Oxide Black',NULL,'Nickel oxide supplies NiO. Colorant used to produce blue, gray, green, brown, and yellow. Ni2O3 decomposes to NiO at 600C. Many sources do not differentiate between green and black nickel oxide. Concentrated nickel occurs naturally in the ore minerals  Nicolite (NiAs) and Nickel Glance (NiAsS) and is extracted from the ores by roasting.\r\n Analyses:\r\n Hopper:\r\n Ni2O3\r\n Cooper & Royle:\r\n NiO\r\n Rhodes:\r\n NiO (green), Ni2O3 (black)\r\n Chappell:\r\n Ni2O3\r\n Cushing:\r\n NiO (green), Ni2O3 (black)\r\n Memmott:\r\n NiO (green), Ni2O3 (black)\r\n Parmelee:\r\n NiO (green)(nickelous), Ni2O3 (black)(nickelic)',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-15 16:50:22',NULL),
	(12353,353,NULL,'Niter','Niter','Niter',NULL,'Niter supplies K2O.\n Not commonly used in glazes; used primarily as an oxidizing\n agent in frits. Sodium nitrate may usually be substituted.\n Analyses:\n Rhodes:\n KNO3\n Cushing:\n KNO3\n Parmelee:\n KNO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:26:06',NULL),
	(12354,354,NULL,'Oat straw ash','Oat straw ash',NULL,NULL,'Oat straw ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Hamer & Hamer:\n % 4 Na2O  30 K2O  4 MgO  7 CaO\n 49 SiO2  5 P2O5  1 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:01:10',NULL),
	(12355,355,NULL,'Ocmulgee','Ocmulgee','Ocmulgee Red Clay',NULL,'Ocmulgee supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\n of several fluxes.\n A sandy, coarse, iron-bearing clay formed by sedimentary\n deposition by moving water.\n Manufactured by Burns Brick Company for the manufacture of\n bricks and pipes; comes from Macon, GA.\n Analyses:\n Obstler:\n % 0.358 Na2O  1.285 K2O  0.793 MgO  0.37 CaO  21.82 Al2O3\n 53.86 SiO2  1.196 TiO2  6.4 Fe2O3  0.230 MnO  8.9 LOI\n Cushing:\n % 0.36 Na2O  1.29 K2O  0.79 MgO  0.37 CaO  21.8 Al2O3\n 53.9 SiO2  1.2 TiO2  6.4 Fe2O3  0.23 MnO  13.7 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:02:02',NULL),
	(12356,356,NULL,'Opax','Opax','Opax',NULL,'Opax supplies ZrO2, SiO2, TiO2. K2O, Na2O, and Fe2O3.\n A fritted zirconium opacifier. No longer manufactured.\n Analyses:\n Hopper:\n (no analysis)\n Chappell:\n % 1.11 Na2O  0.91 Al2O3  6.48 SiO2  90.84 ZrO2\n IMC:\n % 1.11 Na2O  0.91 Al2O3  6.48 SiO2  90.84 ZrO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:01:47',NULL),
	(12357,357,12371,'Oxford Feldspar','Oxford Feldspar','Oxford Feldspar',NULL,'Oxford feldspar supplies SiO2, Al2O3, K2O, Na2O, CaO, and Fe2O3. Potash feldspar. If unavailable, substitute Eureka #703 feldspar [Cushing].\r\n Analyses:\r\n Cooper & Royle: (appendix 8)\r\n % 3.22 Na2O  7.92 K2O  0.38 CaO  17.04 Al2O3 69.4 SiO2  0.09 Fe2O3  0.3 LOI\r\n Chappell:\r\n % 3.22 Na2O  7.92 K2O  0.38 CaO  17.04 Al2O3 69.4 SiO2  0.09 Fe2O3  0.3 LOI\r\n Tichane (CB):\r\n % 3.2 Na2O  7.9 K2O  0.4 CaO  17.0 Al2O3 69.4 SiO2  0.1 Fe2O3  0.3 LOI\r\n IMC:\r\n % 3.28 Na2O  8.07 K2O  0.39 CaO  17.35 Al2O3 70.82 SiO2  0.09 Fe2O3  0.19 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:30:28',NULL),
	(12358,358,NULL,'P-609','P-609',NULL,NULL,'',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:03:38',NULL),
	(12359,359,12058,'Parks Ball Clay','Parks Ball Clay','Parks Clay',NULL,'Parks ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.1 K2O  0.1 MgO  0.3 CaO  26.8 Al2O3\r\n 58.9 SiO2  1.6 TiO2  0.8 Fe2O3  11.2 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:39:23',NULL);
