VALUES
	(12360,360,12144,'PBX Fire Clay','PBX Fire Clay','PBX Fireclay',NULL,'PBX fireclay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes.\r\n A Missouri fire clay. Missouri fire clays are secondary deposits of clay and sediment formed in deep fresh waters. Comes from Missouri.\r\n If unavailable, substitute 85% Hawthorn Bonding clay plus 15% Lizella Red [Cushing].\r\n Analyses:\r\n Obstler: (1986) (adds to 109%)\r\n % 0.5 K2O  0.1 MgO  0.1 CaO  24.0 Al2O3  66.0 SiO2 1.5 TiO2  2.0 Fe2O3  15.3 H2O\r\n Obstler: (old)\r\n % 0.1 K2O  0.23 MgO  31.1 Al2O3  45.7 SiO2 1.7 TiO2  6.1 Fe2O3  5.8 H2O\r\n Tichane (CB):\r\n % 0.1 K2O  0.2 MgO  31.1 Al2O3 45.7 SiO2  1.7 TiO2  6.1 Fe2O3  15.3 LOI\r\n IMC:\r\n % 0.35 MgO  0.36 CaO  38.52 Al2O3 56.63 SiO2  1.51 TiO2  1.75 Fe2O3  0.88 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-21 15:16:11',NULL),
	(12361,361,NULL,'Pearl Ash','Pearl Ash, Potassium Carbonate','Pearl Ash',NULL,'Pearl ash supplies K2O.\n A soluble but pure source of potassium. Tends to absorb moisture\n from the air.\n Analyses:\n Hopper:\n K2CO3\n Cooper & Royle:\n K2CO3\n Rhodes:\n K2CO3\n Cuff:\n K2CO3\n Chappell:\n K2CO3\n Cushing:\n K2CO3\n Memmott:\n K2CO3\n Parmelee:\n K2CO3\n IMC:\n % 57 K2O  43 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:04:25',NULL),
	(12362,362,12288,'Peerless #2 kaolin','Peerless #2 kaolin','Peerless 2 Kaolin',NULL,'Peerless #2 kaolin  supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.5 K2O  0.1 MgO  0.1 CaO  39.5 Al2O3\r\n 44.6 SiO2  1.4 TiO2  0.5 Fe2O3  13.3 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:14:04',NULL),
	(12363,363,12288,'Peerless kaolin','Peerless kaolin','Peerless 3 Kaolin',NULL,'Peerless kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and\r\n small amounts of several fluxes.\r\n Kaolin for casting slips.\r\n Analyses:\r\n Cushing: (adds to 87%)\r\n % 0.04 Na2O  0.52 K2O  0.07 MgO  0.05 CaO  39.5 Al2O3\r\n 44.6 SiO2  1.4 TiO2  0.45 Fe2O3\r\n IMC:\r\n % 0.04 Na2O  0.52 K2O  0.07 MgO  0.05 CaO  39.50 Al2O3\r\n 44.60 SiO2  1.40 TiO2  0.45 Fe2O3  12.50 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:14:38',NULL),
	(12364,364,NULL,'Petalite','Petalite','Petalite',NULL,'Petalite supplies SiO2, Al2O3, K2O, Rb2O, Li2O, Na2O, and Fe2O3. A lithium aluminosilicate. Theoretical formula Li2O Al2O3 8SiO2 (4.9% Li2O by weight). Petalite has the lowest coefficient of expansion of any lithium mineral. When heated above 1900F, converts to a solid solution of silica in beta spodumene, a mixture with virtually no thermal expansion. Mainly used in low-expansion flameproof clay bodies. Mined by Bikita Minerals, Bikita, Zimbabwe; imported by Keaney Minerals, Inc.\r\n Analyses:\r\n Obstler: (Keany Minerals Inc.)\r\n % 0.6 Na2O  0.25 K2O  0.03 MgO  0.1 CaO  4.4 Li2O 0.01 SrO  0.01 BaO  17.1 Al2O3  76.7 SiO2 0.01 P2O5  0.01 TiO2  0.03 Fe2O3 0.01 S  0.03 F  0.10 Rb2O 0.01 MnO2  0.05 Cs2O  0.01 Cr2O3\r\n Hopper:\r\n Li2O  Al2O3  8SiO2\r\n Green:\r\n 0.06 KNaO  0.01 CaO  1.0 Li2O  1.35 Al2O3  9.16 SiO2\r\n Cooper & Royle:\r\n Li2O  Al2O3  8SiO2\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.037)\r\n % 3.55 Li2O  0.60 Na2O  0.50 K2O  0.16 MgO  0.89 CaO 16.50 Al2O3  76.70 SiO2  0.07 Fe2O3  0.83 LOI\r\n Rhodes:\r\n Li2O  Al2O3  8SiO2\r\n Cuff:\r\n Li2O  Al2O3  8SiO2\r\n Chappell:\r\n Li2O  Al2O3  8SiO2\r\n Cushing: (200 mesh)\r\n % 0.5 Na2O  0.2 K2O  0.2 MgO  0.2 CaO  4.3 Li2O  15.9 Al2O3 78.4 SiO2  0.04 Fe2O3\r\n Cushing:\r\n Li2O  Al2O3  8 SiO2\r\n Cushing:\r\n Li2O  Al2O3  8 SiO2\r\n Memmott:\r\n Li2O  Al2O3  8 SiO2\r\n Parmelee:\r\n % 4.3 Li2O  17.5 Al2O3  77.0 SiO2\r\n IMC:\r\n % 0.25 Na2O  0.26 K2O  4.32 Li2O  17.50 Al2O3 77.13 SiO2  0.55 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:34:03',NULL),
	(12365,365,NULL,'Pine wood ash','Pine wood ash','Pine Wood Ash',NULL,'Pine ash supplies several oxides, especially CaO and SiO2.\n Analyses:\n Sanders:\n % 3.77 Na2O  8.98 K2O  4.45 MgO  39.73 CaO  9.71 Al2O3\n 24.39 SiO2  2.78 P2O5  3.41 Fe2O3  2.74 MnO\n Conrad:\n % 8.6 Na2O  26.5 K2O  6.3 MgO  25 CaO  0.4 Al2O3\n 10 SiO2  8.9 P2O5  4 Fe2O3  5.6 MnO\n Tichane (TCB):\n % 3.8 Na2O  9.0 K2O  4.5 MgO  39.7 CaO  9.7 Al2O3\n 24.4 SiO2  3.4 Fe2O3  2.8 P2O5\n Rogers:\n % 8.65 Na2O  26.50 K2O  6.32 MgO  25.00 CaO  0.43 Al2O3\n 10.00 SiO2  8.8 P2O5  4.00 Fe2O3  5.06 MnO\n 4.63 SO3  0.52 Cl\n Rogers (appendix):\n % 3.77 Na2O  8.98 K2O  4.45 MgO  39.73CaO  9.71 Al2O3\n 24.39 SiO2  4.45 P2O5  3.41 Fe2O3  2.74 MnO\n Hamer & Hamer: (Scots pine)\n % 6 Na2O  18 K2O  6 MgO  32 CaO  5 Al2O3\n 18 SiO2  7 P2O5  4 Fe2O3  4 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:07:12',NULL),
	(12366,366,NULL,'Pine Lake','Pine Lake','Pine Lake Fireclay',NULL,'Pine Lake supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\n of several fluxes.\n Analyses:\n Tichane (CB):\n % 0.2 Na2O  0.6 K2O  0.1 MgO  0.3 CaO  27.3 Al2O3\n 58.6 SiO2  1.9 TiO2  1.5 Fe2O3  9.5 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:07:20',NULL),
	(12367,367,12288,'Pioneer Kaolin','Pioneer Kaolin','Pioneer Kaolin',NULL,'Pioneer Kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small\r\n amounts of several fluxes.\r\n A secondary (sedimentary) kaolin.\r\n Manufactured by Georgia Kaolin Co.; comes from Georgia.\r\n Analyses:\r\n Obstler: (Georgia Kaolin Co.)\r\n % 0.04 Na2O  0.14 K2O  0.14 MgO  0.24 CaO  38.51 Al2O3\r\n 45.68 SiO2  1.43 TiO2  0.44 Fe2O3  13.52 H2O\r\n Tichane (CB):\r\n % 0.1 K2O  0.1 MgO  0.2 CaO  38.5 Al2O3\r\n 45.7 SiO2  1.4 TiO2  0.4 Fe2O3  13.5 LOI\r\n IMC: (mixup on K/Na)\r\n % 0.04 Na2O  0.14 Na2O  0.14 MgO  0.24 CaO  38.51 Al2O3\r\n 45.68 SiO2  1.43 TiO2  0.44 Fe2O3  13.92 H2O',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:16:43',NULL),
	(12368,368,NULL,'Plaster of Paris','Plaster of Paris','Plaster',NULL,'Plaster of Paris provides CaO.\n Ordinary plaster. Rarely used in glazes. Plaster of Paris is\n prepared by heating Gypsum (CaSO4 2H2O) to 200C; when combined\n with water, reverts to Gypsum.\n Analyses:\n Cooper & Royle:\n 2 CaSO4  H2O\n Klein & Hurlbut:\n CaSO4 0.5 H2O\n Parmelee:\n CaSO4 0.5 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:26:52',NULL),
	(12369,369,NULL,'Plastic Vitrox','Plastic Vitrox, PV Clay','Plastic Vitrox',NULL,'Plastic vitrox supplies SiO2, Al2O3, Fe2O3, TiO2, and small\n amounts of several fluxes.\n A white plastic feldspar.\n Analyses:\n Chappell:\n % 0.29 Na2O  6.81 K2O  0.2 MgO  0.22 CaO  14.87 Al2O3\n 75.56 SiO2  0.09 Fe2O3  2.04 LOI\n Cushing:\n 0.34 Na2O  0.61 K2O  0.04 CaO  1.03 Al2O3  13.9 SiO2\n Sanders (Glazes for Special Effects 1974):\n 0.054 Na2O  0.842 K2O  0.045 CaO  0.058 MgO  1.693 Al2O3\n 14.634 SiO2  0.005 Fe2O3\n IMC:\n % 0.90 Na2O  5.00 K2O  0.50 MgO  1.00 CaO  12.70 Al2O3\n 76.50 SiO2  0.10 TiO2  0.50 Fe2O3  2.80 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:07:47',NULL),
	(12370,370,NULL,'Portland cement','Portland cement',NULL,NULL,'Portland cement supplies SiO2, Al2O3, CaO, MgO, and Fe2O3.\n Analyses:\n Tichane (AG):\n % 2.0 MgO  62.5 CaO  7.5 Al2O3\n 22.5 SiO2  2.5 Fe2O3  1.0 Cl2  2.0 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:07:59',NULL),
	(12371,371,NULL,'Potash Feldspar (Theoretical)','Potash Feldspar (Theoretical)','Potash Feldspar',NULL,'[Map to your favorite potash feldspar (Custer, G-200, etc.)]\r\n Analyses:\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.020)\r\n % 2.89 Na2O  12.00 K2O  0.38 CaO  19.0 Al2O3 65.2 SiO2  0.10 Fe2O3  0.39 LOI\r\n Tichane (AG):\r\n % 3.0 Na2O  10.4 K2O  0.3 CaO  17.5 Al2O3 68.5 SiO2  0.1 Fe2O3  0.3 LOI',20,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 17:56:59',NULL),
	(12373,373,NULL,'Potassium chromate','Potassium chromate','Potassium Chromate',NULL,'Potassium chromate supplies K2O and Cr2O3.\n Analyses:\n Cushing:\n KCrO4\n Parmelee:\n KCrO4\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:27:49',NULL),
	(12374,374,NULL,'Potassium dichromate','Potassium dichromate','Potassium Dichromate',NULL,'Potassium dichromate supplies K2O and Cr2O3.\n A soluble source of chromium. A bright orange powder. Used in\n low temperature glazes to make chrome reds.\n Analyses:\n Hopper:\n K2Cr2O7\n Rhodes:\n K2Cr2O7\n Chappell:\n K2Cr2O7\n Cushing:\n K2Cr2O7\n Parmelee:\n K2Cr2O7\n IMC:\n % 32.0 K2O  51.7 Cr2O3  16.3 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:28:43',NULL),
	(12375,375,NULL,'Potassium permanganate','Potassium permanganate',NULL,NULL,'Potassium permanganate supplies K2O and MnO.\n A soluble source of manganese.\n Analyses:\n Hopper:\n KMnO4\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:29:26',NULL),
	(12376,376,NULL,'Potassium silicofluoride','Potassium silicofluoride',NULL,NULL,'Potassium silicofluoride supplies K2O and SiO2.\n Analyses:\n Parmelee:\n K2SiF6\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:30:36',NULL),
	(12377,377,NULL,'Potato tuber ash','Potato tuber ash',NULL,NULL,'Potato tuber ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Green:\n 0.82 K2O  0.13 MgO  0.04 CaO  0.33 Al2O3  1.31 SiO2\n 0.11 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:10:59',NULL),
	(12378,378,NULL,'Praseodymium oxide','Praseodymium oxide','Praseodymium Oxide',NULL,'Praseodymium oxide supplies Pr2O3.\n Source of praseodymium, used to produce yellow stains. Slightly\n soluble.\n Analyses:\n Hopper:\n Pr2O3\n Chappell:\n Pr2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12379,379,12288,'Putnam kaolin','Putnam kaolin','Putnam Kaolin',NULL,'Putnam kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.2 K2O  0.2 MgO  0.1 CaO  37.8 Al2O3\r\n 47.0 SiO2  0.2 TiO2  0.8 Fe2O3  13.5 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:17:28',NULL),
	(12380,380,NULL,'Pyrophyllite','Pyrophyllite',NULL,NULL,'Pyrophyllite supplies SiO2 and Al2O3.\n An aluminosilicate generally used in tile clays to reduce\n thermal expansion. Non-plastic, similar in physical properties\n to a talc.\n Manufactured by Vanderbilt.\n Analyses:\n Hopper:\n Al2O3  4 SiO2  H2O\n Rhodes:\n Al2O3  4 SiO2  H2O\n Chappell:\n Al2O3  4 SiO2  H2O\n Chappell:\n % 1.2 Na2O  1.4 K2O  0.1 CaO  20.0 Al2O3\n 73.5 SiO2  0.5 Fe2O3  3.3 LOI\n Cushing:\n Al2O3  4 SiO2  H2O\n Memmott:\n Al2O3  4 SiO2  H2O\n Tichane (CB):\n % 0.4 Na2O  2.3 K2O  14 Al2O3\n 81 SiO2  0.1 TiO2  0.2 Fe2O3  2.3 LOI\n IMC:\n % 0.30 Na2O  1.81 K2O  0.10 MgO  0.10 CaO  16.08 Al2O3\n 78.20 SiO2  0.10 TiO2  0.20 Fe2O3  3.10 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:11:26',NULL),
	(12381,381,NULL,'Pyrotrol','Pyrotrol','Pyrotrol',NULL,'Notes The Pyrotrol group of mineral products offers a controlled\n blend of milled Andalusite/Pyrophyllite ores designed to control\n strinkage in whiteware ceramic applications. Pyrotrol reduces\n thermal expansion, stabilizes shrinkage, widens firing range and\n reduces warpage.\n Alumina content is controlled to meet certain specifications.\n Pyrotrol produces an excellent kiln car wash and is an\n inexpensive coating material for facebrick production.\n This material is dry milled and magnetically separated.\n The analysis shown is an average.\n Chemistry\n Fe2O3 0.400\n SiO2 77.000\n Al2O3 18.900\n TiO2 0.400\n Na2O 0.200\n K2O 0.200\n Volatiles\n LOI 2.800\n Properties Body Thermal Expansion - Pyrotrol products impart\n higher strength in electrical porcelains and reduce dunting\n problems associated with traditional porcelain bodies if\n substituted for silica content. Data Specific Gravity: 2.80 PCE:\n 26 Sieve Analysis Dry +200 mesh: 1-3.5% +325: 1-12.5% Bulk\n Density (lbs/cu. ft): 40-45 Specific Gravity: 2.80 PCE: 26 Sieve\n Analysis Dry +200 mesh: 1-3.5% +325: 1-12.5% Bulk Density\n (lbs/cu. ft): 40-45 Suppliers RESCO Products\n Authors Tony Hansen (Owner)\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:11:33',NULL),
	(12382,382,NULL,'Raw sienna','Raw sienna','Raw Sienna',NULL,'Raw sienna provides SiO2, Al2O3, and Fe2O3.\n Analyses:\n Green:\n 0.4 Al2O3  1.18 SiO2  1.0 Fe2O3  1.98 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:14:12',NULL),
	(12383,383,NULL,'Raw umber','Raw umber','Raw Umber',NULL,'Raw umber provides SiO2, Al2O3, CaO, MgO, MnO, and Fe2O3.\n Analyses:\n Green:\n 0.16 MgO  0.28 CaO  0.57 MnO  0.09 Al2O3  0.69 SiO2\n 1.0 Fe2O3  2.28 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:14:37',NULL),
	(12384,384,NULL,'Red clay','Red clay',NULL,NULL,'Red clay supplies SiO2, Al2O3, and Fe2O3.\n Generic red clay. Map to a particular kind of red clay, or use\n generic formula below.\n Analyses: (generic Red Clay)\n Green:\n 0.01 Na2O  0.10 K2O  0.07 MgO  0.08 CaO  1.0 Al2O3\n 3.52 SiO2  0.07 TiO2  0.22 Fe2O3  0.93 H2O\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:15:01',NULL),
	(12385,385,NULL,'Red copper oxide','Red copper oxide','Copper Oxide Red',NULL,'Red copper oxide supplies CuO.  A colorant and flux; reduced form of black copper oxide (CuO).  Red copper oxide is usually coated with some material to prevent reoxidation, and because of this does not mix well into  water. Try washing it with alcohol to remove the coating.  Red copper oxide is often used for copper fuming in pit/sagger firing.\n Analyses:\n Rhodes:\n Cu2O\n Cushing:\n Cu2O\n Memmott:\n Cu2O\n Parmelee:\n Cu2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-11 19:51:53',NULL),
	(12386,386,NULL,'Red Dalton','Red Dalton','Red Dalton Clay',NULL,'Red Dalton supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\n of several fluxes.\n Analyses:\n Chappell:\n % 1.2 Na2O  1.6 K2O  0.5 MgO  0.3 CaO  18.3 Al2O3\n 63.2 SiO2  1.3 TiO2  6.3 Fe2O3  6.4 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:16:44',NULL),
	(12387,387,NULL,'Red iron oxide','Red iron oxide, RIO','Iron Oxide Red',NULL,'Red iron oxide supplies Fe2O3.\r\n Most common source of iron in glazes. Produced by heating\r\n iron sulfate or iron hydroxide. There are different grades\r\n of red iron oxide - different purities and different particle\r\n size distributions and shapes.\r\n Analyses:\r\n Hopper:\r\n Fe2O3\r\n Cooper & Royle:\r\n Fe2O3\r\n Rhodes:\r\n Fe2O3\r\n Cuff: (Hematite)\r\n Fe2O3\r\n Chappell:\r\n Fe2O3\r\n Cushing:\r\n Fe2O3\r\n Memmott:\r\n Fe2O3\r\n Parmelee:\r\n Fe2O3\r\n IMC:\r\n % 98 Fe2O3  2 H2O',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-10 17:45:47',NULL),
	(12388,388,NULL,'Red Lead','Red Lead',NULL,NULL,'Red lead supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:34:45',NULL),
	(12389,389,NULL,'Redart','Redart, Red Art','Redart',NULL,'Redart supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts\r\n of several fluxes.\r\n An iron-rich clay consisting of clay/shale deposits from a\r\n prehistoric lake bed. Contains 40% illite, 10% kaolinite, 7%\r\n iron oxide, and 15% mixed layered clays.\r\n Manufactured by Cedar Heights Clay Division of Resco Products\r\n Inc.; comes from Ohio.\r\n Relatively low plasticity, but good brick-red color (best color\r\n at c/02 [IMC]).\r\n Analyses:\r\n Obstler:\r\n % 0.4 Na2O  4.07 K2O  1.55 MgO  0.23 CaO  16.41 Al2O3\r\n 64.27 SiO2  1.06 TiO2  7.04 Fe2O3  4.92 LOI\r\n Cooper & Royle: (Appendix 8)\r\n % 0.40 Na2O  4.07 K2O  1.55 MgO  0.23 CaO  16.41 Al2O3\r\n 64.27 SiO2  1.06 TiO2  7.04 Fe2O3  4.78 LOI\r\n Chappell: (slight variance from C&R)\r\n % 4.07 Na2O  0.40 K2O  1.55 MgO  0.23 CaO  16.41 Al2O3\r\n 64.24 SiO2  1.06 TiO2  7.04 Fe2O3  4.78 LOI\r\n Cushing: (probable error in SiO2)\r\n % 0.40 Na2O  4.07 K2O  1.55 MgO  0.23 CaO  16.4 Al2O3\r\n 54.3 SiO2  1.06 TiO2  7.04 Fe2O3 0.17 P2O5 4.78 LOI 0.24 SO3\r\n Tichane (AG, TCB, CB):\r\n % 0.4 Na2O  4.1 K2O  1.6 MgO  0.2 CaO  16.4 Al2O3\r\n 64.3 SiO2  1.1 TiO2  7.0 Fe2O3  4.8 LOI\r\n IMC:\r\n % 0.38 Na2O  4.15 K2O  1.59 MgO  0.26 CaO  15.51 Al2O3\r\n 64.95 SiO2  1.09 TiO2  7.05 Fe2O3 0.22 P2O5\r\n 4.80 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-14 16:16:17',NULL),
	(12390,390,NULL,'Rice hull ash','Rice hull ash',NULL,NULL,'Rice hull ash supplies several oxides, especially SiO2.\n Analyses:\n Sanders:\n % 0.26 Na2O  0.9 K2O  0.22 MgO  0.48 CaO  1 Al2O3\n 96 SiO2  0.02 P2O5  0.16 TiO2  0.04 Fe2O3  0.19 MnO  0.96 LOI\n Conrad:\n % 0.26 Na2O  0.9 K2O  0.22 MgO  0.48 CaO  1 Al2O3\n 96 SiO2  0.02 P2O5  0.04 Fe2O3  0.19 MnO\n (Claims this analysis is from from Cardew, but there is no rice\n hull in Cardew. Looks like it came from Sanders, but with errors.)\n Rogers (appendix):\n % 1.35 K2O  1.04 CaO  1.78 Al2O3\n 94.36 SiO2  0.61 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:18:43',NULL),
	(12391,391,NULL,'Rice straw ash','Rice straw ash','Rice Straw Ash',NULL,'Rice straw ash supplies several oxides, especially SiO2.\n Analyses:\n Cardew:\n % 0.36 Na2O  2.48 K2O  1.35 MgO  3.69 CaO  1.36 Al2O3\n 82.18 SiO2  0.68 P2O5  0.42 Fe2O3  0.38 SO3  6.2 LOI\n (Ware-bai)\n (E. Kato, Interceram, 2 (1962) 110)\n Sanders:\n % 0.77 Na2O  3.57 K2O  1.38 MgO  3.07 CaO  1.13 Al2O3\n 40 SiO2  2.51 P2O5  0.26 Fe2O3  0.30 MnO  47.26 LOI\n Rogers:\n % 0.96 Na2O  1.68 K2O  2.44 MgO  4.00 CaO  9.11 Al2O3\n 77.68 SiO2  0.90 P2O5  2.93 Fe2O3\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:20:03',NULL),
	(12392,392,NULL,'Rotten stone','Rotten stone','Rotten Stone',NULL,'Rotten stone supplies SiO2, Al2O3, KNaO, MgO, and Fe2O3.\n A soft, crumbly stone resulting from the decomposition of a\n siliceous limestone, or shelly sandstone, whose CaO component\n has been mostly dissolved by water. Contains V and Ti impurities.\n Manufactured by Empire White Products Co.\n Analyses:\n Obstler: (Empire Products Co.)\n % 8.62 KNaO  2.92 CaO+MgO  17.68 Al2O3\n 60.65 SiO2  9.04 Fe2O3  1.09 H2O\n (she also provides an emission spectrum analysis showing\n Al, Fe, Ti, and Si as major constituents, plus 10% MgO,\n 0.1% CaO, 0.08% V, 0.5% Na2O)\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:35:22',NULL),
	(12393,393,NULL,'Rutile','Rutile','Rutile',NULL,'Rutile supplies TiO2 and Fe2O3.\n Natural source of titanium with iron impurities. (Parmelee\n indicates that up to 25% FeO may be in solution in the crystal.)\n Rutile may also contain silica, chromium, and vanadium. Can be\n very fluid in reduction [Memmott].\n Analyses:\n Hopper:\n TiO2\n Chappell: (questionable)\n FeTiO3\n Memmott:\n TiO2 with iron traces\n IMC: (no iron?)\n % 96.10 TiO2  0.90 ZrO2  0.30 Al2O3  0.10 LOI\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:22:07',NULL),
	(12394,394,NULL,'Rye straw ash','Rye straw ash',NULL,NULL,'Rye straw ash supplies several oxides, especially SiO2 and K2O.\n Analyses:\n Green:\n 0.68 K2O  0.11 MgO  0.21 CaO  0.54 Al2O3  3.36 SiO2\n 0.04 Fe2O3  0.07 P2O5\n Rogers:\n % 1.74 Na2O  22.56 K2O  3.10 MgO  8.20 CaO\n 49.27 SiO2  6.53 P2O5  1.91 Fe2O3\n 4.25 SO3  2.18 Cl\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:22:12',NULL),
	(12395,395,NULL,'Salt','Salt, sodium chloride',NULL,NULL,'Salt supplies Na2O.\n A soluble but pure source of sodium. Occasionally used as an\n ingredient in shino glazes; introduced into the kiln during\n salt firings. Salt is sometimes introduced into a frit batch\n to help vaporize some of the iron, thereby bleaching the frit.\n Analyses:\n Hopper:\n NaCl\n Chappell:\n NaCl\n Memmott:\n NaCl\n Parmelee:\n NaCl\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:36:01',NULL),
	(12396,396,NULL,'Selenium','Selenium','Selenium',NULL,'Selenium supplies SeO2.\n Source of selenium, usually used in conjunction with cadmium\n to produce low-fire oranges and reds. Can also be used as\n sodium selenite (Na2O SeO2) or barium selenite (BaO SeO2).\n Analyses:\n Hopper:\n Se\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12397,397,NULL,'Shale','Shale',NULL,NULL,'Shale supplies SiO2, Al2O3, TiO2, Fe2O3, and small\n amounts of several fluxes.\n Alfred shale: Plastic shale, very high iron. Shale in general\n is a rock of mixed mineral content; typically might contain clay\n minerals, quartz, feldspar, and limestone, as well as some iron.\n Analyses:\n Cushing: (Alfred shale)(adds to 105%; no LOI)\n % 1.3 Na2O  4.5 K2O  2.1 MgO  0.36 CaO  19.2 Al2O3\n 58.3 SiO2  0.91 TiO2  18.1 Fe2O3\n Tichane (AG, TCB): (NY shale)\n % 0.6 Na2O  3.3 K2O  2.0 MgO  0.6 CaO  15.4 Al2O3\n 64.6 SiO2  0.9 TiO2  7.2 Fe2O3  3.9 LOI\n Tichane (CB): (Alfred shale)\n % 1.4 Na2O  3.7 K2O  1.3 MgO  0.4 CaO  19.6 Al2O3\n 61.2 SiO2  1.0 TiO2  7.4 Fe2O3  4.6 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:24:13',NULL),
	(12398,398,NULL,'Sheffield clay','Sheffield clay','Sheffield Clay',NULL,'Sheffield clay supplies SiO2, Al2O3, Fe2O3, TiO2, K2O, MgO, CaO,\n and Na2O.\n of several fluxes.\n An iron-rich clay consisting of biotite, hornblende, and other\n high Fe/Mg rock deposits from a glacial lake formed during the\n Wisconsin Ice Age (10-15 thousand years ago). Contains chlorite,\n biotite, and quartz.\n Manufactured by Sheffield Pottery; comes from Sheffield, MA.\n Analyses:\n Obstler (adds to 92% - added 8% LOI to above):\n % 1.2 Na2O  4.05 K2O  3.53 MgO  3.2 CaO  19.58 Al2O3\n 51.02 SiO2  0.97 TiO2  8.46 Fe2O3  7.99 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:24:25',NULL),
	(12399,399,NULL,'Sil-o-spar','Sil-o-spar','Sil-o-spar',NULL,'Sil-o-spar supplies SiO2, Al2O3, Na2O, K2O, CaO, and Fe2O3.\n Blend of feldspar and silica.\n Manufactured by Feldspar Corporation. Ground to 170 mesh;\n recommended for use in casting slips.\n Analyses:\n Feldspar Corp.: (2001)\n % 4.86 Na2O  2.86 K2O  1.05 CaO  13.47 Al2O3\n 77.37 SiO2  0.057 Fe2O3  0.07 LOI\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:30:10',NULL),
	(12400,400,NULL,'Silica','Silica, Quartz, Flint','Silica',NULL,'Silica supplies SiO2. 325 mesh. Silica is a pure source of SiO2. Mineralogically, there are two main sources of silica for potters. First, there is the mineral Flint, an amorphous form of silica crystallized from water, and often containing calcium impurities. This is the predominant source of silica for potters in Europe. Second, there is the mineral Quartz, usually in the form of sandstone. Sandstone is an extremely widespread rock type in the U.S., so American potters usually obtain silica from this source. The largest supplier of silica to potters in the U.S. is the U.S. Silica Co., who obtains silica from Devonian sandstones (400 million years ago) in Pennsylvania and West Virginia. It is supplied in several mesh sizes under the trade name Sil-Co-Sil (or Supersil):\r\n Sil-Co-Sil #75   200 mesh\r\n #63   270 mesh\r\n #52   325 mesh\r\n #38   400 mesh\r\n The mesh size is very important, both in clays and in glazes. The mesh size affects the effective reactivity of the silica (finer is more reactive), which determines how much silica is changed to the glassy state and how much remains as quartz. This affects the glossiness and transparency of glazes, and the thermal expansion characteristics of both clay and glazes.\r\n Analyses:\r\n Obstler: (U.S. Silica, 1989)\r\n % 99.67 SiO2  0.100 Al2O3  0.025 Fe2O3  0.020 TiO2  0.180 LOI\r\n (less than 0.01 CaO and MgO)\r\n Hopper:\r\n SiO2\r\n Cooper & Royle: (also listed as Silica oxide, Silver Sand)\r\n SiO2\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.040 - Quartz)\r\n % 0.13 Al2O3  99.50 SiO2  0.06 Fe2O3  0.17 LOI\r\n Cooper & Royle: (Harrison Mayer Ltd. - Flint)\r\n % 0.01 Na2O  0.11 K2O  0.47 CaO  0.26 Al2O3\r\n 98.6 SiO2  0.02 Fe2O3  0.33 LOI\r\n Rhodes:\r\n SiO2\r\n Cuff:\r\n SiO2\r\n Chappell:\r\n SiO2\r\n Cushing:\r\n SiO2\r\n Memmott:\r\n SiO2\r\n Parmelee:\r\n SiO2\r\n Tichane (TCB): (Silica sand)\r\n % 0.1 MgO  0.3 CaO  0.5 Al2O3\r\n 98.5 SiO2  0.01 TiO2  0.04 Fe2O3  0.1 LOI\r\n IMC: (Flint)\r\n % 3.5 CaO  93.0 SiO2  3.50 LOI',32,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-10-09 04:27:29',NULL),
	(12401,401,NULL,'Silicon carbide','Silicon carbide','Silicon carbide',NULL,'Silicon carbide supplies SiO2.\n A fusion of sand and coke. Used in kiln shelves and other parts.\n Fine grades can be used in small quantities to produce local\n reduction effects in oxidation-fired glazes; larger amounts or\n larger grain sizes can be used to form cratered surfaces.\n For use in local reduction glazes, get grade FFF (450 to\n 600 mesh).\n Analyses:\n Hopper:\n SiC\n Cooper & Royle:\n SiC\n Chappell: (incorrect)\n SiO\n Cushing:\n SiC\n IMC:\n SiC\n',32,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:36:56',NULL),
	(12402,402,NULL,'Sillimanite','Sillimanite','Sillimanite',NULL,'Sillimanite provides SiO2 and Al2O3.\n Used in kiln shelves and refractories.\n Analyses:\n Cooper & Royle:\n Al2O3  SiO2\n Memmott:\n Al2O3  SiO2\n IMC:\n Al2O3  SiO2\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:27:57',NULL),
	(12403,403,NULL,'Silver carbonate','Silver carbonate','Silver Carbonate',NULL,'Silver carbonate supplies AgO.\n Source of silver, usually used in lusters.\n Analyses:\n Hopper:\n Ag2CO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12404,404,NULL,'Silver chloride','Silver chloride','Silver Chloride',NULL,'Silver chloride supplies AgO.\n Source of silver, usually used in lusters. Usually combined with\n bismuth to make a c/019 overglaze luster.\n Analyses:\n Chappell:\n AgCl\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12405,405,NULL,'Silver nitrate','Silver nitrate','Silver Nitrate',NULL,'Silver nitrate supplies AgO.\n Source of silver, usually used in lusters and raku glazes.\n Analyses:\n Hopper:\n AgNO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12406,406,NULL,'Soda Ash','Soda Ash, Sodium Carbonate',NULL,NULL,'Soda ash supplies Na2O.\n A soluble but pure source of sodium. Used as an ingredient in\n carbon-trap glazes, as a deflocculant in casting slips, as\n a source of sodium in soda firings, and as an ingredient in\n Egyptian Paste.\n Analyses:\n Hopper:\n Na2CO3\n Cooper & Royle:\n Na2CO3\n Rhodes:\n Na2CO3\n Chappell:\n Na2CO3\n Cushing:\n Na2CO3\n Memmott:\n Na2CO3\n Grebanier:\n Na2CO3  10 H2O  (crystal) (sal soda)\n Na2CO3          (fused) (soda ash)\n Parmelee:\n Na2CO3  10 H2O  (crystal)\n Na2CO3          (fused)\n Hamer:\n Na2CO3  10 H2O  (washing soda)\n Na2CO3          (soda ash)\n IMC:\n % 21.70 Na2O  78.30 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:28:53',NULL),
	(12407,407,NULL,'Soda Feldspar (Theoretical)','Soda Feldspar (Theoretical)','Soda Feldspar',NULL,'Map to your favorite soda feldspar, or use one of the analyses below.\r\n Analyses:\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.021)\r\n % 7.48 Na2O  2.78 K2O  1.88 CaO  19.00 Al2O3 67.90 SiO2  0.11 Fe2O3  0.29 LOI\r\n Tichane (AG):\r\n % 7.0 Na2O  4.5 K2O  1.8 CaO  19.7 Al2O3  66.8 SiO2\r\n Parmelee: (typical)\r\n % 9.37 Na2O  0.41 K2O  2.06 CaO  21.76 Al2O3 66.22 SiO2  0.04 Fe2O3  0.16 LOI',20,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:23:32',NULL),
	(12409,409,NULL,'Sodium aluminate','Sodium aluminate',NULL,NULL,'Sodium aluminate supplies Na2O and Al2O3.\n Used to prevent casting slips from settling.\n Analyses:\n Memmott:\n Na2O  Al2O3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:40:04',NULL),
	(12410,410,NULL,'Sodium antimonate','Sodium antimonate',NULL,NULL,'Sodium antimonate supplies Na2O and Sb2O3.\n Used as an opacifier in enamels; doesn\'t function well in glazes\n above 1000C.\n Analyses:\n Parmelee:\n Na2O  Sb2O3\n 2 NaSbO3  7 H2O\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:40:58',NULL),
	(12411,411,NULL,'Sodium biborate','Sodium biborate',NULL,NULL,'Sodium biborate supplies Na2O and B2O3.\n Analyses:\n Parmelee:\n Na2O  2 B2O3  10 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:41:47',NULL),
	(12412,412,NULL,'Sodium bicarbonate','Sodium bicarbonate','Sodium Bicarbonate',NULL,'Sodium bicarbonate supplies Na2O.\n A semisoluble source of pure sodium. Used as a source of sodium\n in soda firings, and as an ingredient in Egyptian Paste.\n Analyses:\n Chappell:\n NaHCO3\n Cushing:\n NaHCO3\n Parmelee:\n NaHCO3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:31:49',NULL),
	(12413,413,NULL,'Sodium nitrate','Sodium nitrate','Sodium Nitrate',NULL,'Sodium nitrate supplies Na2O.\n A soluble but pure source of sodium. Powerful oxidant, not\n generally used in glazes because of its cost.\n Analyses:\n Rhodes:\n NaNO3\n Parmelee:\n NaNO3\n IMC:\n % 36.5 Na2O  63.5 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:42:29',NULL),
	(12414,414,NULL,'Sodium phosphate','Sodium phosphate','Sodium Phosphate',NULL,'Sodium phosphate supplies Na2O and P2O5.\n Deflocculant for thin glaze and enamel slips. Used in making\n terra sigillata. Similar to tetrasodium pyrophosphate (Na2P2O7)\n and sodium hexametaphosphate (Calgon).\n Analyses:\n Grebanier:\n Na2HPO4  10 H2O\n Parmelee:\n Na2HPO4  10 H2O\n IMC:\n Na2HPO4  12 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:43:18',NULL),
	(12415,415,NULL,'Sodium selenite','Sodium selenite','Sodium Selenite',NULL,'Sodium selenite supplies Na2O and SeO2.\n Analyses:\n Parmelee:\n Na2SeO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:43:54',NULL),
	(12416,416,NULL,'Sodium silicate','Sodium silicate','Sodium Silicate',NULL,'Sodium silicate supplies Na2O and SiO2.\n Generally used as a deflocculant in casting slips.\n Analyses:\n Hopper:\n Na2O  xSiO2\n Chappell:\n Na2O  SiO2\n IMC:\n % 50.78 SiO2  49.22 SiO2\n Approximate cost: $4.00/pint (Axner, 2001)\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:32:10',NULL),
	(12417,417,NULL,'Sodium silicofluoride','Sodium silicofluoride','Sodium Silcofluoride',NULL,'Sodium silicofluoride supplies K2O and SiO2.\n Analyses:\n Parmelee:\n Na2SiF6\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:44:37',NULL),
	(12418,418,NULL,'Sodium sulfate','Sodium sulfate','Sodium Sulfate Decahydrate',NULL,'Sodium sulfate supplies Na2O.\n Analyses:\n Parmelee:\n Na2SO4\n IMC:\n Na2SO4  10 H2O\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:46:34',NULL),
	(12419,419,NULL,'Sodium uranate','Sodium uranate',NULL,NULL,'Sodium uranate supplies Na2O and U3O8.\n Source of uranium.\n Analyses:\n Hopper:\n Na2O  UO3\n Parmelee:\n Na2U2O7  6 H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12420,420,NULL,'Softwood ash','Softwood ash','Soft Wood Ash',NULL,'Softwood ash supplies fluxes.\n Map to a particular wood ash.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:32:51',NULL),
	(12421,421,12288,'Sparks kaolin','Sparks kaolin','Sparks Kaolin',NULL,'Sparks kaolin supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts\r\n of several fluxes.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.2 Na2O  0.9 K2O  37.5 Al2O3\r\n 46.1 SiO2  0.1 TiO2  0.9 Fe2O3  14.1 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:19:43',NULL),
	(12422,422,NULL,'Spodumene (Theoretical)','Spodumene (Theoretical)','Spodumene',NULL,'Spodumene supplies SiO2, Al2O3, and Li2O. [Theoretical formula Li2O Al2O3 4SiO2 (8% Li2O by weight). Use the theoretical formula, or map to a particular type of spodumene. Typical density 293.0 g/c]  Spodumene is a lithium aluminosilicate similar in function to  feldspars. Used in high-fire glazes and in some clay bodies.  Analyses:\r\n Obstler: (Cyprus Foote high-iron; chemical grade 200 mesh)\r\n % 0.60 Na2O  1.18 K2O  5.78 Li2O  24.80 Al2O3  63.00 SiO2  2.28 Fe2O3\r\n Obstler: (TANCO Canadian; chemical grade 200 mesh)\r\n % 0.30 Na2O  0.20 K2O  7.10 Li2O  25.00 Al2O3  65.00 SiO2  0.35 P2O5  0.12 Fe2O3  0.06 MnO2\r\n Obstler: (Lithium Australia Ltd.; concentrate)\r\n % 0.35 Na2O  0.15 K2O  0.10 CaO  7.50 Li2O  25.00 Al2O3  62.50 SiO2  0.25 P2O5  0.10 Fe2O3  0.05 MnO2\r\n Hopper:\r\n Li2O  Al2O3  3SiO2\r\n Green:\r\n 0.06 KNaO  0.01 MgO  0.01 CaO  1.0 Li2O  0.83 Al2O3  5.99 SiO2  0.01 Fe2O3\r\n Cooper & Royle:\r\n Li2O  Al2O3  4SiO2\r\n Rhodes:\r\n Li2O  Al2O3  4SiO2\r\n Cuff:\r\n Li2O  Al2O3  4SiO2\r\n Chappell:\r\n Li2O  Al2O3  4SiO2\r\n Cushing:\r\n 1.0 Li2O  1.16 Al2O3  4.37 SiO2\r\n Memmott:\r\n Li2O  Al2O3  4SiO2\r\n Parmelee:\r\n % 0.46 Na2O  0.69 K2O  6.78 Li2O  0.11 CaO  0.13 MgO  28.42 Al2O3  62.91 SiO2  0.53 Fe2O3  0.28 LOI\r\n IMC:\r\n % 0.31 Na2O  0.12 K2O  7.60 Li2O  0.05 CaO  26.00 Al2O3  64.50 SiO2  0.07 Fe2O3  0.01 TiO2  1.34 LOI',20,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:40:26',NULL),
	(12423,423,12422,'Spodumene - Australian','Spodumene - Australian',NULL,NULL,'Australian spodumene supplies SiO2, Al2O3, Li2O, Na2O, K2O, CaO, P2O5, Fe2O3, and MnO2. A low-iron spodumene manufactured by Lithium Australia Ltd. in Greenbushes, Western Australia.\r\n Analyses:\r\n Obstler: (Concentrate)\r\n % 0.35 Na2O  0.15 K2O  0.10 CaO  7.50 Li2O  25.00 Al2O3 62.50 SiO2  0.25 P2O5  0.10 Fe2O3  0.05 MnO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:41:26',NULL),
	(12424,424,12422,'Spodumene - Canadian','Spodumene - Canadian',NULL,NULL,'Canadian spodumene supplies SiO2, Al2O3, Li2O, Na2O, K2O, P2O5, MnO2, and Fe2O3.\r\n A low-iron spodumene manufactured by TANCO Tantalum Mining Corporation, Manitoba, Canada.\r\n Analyses:\r\n Obstler: (Chemical grade 200 mesh)\r\n % 0.30 Na2O  0.20 K2O  7.10 Li2O  25.00 Al2O3  65.00 SiO2 0.35 P2O5  0.12 Fe2O3  0.06 MnO2',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:42:02',NULL),
	(12425,425,12422,'Spodumene - High iron','Spodumene - High iron',NULL,NULL,'High iron spodumene supplies SiO2, Al2O3, Li2O, Fe2O3, K2O, and Na2O. Formerly minded/manufactured by Cyprus Specialty Metals (Foote Mineral Company); mine located in Kings Mountain, NC. As of 1990 the mine was temporarily closed.\r\n Analyses:\r\n Obstler: (Chemical grade 200 mesh)\r\n % 0.60 Na2O  1.18 K2O  5.78 Li2O  24.80 Al2O3  63.00 SiO2 2.28 Fe2O3',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 22:42:43',NULL),
	(12427,427,NULL,'Spruce ash','Spruce ash',NULL,NULL,'Spruce ash supplies several oxides, especially SiO2 and MgO.\n Analyses:\n Conrad:\n % 8.99 Na2O  6.53 K2O  10.99 MgO  8.56 CaO  2.19 Al2O3\n 19.01 SiO2  8.65 P2O5  2.46 Fe2O3\n Rogers:\n % 1.37 Na2O  19.66 K2O  11.27 MgO  33.97 CaO\n 2.73 SiO2  2.12 P2O5  1.42 Fe2O3  22.96 MnO\n 2.64 SO3  0.07 Cl\n Hamer & Hamer:\n % 10 Na2O  14 K2O  10 MgO  55 CaO\n 4 SiO2  7 P2O5\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:38:01',NULL),
	(12428,428,NULL,'Spruce Pine #4','Spruce Pine #4',NULL,NULL,'Spruce Pine #4 supplies SiO2, Al2O3, K2O, Na2O, CaO, MgO,\n and Fe2O3.\n Analyses:\n Chappell:\n % 6.22 Na2O  4.98 K2O  0.01 MgO  1.54 CaO  19.01 Al2O3\n 67.9 SiO2  0.05 Fe2O3  0.08 LOI\n IMC:\n % 6.23 Na2O  4.99 K2O  1.55 CaO  19.05 Al2O3\n 68.14 SiO2  0.06 Fe2O3\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:37:45',NULL),
	(12429,429,NULL,'Standard borax frit','Standard borax frit',NULL,NULL,'Map to your favorite borax frit.\n American substitute: Frit 3134.\n',26,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:37:12',NULL),
	(12430,430,NULL,'Stannous chloride','Stannous chloride','Stannous Chloride',NULL,'Stannous chloride supplies SnO2.\n A soluble form of tin used to fume pots to produce iridescence.\n Analyses:\n Hopper:\n SnCl2\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:47:32',NULL),
	(12431,431,NULL,'Strontium Carbonate','Strontium Carbonate','Strontium Carbonate',NULL,'Strontium carbonate supplies SrO.\n The main source of strontium in glazes. Can sometimes replace\n Barium carbonate in glazes (75% as much strontium as there was\n barium, by weight), in order to decrease toxicity. Has also been\n investigated as a replacement for calcium, zinc, and lead\n [Parmelee].\n Strontium carbonate may originate from the mineral Strontianite\n (SrCO3), but more often is refined from Celestite (SrSO4).\n Analyses:\n Hopper:\n SrCO3\n Rhodes:\n SrCO3\n Cuff:\n SrCO3\n Chappell:\n SrCO3\n Cushing:\n SrCO3\n Parmelee:\n SrCO3\n IMC:\n % 70.20 SrO  29.80 CO2\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:34:39',NULL),
	(12432,432,NULL,'Superpax','Superpax','Superpax',NULL,'Superpax supplies ZrO2 and SiO2.\n A fritted zirconium opacifier; very fine grain.\n Manufactured by TAM. (No longer available as of 2/2001.)\n Analyses:\n IMC:\n % 31.04 SiO2  61.06 ZrO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:35:56',NULL),
	(12433,433,NULL,'Talc (Theoretical)','Talc, Magnesium Silicate (Theoretical)','Talc',NULL,'Talc supplies SiO2, MgO, CaO, and small amounts of Na2O, Al2O3, Fe2O3, and MnO.  TX talc is reported to be less gassy than NY talc.  Talc is a magnesium silicate mineral with theoretical  composition 3MgO 4SiO2 H2O. Rocks made of talc are also known as  Soapstone or Steatite.  The talc used by potters (tremolitic talc) is usually a mixture  of the minerals Tremolite (2CaO 5MgO 8SiO2 H2O), Serpentine  (3MgO 2SiO2 2H2O), and Talc (3MgO 4SiO2 H2O), in an  approximately 2:1:1 ratio by weight. Talc is formed by a complex  metamorphic process from quartzite and dolomite. The process  occurs in several stages; each stage produces a later mineral in  the sequence.  New York talc is mined by R.T. Vanderbilt Co., Inc. in St.  Lawrence County, NY. This talc was formed in the Precambrian  (over 600 million years ago).  Talc is a common flux in low-fire clay bodies, especially white  clay bodies, and is used as a flux in stoneware glazes.\n Analyses:\n Obstler: (NYTAL 100HR 200 mesh)\n % 0.34 Na2O  30.0 MgO  8.42 CaO  0.31 Al2O3  55.2 SiO2  0.16 Fe2O3  0.17 MnO  5.41 LOI\n Obstler: (CERAMITALC No. 1  325 mesh)\n % 0.18 Na2O  29.0 MgO  6.94 CaO  0.29 Al2O3  56.8 SiO2  0.20 Fe2O3  0.13 MnO  6.46 LOI\n Hopper:\n 3 MgO  4 SiO2  H2O\n Cooper & Royle:\n 3 MgO  4 SiO2  H2O\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.046)\n % 33.40 MgO  0.42 CaO  0.15 Al2O3  58.30 SiO2\n 0.22 Fe2O3  7.33 LOI\n Rhodes:\n 3 MgO  4 SiO2  H2O\n Cuff:\n 3 MgO  4 SiO2  H2O\n Chappell:\n 3 MgO  4 SiO2  H2O\n Cushing:\n 3 MgO  4 SiO2  H2O\n Memmott:\n 3 MgO  4 SiO2  H2O\n Tichane (CB): (NY Talc)\n % 30.4 MgO  8.0 CaO  1.1 Al2O3  56.6 SiO2  0.3 Fe2O3  3.5 LOI\n Tichane (CB): (NC Talc)\n % 34.2 MgO  0.6 CaO  5.8 Al2O3  50.2 SiO2  1.6 Fe2O3  7.5 LOI\n IMC:\n % 33.46 MgO  66.54 SiO2\n',23,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-11 19:40:07',NULL),
	(12435,435,12058,'Tennessee #1 Ball Clay','Tennessee #1 Ball Clay','Tennessee #1 SGP',NULL,'Tennessee #1 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. Manufactured by the Kentucky-Tennessee Clay Company; comes from western Tennessee.\r\n Analyses:\r\n Tichane (CB):\r\n % 0.5 Na2O  0.9 K2O  0.1 MgO  0.3 CaO  32.7 Al2O3 50.6 SiO2  1.5 TiO2  0.8 Fe2O3  12.5 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:21:25',NULL),
	(12436,436,12058,'Tennessee #10 Ball Clay','Tennessee #10 Ball Clay','Tennessee #10 Ball Clay',NULL,'Tennessee #10 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. Manufactured by the Kentucky-Tennessee Clay Company; comes from western Tennessee.\r\n Analyses:\r\n Cooper & Royle: (Appendix 8)\r\n % 0.5 Na2O  0.7 K2O  0.3 MgO  0.3 CaO  33.2 Al2O3 50.4 SiO2  1.6 TiO2  0.9 Fe2O3  12.1 LOI\r\n Tichane (CB):\r\n % 0.5 Na2O  0.7 K2O  0.3 MgO  0.3 CaO  33.2 Al2O3 50.4 SiO2  1.6 TiO2  0.9 Fe2O3  12.1 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:20:53',NULL),
	(12437,437,12058,'Tennessee #5 Ball Clay','Tennessee #5 Ball Clay','Tennessee #5 Ball',NULL,'Tennessee #5 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. Tennessee #5 has an intermediate grain size and good plasticity; especially useful in casting slips. Contains 63% kaolinite, 21% free quartz, 8% feldspar, and 5% organic material. Manufactured by the Kentucky-Tennessee Clay Company; comes from western Tennessee.\r\n Analyses:\r\n Obstler: (Kentucky-Tennessee Clay Co., 1988)\r\n % 0.2 Na2O  1.3 K2O  0.5 MgO  0.4 CaO  26.3 Al2O3 55.4 SiO2  1.4 TiO2  1 Fe2O3  13.7 LOI\r\n Cooper & Royle: (Appendix 8)\r\n % 0.8 Na2O  1.5 K2O  0.2 MgO  0.3 CaO  31.1 Al2O3 53.3 SiO2  1.4 TiO2  1.0 Fe2O3  11.4 LOI\r\n Chappell: (slight variance from C&R)\r\n % 0.8 Na2O  1.5 K2O  0.2 MgO  0.3 CaO  30.1 Al2O3 53.3 SiO2  1.4 TiO2  1.0 Fe2O3  11.4 LOI\r\n Tichane (TCB, CB):\r\n % 0.8 Na2O  1.5 K2O  0.3 CaO  0.2 MgO  30.1 Al2O3 53.3 SiO2  1.4 TiO2  1.0 Fe2O3  11.4 LOI\r\n IMC:\r\n % 0.3 Na2O  1.0 K2O  0.4 MgO  0.3 CaO  27.9 Al2O3 55.2 SiO2  1.2 TiO2  1.1 Fe2O3  12.6 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:20:18',NULL),
	(12438,438,12058,'Tennessee #9 Ball Clay','Tennessee #9 Ball Clay','Tennessee #9 Ball Clay',NULL,'Tennessee #9 supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. Off-white, light-firing ball clay.  Contains 74% kaolinite, 17% free quartz, 5% feldspar, and 1% organic material. Manufactured by the Kentucky-Tennessee Clay Company; comes from western Tennessee.\r\n Analyses:\r\n Obstler: (Kentucky-Tennessee Clay Co., 1988)\r\n % 0.3 Na2O  0.8 K2O  0.5 MgO  0.6 CaO  30.6 Al2O3 51.8 SiO2  2 TiO2  0.8 Fe2O3  12.6 LOI\r\n Cushing:\r\n % 0.3 Na2O  0.4 K2O  0.4 MgO  0.5 CaO  30.1 Al2O3 54.2 SiO2  1.6 TiO2  1.1 Fe2O3  11.4 LOI\r\n Tichane (CB):\r\n % 0.3 Na2O  0.8 K2O  0.5 MgO  0.6 CaO  30.6 Al2O3 51.8 SiO2  2.0 TiO2  0.8 Fe2O3  12.6 LOI\r\n IMC:\r\n % 0.3 Na2O  0.4 K2O  0.4 MgO  0.5 CaO  30.1 Al2O3 54.2 SiO2  1.6 TiO2  1.1 Fe2O3  11.4 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:14:21',NULL),
	(12439,439,12058,'Tennessee ball clay','Tennessee ball clay',NULL,NULL,'Tennessee ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. Generic Tennessee ball clay; map to your favorite.',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:13:30',NULL),
	(12440,440,12058,'Thomas Ball Clay','Thomas Ball Clay','Thomas Ball Clay',NULL,'Thomas ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes. A Tennessee ball clay. Manufactured by Old Hickory Clay Co.\r\n Analyses:\r\n Old Hickory Clay Co.: (2001)\r\n % 0.08 Na2O  0.40 K2O  0.20 MgO  0.06 CaO  26.50 Al2O3 59.40 SiO2  1.60 TiO2  1.02 Fe2O3  10.74 LOI\r\n Tichane (CB):\r\n % 0.3 Na2O  1.0 K2O  0.6 MgO  0.2 CaO  27.0 Al2O3 58.1 SiO2  1.7 TiO2  1.1 Fe2O3  13.3 LOI\r\n IMC:\r\n % 0.08 Na2O  0.40 K2O  0.20 MgO  0.06 CaO  26.50 Al2O3 59.40 SiO2  1.60 TiO2  1.02 Fe2O3  10.60 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:12:58',NULL),
	(12442,442,NULL,'Tin Oxide','Tin Oxide, Stannic Oxide','Tin Oxide',NULL,'Tin oxide supplies SnO2.\n A highly effective whitener and opacifier used in low and high\n temperature glazes. Enhances color development of copper reds,\n iron reds, and chrome pinks.\n Prepared from the mineral Cassiterite.\n There are two types of tin oxide - white (SnO2) and black (SnO).\n White can be reduced to black above 200C, black oxidized to\n white above 700C. Both opacify, but black tin oxide causes a\n gray cloudiness - thus reduction can ruin a tin-opacified glaze\n [IMC].\n Analyses:\n Hopper:\n SnO2\n Cooper & Royle:\n SnO2\n Rhodes:\n SnO2\n Chappell:\n SnO2\n Cushing:\n SnO2\n Memmott:\n SnO2\n Parmelee:\n SnO2 (stannic), SnO (stannous)\n IMC:\n SnO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:40:53',NULL),
	(12443,443,NULL,'Titanium Dioxide','Titanium Dioxide','Titanium Dioxide',NULL,'Titanium dioxide supplies TiO2.\n A versatile opacifier that produces interesting surface and\n color effects. Tends to promote microcrystalline formations in\n glazes; produces cobalt greens and copper red purples. In excess\n can result in dry, pinholed surfaces.\n Naturally occurs as the minerals Anatase, Rutile, and Brookite.\n Anatase and Brookite are usually fairly pure and (according to\n Hamer) the usual source of white TiO2. IMC indicates that TiO2\n is usually produced by refining Ilmenite (FeTiO3).\n During firing, forms sphene (CaO TiO2 SiO2), which increases\n acid resistance and produces texture [Parmelee].\n Analyses:\n Hopper:\n TiO2\n Cooper & Royle:\n TiO2\n Rhodes:\n TiO2\n Chappell:\n TiO2\n Cushing:\n TiO2\n Memmott:\n TiO2\n Parmelee:\n TiO2\n IMC:\n TiO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:41:51',NULL),
	(12444,444,NULL,'Ultrox','Ultrox','Ultrox',NULL,'Ultrox supplies ZrO2 and SiO2.\n A fritted zirconium silicate opacifier. Three grades are\n available: Ultrox, Ultrox 500W, and Ultrox 1000W, having average\n particle sizes of 2, 1, and 0.5 microns, respectively [IMC].\n Smaller particles give greater opacity.\n Manufactured by M&T Chemical.\n Analyses:\n Hopper:\n (no analysis)\n IMC:\n % 65 ZrO2  35 SiO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:43:24',NULL),
	(12445,445,NULL,'Uranium Oxide','Uranium Oxide','Uranium Oxide',NULL,'Uranium oxide supplies U3O8.\n Source of uranium.\n Analyses:\n Hopper:\n U3O8\n Chappell:\n U3O8\n Parmelee:\n U2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12446,446,NULL,'Uranyl sodium carbonate','Uranyl sodium carbonate',NULL,NULL,'Uranyl sodium carbonate supplies U3O8.\n Source of uranium.\n Analyses:\n Parmelee:\n UO2CO3  2 Na2CO3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','0000-00-00 00:00:00',NULL),
	(12447,447,NULL,'Vanadium pentoxide','Vanadium pentoxide','Vanadium Pentoxide',NULL,'Vanadium pentoxide supplies V2O5.\n Colorant used to produce yellow, greenish yellow, reddish brown.\n Excess (more than can be dissolved in glaze) can cause irregular\n surfaces.\n Slightly soluble. Acts as a flux; reduces surface tension.\n Negative thermal expansion.\n Analyses:\n Hopper:\n V2O5\n Cooper & Royle:\n V2O5\n Chappell:\n V2O5\n Memmott:\n V2O5\n IMC\n V2O5\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:45:03',NULL),
	(12448,448,12288,'Velvacast Kaolin','Velvacast Kaolin','Velvacast Kaolin',NULL,'Velva Cast supplies SiO2, Al2O3, TiO2, Fe2O3, and\r\n small amounts of several fluxes.\r\n Kaolin for casting slip. Large particle size, low plasticity,\r\n and darker than most kaolins.\r\n Analyses:\r\n Cushing: (adds only to 88.7% - is LOI wrong?)\r\n % 0.11 Na2O  0.18 MgO  0.24 CaO  38.9 Al2O3\r\n 45.4 SiO2  1.43 TiO2  0.34 Fe2O3  2.1 LOI\r\n Tichane (CB):\r\n % 0.1 Na2O  0.2 MgO  0.2 CaO  38.9 Al2O3\r\n 45.4 SiO2  1.4 TiO2  0.3 Fe2O3  13.8 LOI\r\n IMC:\r\n % 0.19 MgO  0.26 CaO  38.91 Al2O3\r\n 45.49 SiO2  1.10 TiO2  0.37 Fe2O3  13.70 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:19:15',NULL),
	(12449,449,NULL,'Vermiculite','Vermiculite','Vermiculite',NULL,'An expanded micaceous rock containing over 70% silica. Used as\n an addition to clay bodies to open the structure and aid thermal\n shock resistance. Often wedged into clay cone packs.\n IMC says about Perlite: an aluminum potassium sodium silicate\n of volcanic origin, available as gray/white powder or as granular\n material. Used as grog in clay bodies.\n',35,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:49:13',NULL),
	(12450,450,NULL,'Volcanic Ash','Volcanic Ash, Pumicite','Volcanic Ash',NULL,'Volcanic ash supplies SiO2, Al2O3, K2O, Na2O, CaO, MgO, Fe2O3,\r\n TiO2, and P2O5.\r\n [Generic volcanic ash - use a general formula, or map to a\r\n particular type of volcanic ash. Typical density 155.0 g/c]\r\n Aluminosilicate glass of volcanic origin. Results when a\r\n volcano blows tiny particles of frothy lava into the air; these\r\n particles settle for many miles around, sometimes in layers over\r\n 30 feet deep. Variable in composition.\r\n Analyses:\r\n Obstler - Great Plains ash: (Ceramic Industry, 1993, 113)\r\n % 1.79 Na2O  7.84 K2O  0.07 MgO  0.68 CaO  11.55 Al2O3\r\n 72.51 SiO2  0.10 P2O5  0.54 TiO2  1.20 Fe2O3\r\n Obstler - Mt. St. Helens ash: (Ceramics Monthly Jan. 1981, 36)\r\n % 4.2-4.6 Na2O  1-2 K2O  1.75-3.75 MgO  4-6 CaO\r\n 16.3-19.7 Al2O3  61-66 SiO2  0.50-0.75 TiO2  4.5-7 Fe2O3\r\n Cooper & Royle: (European - pg. 33)\r\n % 5.10 Na2O  6.21 K2O  0.37 MgO  1.88 CaO  21.90 Al2O3\r\n 55.28 SiO2  0.28 TiO2  2.66 Fe2O3  5.64 H2O\r\n Cooper & Royle: (American - pg. 33)\r\n % 1.79 Na2O  7.84 K2O  0.07 MgO  0.68 CaO  11.55 Al2O3\r\n 72.51 SiO2  0.54 TiO2  1.21 Fe2O3  3.81 H2O\r\n Green:\r\n 0.72 KNaO  0.02 MgO  0.12 CaO  0.89 Al2O3  6.4 SiO2\r\n 0.01 TiO2  0.13 FeO\r\n IMC: (pumice)\r\n % 1.80 Na2O  7.80 K2O  0.70 CaO  11.50 Al2O3\r\n 72.50 SiO2  0.50 TiO2  1.20 Fe2O3  3.80 LOI\r\n IMC: (volcanic ash)\r\n % 0.11 Na2O  0.33 K2O  0.70 MgO  8.07 CaO  2.12 Al2O3\r\n 73.43 SiO2  1.11 Fe2O3  14.14 LOI',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2016-03-24 22:04:05',NULL),
	(12451,451,NULL,'Volcanic ash - Great Plains','Volcanic ash - Great Plains',NULL,NULL,'Volcanic ash (Great Plains) supplies SiO2, Al2O3, K2O, Na2O,\n CaO, MgO, Fe2O3, TiO2, and P2O5.\n Aluminosilicate glass of volcanic origin, deposited during the\n Pleistocene era from eruptions of the Valles Mountain in New\n Mexico. Found throughout the Great Plains region of the U.S.\n Similar in composition to Cornwall Stone.\n Analyses:\n Obstler: (Ceramic Industry, 1993, 113)\n % 1.79 Na2O  7.84 K2O  0.07 MgO  0.68 CaO  11.55 Al2O3\n 72.51 SiO2  0.10 P2O5  0.54 TiO2  1.20 Fe2O3\n Conrad: (Kansas volcanic ash)\n % 1.79 Na2O  7.84 K2O  0.07 MgO  0.68 CaO  11.55 Al2O3\n 72.51 SiO2  0.54 TiO2  1.21 Fe2O3\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:47:04',NULL),
	(12452,452,NULL,'Volcanic ash - Mt. St. Helens','Volcanic ash - Mt. St. Helens',NULL,NULL,'Volcanic ash (Mt. St. Helens) supplies SiO2, Al2O3, Na2O, K2O,\n CaO, MgO, Fe2O3, TiO2, and P2O5.\n Aluminosilicate glass of volcanic origin, deposited during the\n 1980 eruption of Mt. St. Helens in Oregon. Andesitic.\n Analyses:\n Obstler: (Ceramics Monthly Jan. 1981, 36)\n % 4.2-4.6 Na2O  1-2 K2O  1.75-3.75 MgO  4-6 CaO\n 16.3-19.7 Al2O3  61-66 SiO2  0.50-0.75 TiO2  4.5-7 Fe2O3\n Conrad:\n % 4.57 Na2O  1.47 K2O  2.21 MgO  4.94 CaO  16.9 Al2O3\n 65 SiO2  0.37 P2O5  0.13 TiO2  4.81 Fe2O3\n',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:47:09',NULL),
	(12453,453,12058,'Volunteer Ball Clay','Volunteer Ball Clay','Volunteer Ball Clay',NULL,'Volunteer ball clay supplies SiO2, Al2O3, TiO2, Fe2O3, and small amounts of several fluxes.\r\n Analyses:\r\n Old Hickory Clay Co.: (2001)\r\n % 0.08 Na2O  0.43 K2O  0.56 MgO  0.19 CaO 28.75 Al2O3  55.55 SiO2  1.84 TiO2 1.02 Fe2O3 11.38 LOI\r\n Tichane (CB):\r\n % 0.2 Na2O  0.5 K2O  0.1 MgO  27.1 Al2O3 58.9 SiO2  1.8 TiO2  1.1 Fe2O3  10.3 LOI\r\n IMC:\r\n % 0.08 Na2O  0.47 K2O  0.18 MgO  0.05 CaO  26.90 Al2O3 59.90 SiO2  1.70 TiO2  1.08 Fe2O3  9.60 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 20:12:04',NULL),
	(12454,454,NULL,'Walnut ash','Walnut ash',NULL,NULL,'Walnut ash supplies several oxides, especially CaO, K2O, and SiO2.\n Analyses:\n Conrad:\n % 4.9 Na2O  14.7 K2O  6.6 MgO  38.7 CaO  0.5 Al2O3\n 16 SiO2  6.5 P2O5  1.9 Fe2O3  0.42 MnO\n',9,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:48:18',NULL),
	(12456,456,NULL,'Lead Carbonate','Lead Carbonate, White lead','Lead Carbonate',NULL,'White lead supplies PbO.\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:49:33',NULL),
	(12457,457,NULL,'Whiting','Whiting, Calcium Carbonate','Calcium Carbonate',NULL,'Whiting supplies CaO.\n Whiting (CaCO3) is a fine grind of chalk (aragonite - marine\n shell deposits). The purest sources are in England, France, and\n Belgium. Other sources include marble, calcite ores, and sea\n shells. Whiting and limestone are not necessarily the same\n thing; limestone may contain considerable amounts of magnesium\n (i.e. dolomite). Some suppliers do not distinguish, so be sure\n to ask.\n Analyses:\n Obstler: (SnowCal 40 - Yorkshire English Whiting -\n Hammill and Gillespie 1993)\n % 97.05 CaCO3  1.85 SiO2  0.35 Al2O3  0.10 Fe2O3\n 0.25 MgO  0.05 SO3  0.01 K2O  0.16 Na2O  0.1 H2O\n plus 5 ppm Cu, 350 ppm Mn, 425 ppm P2O5\n Hopper:\n CaCO3\n Cooper & Royle:\n CaCO3\n Cuff:\n CaCO3\n Chappell:\n CaCO3\n Cushing:\n CaCO3\n Memmott:\n CaCO3\n Parmelee:\n CaCO3\n IMC:\n % 56.1 CaO  43.9 LOI\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:49:45',NULL),
	(12458,458,NULL,'Wollastonite (Theoretical)','Wollastonite (Theoretical)',NULL,NULL,'Wollastonite supplies CaO and SiO2. Wollastonite is calcium silicate, theoretical formula CaSiO3. It is formed by the metamorphosis of limestone. It may be used as a source of CaO and SiO2 in glazes. The two main differences between wollastonite and whiting+silica: 1) the wollastonite has no CO2 component, and thus no outgassing during firing, and 2) in wollastonite, the CaO and SiO2 are intimately mixed on the molecular scale. Thus, wollastonite might help to eliminate pinholes, and to slightly lower the firing temperature and increase glaze shine and transparency.\r\n Manufactured by R.T. Vanderbilt Co., Inc. and by NYCO; comes from New York.Cost per lb in 50 lb bag.\r\n Analyses:\r\n Obstler: (Ceramic Industry, 1993, 113)\r\n % 50.9 SiO2  46.9 CaO  0.5 FeO  0.25 Al2O3  0.10 MgO 0.10 MnO  0.90 LOI\r\n Hopper: (incorrect)\r\n CaSiO2\r\n Cooper & Royle:\r\n CaSiO3\r\n Cooper & Royle: (Harrison Mayer Ltd. 36.0.048)\r\n % 0.25 MgO  46.20 CaO  0.50 Al2O3  51.40 SiO2 0.03 TiO2  0.76 Fe2O3  0.70 LOI\r\n Cuff:\r\n CaSiO3\r\n Chappell:\r\n CaO  SiO2\r\n Cushing:\r\n CaO  SiO2\r\n Memmott:\r\n CaO  SiO2\r\n Parmelee:\r\n % 46.90 CaO  0.10 MgO  0.25 Al2O3  50.90 SiO2  0.05 TiO2 0.55 FeO  0.10 MnO  0.90 LOI\r\n Tichane (CB):\r\n % 0.3 Na2O  1.5 MgO  42 CaO  2 Al2O3 51 SiO2  0.3 Fe2O3  2.0 LOI\r\n IMC:\r\n % 0.3 MgO  47.0  CaO  1.0  Al2O3 50.0 SiO2  0.05 TiO2  0.5 Fe2O3  0.1 MnO',23,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-11-16 16:49:21',NULL),
	(12460,460,12058,'XX Sagger Ball Clay','XX Sagger Ball Clay',NULL,NULL,'XX Sagger clay supplies SiO2, Al2O3, Fe2O3, TiO2, and small amounts of several fluxes. Off-white ball clay, good flashing in soda/salt. Manufactured by K&T Clay Co.\r\n Analyses:\r\n Chappell: (Sagger)\r\n % 0.3 Na2O  0.7 K2O  0.2 MgO  0.6 CaO  27.2 Al2O3 59.4 SiO2  1.6 TiO2  0.7 Fe2O3  9.4 LOI\r\n Cushing: (XX Sagger)\r\n % 0.3 Na2O  0.9 K2O  0.3 MgO  0.5 CaO  28.9 Al2O3 57.4 SiO2  1.7 TiO2  0.7 Fe2O3  9.5 LOI\r\n Tichane (CB):\r\n % 0.3 Na2O  4.1 K2O  0.3 MgO  0.5 CaO  29.2 Al2O3 56.7 SiO2  1.7 TiO2  0.7 Fe2O3  4.8 LOI\r\n IMC: (Sagger XX ball clay)\r\n % 0.30 Na2O  0.89 K2O  0.30 MgO  0.50 CaO  29.17 Al2O3 56.73 SiO2  1.71 TiO2  0.69 Fe2O3  9.71 LOI',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 19:44:18',NULL),
	(12461,461,12371,'Yankee feldspar','Yankee feldspar','Yankee Feldspar',NULL,'Yankee feldspar supplies SiO2, Al2O3, K2O, and Na2O.\r\n Potash feldspar.\r\n Analyses:\r\n Cushing:\r\n 0.32 Na2O  0.68 K2O  1.06 Al2O3  7.24 SiO2\r\n IMC:\r\n % 3.16 Na2O  10.21 K2O  17.23 Al2O3  69.33 SiO2  0.08 Fe2O3',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-09-20 18:46:34',NULL),
	(12462,462,NULL,'Yellow Banks #101','Yellow Banks #101','Yellow Banks #101',NULL,'Yellow Banks #101 supplies SiO2, Al2O3, TiO2, Fe2O3, and small\n amounts of several fluxes.\n Plastic red/orange earthenware clay.\n Analyses:\n Cushing:\n % 3.26 Na2O  0.02 K2O  1.12 MgO  0.9 CaO  19.48 Al2O3\n 62.28 SiO2  0.93 TiO2  4.61 Fe2O3  6.07 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:53:00',NULL),
	(12463,463,NULL,'Yellow Banks #401','Yellow Banks #401','Yellow Banks #401',NULL,'Yellow Banks #401 supplies SiO2, Al2O3, TiO2, Fe2O3, and small\n amounts of several fluxes.\n Plastic stoneware clay.\n Analyses:\n Cushing:\n % 0.03 Na2O  0.01 K2O  0.97 MgO  0.38 CaO  30.91 Al2O3\n 54.61 SiO2  0.82 TiO2  1.46 Fe2O3  10.66 LOI\n IMC:\n % 0.03 Na2O  0.01 K2O  0.97 MgO  0.38 CaO  30.91 Al2O3\n 54.61 SiO2  0.82 TiO2  1.46 Fe2O3  10.66 LOI\n',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:53:04',NULL),
	(12464,464,NULL,'Yellow iron oxide','Yellow iron oxide','Iron Oxide Yellow',NULL,'Yellow iron oxide supplies Fe2O3.\n Ochre-colored iron oxide. This is not the same as yellow\n ochre, which is a naturally-occurring impure mixture of yellow\n iron oxide, clay, etc. Yellow iron oxide is manufactured by\n various processes. Tom Coleman uses yellow iron oxide in his\n glazes (not to be confused with yellow ochre) for iron\n colorant instead of red. It is clay impregnated and dissolves\n more readily in the glaze matrix than RIO. It [YIO] is about\n 75% as strong as RIO. In saturation, it goes maroon instead of\n metallic.\n Analyses:\n Hopper:\n Fe2O3\n IMC:\n Fe2O3  H2O\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:52:33',NULL),
	(12465,465,NULL,'Yellow Ochre','Yellow Ochre','Yellow Ochre',NULL,'Yellow ochre provides SiO2, Al2O3, MgO, CaO, and Fe2O3.\n Yellow form of the mineral Limonite, a natural hydrous iron ore\n usually formed by precipitation in bogs and lakes by the action\n of bacteria. Soft and crumbly, often contaminated with clay,\n limestone, and other matter. Red ochre is very similar, but is\n harder and contains less water.\n Analyses:\n Green:\n 0.01 MgO  0.03 CaO  1.42 Al2O3  6.99 SiO2  1.0 Fe2O3  3.96 H2O\n Chappell:\n Fe2O3 H2O\n Hamer:\n 2 Fe2O3  3 H2O\n Ochre:\n % 0.06 MgO  0.23 CaO  19.92 Al2O3  57.78 SiO2  22.01 Fe2O3\n',17,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:54:34',NULL),
	(12466,466,NULL,'Zinc carbonate','Zinc carbonate','Zinc Carbonate',NULL,'Zinc carbonate supplies ZnO.\n Analyses:\n Parmelee:\n ZnCO3\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-15 05:49:39',NULL),
	(12467,467,NULL,'Zinc Oxide','Zinc Oxide','Zinc Oxide',NULL,'Zinc oxide supplies ZnO.\n Zinc oxide is produced by reducing zinc sulfide to metallic\n zinc, followed by vaporization, oxidation, and condensation.\n Zinc oxide is used in stoneware glazes in oxidation, usually as\n an auxiliary flux to start the melt. Larger amounts may promote\n opacity through growth of Willemite crystals (Zn2SiO4). Large,\n fan-shaped crystals can develop with a proper glaze formulation\n and firing schedule.\n There is some debate about the role of zinc oxide in reduction;\n some sources say that it reduces to metallic zinc above 1742F,\n which immediately boils and leaves the glaze as a toxic gas.\n Many people have reported that removing a 1-3% addition of zinc\n oxide from a high-fire reduction glaze makes no noticeable\n difference in the fired product.\n Zinc oxide readily combines with H2O to form zinc hydroxide;\n this may result in a higher shrinkage of the raw glaze and\n subsequent crawling. The raw zinc oxide may be calcined to\n increase the density of the particles and reduce the absorption\n of H2O and the attendant problems. (Hopper recommends to calcine\n up to half of the zinc oxide.)\n Analyses:\n Obstler: (Ceramic Industry 1993, 114)\n % 99.5 ZnO  005 Pb  0.02 Fe  0.01 Cd  0.02 S  0.10  HCl\n plus 5ppm magnetic iron\n Hopper:\n ZnO\n Cooper & Royle:\n ZnO\n Rhodes:\n ZnO\n Chappell:\n ZnO\n Cushing:\n ZnO\n Memmott:\n ZnO\n Parmelee:\n ZnO\n IMC:\n ZnO\n',23,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:56:33',NULL),
	(12468,468,NULL,'Zirconium dioxide','Zirconium dioxide','Zirconium Dioxide',NULL,'Zirconium oxide supplies ZrO2.\n Plain zirconium oxide; very pure; seldom used in glazes\n (zirconium silicates used instead).\n Analyses:\n Hopper:\n ZrO2\n Cooper & Royle:\n ZrO2\n Rhodes:\n ZrO2\n Chappell:\n ZrO2\n Memmott:\n ZrO2\n Parmelee:\n ZrO2\n IMC:\n ZrO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:58:18',NULL),
	(12469,469,NULL,'Zircopax','Zircopax, Zirconium silicate','Zircopax',NULL,'Zirconium silicate supplies ZrO2 and SiO2.\n An inexpensive opacifier that produces cool white colors and\n helps to flux high-temperature glazes. More stable than tin oxide\n in reduction. Only about half as effective as tin as an opacifier;\n generally requires 5% for some opacity, up to 15% for complete\n opacity.\n Prepared from natural zircon sands. Sold under various trade\n names.\n Analyses:\n Hopper:\n ZrSiO4\n Cooper & Royle:\n ZrSiO4\n Rhodes:\n ZrO2  SiO2\n Cuff:\n ZrSiO4\n Cushing:\n ZrSiO4\n Memmott:\n ZrO2  SiO2\n IMC:\n % 61.64 ZrO2  32.57 SiO2  0.21 TiO2\n',29,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-16 21:59:40','2015-08-10 08:58:56',NULL),
	(12470,470,12407,'Minspar 200','Minspar 200 Feldspar','Minspar 200',NULL,'Minspar 200 was formerly NC-4 Feldspar. FELDSPAR MINSPAR 200 (Soda) is a soda feldspar used in glazes and clay bodies if a soda flux is wanted. 2010 - now the substitute for Kona F-4, which is no longer being mined. Minspar 200 is 200 mesh flotation grade soda feldspar used in the ceramic whiteware industry for sanitaryware, dinnerware, floor and wall tile, artware and glazes.\r\nImerys Minerals Ltd.\r\n8342 South 226 Bypass\r\nSpruce Pine, NC2877\r\nTel: +1 828 765 9621',20,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-19 21:48:23','2015-09-20 20:43:12',NULL),
