	(12489,489,NULL,'Roseville Clay','Roseville Clay','Roseville Clay',NULL,'From Digitalfire:\r\n\r\nhttp://digitalfire.com/4sight/material/roseville_clay_1202.html\r\n\r\nA selectively mined stoneware clay this is exceptionally cean and when ordered in 200 mesh offers the potter a stoneware fireclay which works well by itself or in compound bodies. The fired color is warn buff and it has a firing range of cone 1 to 8. This material will respond to deflocculnts and can thus be used in slip casting bodies.\r\n\r\nThis has been used for over 100 years by Roseville and Zanesville, OH potters. Some add small amounts of grog to impart texture and improve drying.',13,0,1,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-07-19 22:46:09','2015-09-21 14:52:52',NULL),
