	(12593,593,NULL,'Montmorillonite Clay (Theoretical)','Montmorillonite Clay (Theoretical)','Montmorillonite',NULL,'https://en.wikipedia.org/wiki/Montmorillonite\r\n\r\nMontmorillonite is a very soft phyllosilicate group of minerals that typically form in microscopic crystals, forming a clay. It is named after Montmorillon in France. Montmorillonite, a member of the smectite group, is a 2:1 clay, meaning that it has 2 tetrahedral sheets sandwiching a central octahedral sheet. The particles are plate-shaped with an average diameter around 1 μm. Members of this group include saponite.\r\n\r\nMontmorillonite is a subclass of smectite, a 2:1 phyllosilicate mineral being characterized as having greater than 50% octahedral charge; its cation exchange capacity is due to isomorphous substitution of Mg for Al in the gibbsitic plane. In contrast, beidellite is smectite with greater than 50% tetrahedral charge originating from isomorphous substitution of Al for Si in the quartz sheet.\r\n\r\nThe water content of montmorillonite is variable and it increases greatly in volume when it absorbs water. Chemically, it is hydrated sodium calcium aluminium magnesium silicate hydroxide (Na,Ca)0.33(Al,Mg)2(Si4O10)(OH)2·nH2O. Potassium, iron, and other cations are common substitutes, and the exact ratio of cations varies with source. It often occurs intermixed with chlorite, muscovite, illite, cookeite, and kaolinite.',13,0,1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,0.00,NULL,NULL,0,1,NULL,'2015-09-25 15:24:41','2015-09-25 15:24:41',NULL),
